INSERT INTO `kritik_saran` (`id`, `nama`, `email`, `tlp`, `subjek`, `pesan`, `waktu`, `status`) VALUES
(1, 'ade apriliansyah', 'adeapriliansyahiyan864@yahoo.com', '085239725207', 'saya pasien', 'saya mau cek pasien ,atas nama :ade apriliansyah ,ada kaga duku di rawat di situ pak,,,,,,', '20 agustus 2014', 0),
(2, 'Fadli', 'rajasemut2012@gmail.com', '081803670663', 'Profil', 'klo bisa foto profile pimpinan d tampilkan.. Trims :)', '29 mai 2015', 0),
(3, 'Ria Rismayati', 'ri25_ayoue@yahoo.co.id', '081805706011', 'format pesan', 'Selamat Sore\r\ndisini saya sebagai orang awam yang melihat web Rumah Sakit Jiwa Mutiara Sukma sudah sangat bagus dan padat informasi. untuk beberapa point yang dapat saya tambahkan disini adalah penggunaan format pesan yang masih berupa singkatan (ex : TOR, RKA, DPA,TUPOKSI dll), alangkah baiknya dijabarkan, dikarenakan web ini sifatnya adalah public (semua kalangan dapat mengakses). Pengguna awam seperti saya tidaklah familiar dengan singkatan2 tersebut. Terimakasi...... ', '23 november 2016', 1),
(4, 'adi', '-', '081817073478', 'info pelayanan', 'mohon info pelayanan apa saja yang ada di RSJ. Terimakasih.', '22 desember 2016', 0),
(5, 'Botani', 'btanideca@gmail.com', '081916090403', 'Banyak', 'Apakah normal ketika semua petugas/perawat karaoke2an dengan suara indah nya dan tertawa2 kegirangan ketikakeluarga pasien sangat2 cemas dengan keadaan keluarga nya...\r\nYang gila pasien atau semua petugas/perawat jaga pada tanggal 16/01/2018 pada jam 11.00 WITA.\r\nDan satu hal lagi, kenapa perawat IGD mempersulit keluarga dengan mengatakan bahwa kamar (bangsal) penuh sedangkan perawat di kamar (bangsal) mengatakan selalu ada kamar yang kosong???', '17 januari 2018', 0);
INSERT INTO `kritik_saran_balas` (`id`, `kode`, `nama`, `balasan`, `type`) VALUES
(19, '13', 'Admin', 'Pemanfaatan/pembangunan lahan Ex Bandara Selaparang sangat tergantung sepenuhnya pada PT.Angkasa Pura I sebagai pemilik lahan tersebut,namun demikian Pemerintah Kota Mataram telah melakukan ikhtiar melalui membangun komunikasi dengan Pemerintah Provinsi dan Menteri BUMN untuk pemanfaatan Ex Bandara Selaparang sesuai RTRW Kota Mataram, dan Pemerintah Kota Mataram siap memfasilitasi dan memberikan kemudahan dalam pengurusan perijinan sehingga areal Ex Bandara Selaparang tersebut dapat memberikan manfaat,terutama dalam meningkatkan kesejahteraan masyarakat sekitar.\r\n\r\nSumber : Bappeda Kota Mataram', 1),
(20, '14', 'Admin', 'Pemanfaatan/pembangunan lahan Ex Bandara Selaparang sangat tergantung sepenuhnya pada PT.Angkasa Pura I sebagai pemilik lahan tersebut,namun demikian Pemerintah Kota Mataram telah melakukan ikhtiar melalui membangun komunikasi dengan Pemerintah Provinsi dan Menteri BUMN untuk pemanfaatan Ex Bandara Selaparang sesuai RTRW Kota Mataram, dan Pemerintah Kota Mataram siap memfasilitasi dan memberikan kemudahan dalam pengurusan perijinan sehingga areal Ex Bandara Selaparang tersebut dapat memberikan manfaat, terutama dalam meningkatkan kesejahteraan masyarakat sekitar.\r\n\r\nSumber : Bappeda Kota Mataram', 1),
(21, '16', 'Admin', 'Terimakasih atas apresiasi anda terhadap Kota Mataram', 1),
(22, '17', 'Admin', 'Yth sdr Tutut Riadi..Terima kasih telah menghubungi kami. Sehubungan dengan email bapak,Dikes Kota Matram telah melakukan PE (Penyelidikan Epidemologi)/untuk memastikan kasus DBD di lokasi tersebut. Dari hasil PE oleh petugas puskesmas dan konfirmasi ke rumah sakit,didapatkan data bahwa ada penderita bernama tn Salmin 37 th dan sdri Ayu Tika Dewi dengan alamat lingkungan Kebon Jaya Timur Monjok yang berobat ke RS RISA di poli rawat jalan.Tidak opname di rumah sakit. Untuk fogging, Dikes melakukan fogging focus,di lokasi dimana jika ada kasus DBD yang sudah dikonfirmasi dari rumah sakit. Dan fogging focus dilakukan dengan radius 100 meter dari rumah penderita. Terimakasih. Sumber : Dinas Kesehatan Kota Mataram Seksi P2B', 1),
(23, '18', 'Admin', 'Terimakasih atas saran anda. Perlu diketahui bahwa website Pemerintah Kota Mataram sedang kami maintenance terutama dalam hal content dan update data. Kondisi inilah yang menyebabkan banyak menu yang masih kosong. Namun kami para admin terus bekerja melakukan entry data setiap saat agar website ini segera rampung.Demikian harap maklum', 1),
(24, '18', 'Ade Pradana', 'Ya, semoga cepat terisi penuh web ini, soalnya web ini sangat membantu warga kota mataram, terima kasih.', 0),
(25, '18', 'Admin', 'Terimakasih, kami mohon dukungan dari segenap masyarakat Kota Mataram.', 1),
(26, '19', 'Admin', 'Yth.Aziz Rahman, Peta Kota Mataram sudah kami muat di menu Sekilas Mataram sub menu Peta Kota. Pada tampilan awal terlihat pembagian wilayah berdasarkan kecamatan,namun jika di-klik masing-masing kecamatan akan muncul pembagian wilayah berdasarkan kelurahan di tiap kecamatan tersebut.Demikian semoga bermanfaat.', 1),
(27, '21', 'Admin', 'Terimakasih atas saran Anda, untuk peta sudah bisa dilihat di menu Sekilas Mataram, di sana terdapat peta kota Mataram  yang terdiri 6 kecamatan dan masing-masing  kecamatan dipetakan lagi beberapa kelurahan. Anda tinggal klik di peta kelurahan untuk melihat informasi tentang kelurahan. \r\nPerlu diketahui Website Kota Mataram masih dalam proses update data sehingga masih ditemukan data yang kosong, tetapi kami berusaha untuk melengkapinya.\r\nSemoga bisa membantu', 1),
(28, '27', 'Admin', 'Kepada Yth sdr Herman.\r\nSebelumnya kami ucapkan terimakasih atas masukan saran dan kritik yang telah disampaikan melalui media website ini,  kami sudah menyampaikan permasalahan saudara ke SKPD teknis terkait yaitu Dinas Pertamanan Kota Mataram dan Dinas Koperasi Perindustrian  dan Perdagangan Kota Mataram.\r\nSalam Admin', 1),
(29, '30', 'Admin', 'Terimakasih, dimohon kesabarannya karena sedang kami maintenance', 1),
(30, '29', 'Admin', 'Wss.Wr.Wb. Terimakasih atas apresiasinya. Dimohon kesabarannya karena kami para admin sedang melakukan maintenance.', 1),
(31, '33', 'Admin', 'Terima kasih, saran anda sudah kami sampaikan pada dinas terkait', 1),
(32, '32', 'Admin', 'Terimakasih atas apresiasi anda terhadap Kota Mataram', 1),
(33, '30', 'Admin', 'Untuk menu Download sudah kami upload, silahkan bisa Anda lihat kembali Website Kota Mataram', 1),
(34, '31', 'Admin', 'Pesan saudara mengenai  Informasi tentang perusahaan pembekuan ikan ( Cold Storage ), sudah kami sampaikan pada dinas terkait, mohon menunggu . Terimakasih', 1),
(35, '34', 'Admin', 'Mohon maaf Pak, untuk informasi mengenai pencairan Gaji 13 Pensiunan bisa ditanyakan langsung ke PT Taspen karena kami Pemerintah Kota Mataram tidak memiliki kewenangan menangani masalah tersebut', 1),
(36, '35', 'Admin', 'Mohon maaf, untuk informasi mengenai perekrutan CPNS 2013 kami belum bisa memastikan bulan pelaksanaannya karena belum ada pengumuman resmi dari Badan Kepegawaian Daerah Kota Mataram. Jika nanti telah ada pengumuman resmi, pasti kami publikasikan melalui website ini', 1),
(37, '36', 'Admin', 'Terimakasih atas masukannya. Memang benar link search belum berfungsi karena kami sementara ini sedang fokus pada proses update data. Link search tentunya tidak akan maksimal tanpa ketersediaan data yang cukup. Namun bukan berarti link search luput dari perhatian kami, secepatnya akan kami fungsikan. Salam, Admin', 1),
(38, '37', 'Admin', 'Terimakasih, pesan anda sudah kami sampaikan langsung ke Satuan Pol PP Kota Mataram. Salam, Admin', 1),
(39, '3', '', '', 0);
