INSERT INTO `ppid_berita` (`id`, `nama_berita`, `url_title`, `deskripsi`, `file_name`, `id_kategori_berita`, `created_at`) VALUES
(1, 'PROFIL PEJABAT PENGELOLA INFORMASI DAN DOKUMENTASI RUMAH SAKIT JIWA MUTIARA SUKMA', 'profil-pejabat-pengelola-informasi-dan-dokumentasi-rumah-sakit-jiwa-mutiara-sukma', '<p>Keberadaan Undang-undang tentang keterbukaan informasi publik sangat penting sebagai landasan hukum yang berkaitan dengan (1) hak setiap orang untuk memperoleh informasi (2) kewajiban badan publik menyediakan dan melayani permintaan informasi secara cepat, tepat dan sederhana (3) pengecualikan bersifat ketat dan terbatas (4) kewajiban badan publik untuk membenahi sistem dokumentasi dan pelayanan informasi.</p>\r\n<p>Hak atas informasi menjadi sangat penting karena makin terbuka penyelenggaraan negara untuk diawasi oleh publik, penyelenggara negara makin dapat dipertanggungjawabkan. Hak setiap orang untuk memperoleh informasi juga relevan untuk meningkatkan kualitas pelibatan masyarakat dalam proses pengambilan keputusan publik. Partisipasi dan pelibatan masayarakat tidak banyak berarti tanpa jaminan keterbukaan informasi.</p>\r\n<p>Transparansi dan akuntabilitas badan publik membuka peluang partisipasi masyarakat dalam pembangunan. Bagi badan publik keterbukaan informasi dapat menciptakan tata pemerintahan yang dan menjadi alat efektif dalam pencegahan Korupsi Kolusi Nepotisme (KKN).</p>\r\n<p>Sesuai dengan amanat Undang-undang No. 14 Tahun 2008, Rumah Sakit Jiwa Mutiara Sukma sebagai salah satu Organisasi Perangkat Daerah (OPD) telah membentuk Pejabat Pengelola Informasi dan Dokuemntasi (PPID) dengan Surat Keputusan Direktur Rumah Sakit Jiwa Mutiara Sukma Nomor : 188/1089/RSJP/2014. Dengan Terbentuknya PPID pemohon informasi sesuai dengan haknya dapat memperoleh layanan informasi publik yang dihasilkan oleh Rumah Sakit Jiwa Mutiara Sikma</p>\r\n<p>Pejabat Pengelola Informasi dan Dokuementasi (PPID) Rumah Sakit Jiwa Mutiara Sukma beralamat : Jalan Ahmad Yani No. 1 Selagalas Mataram Kode Post 83237 Telp. (0370) 672140 Fax. 671515 Email : rsjmutiarasukma@gmail.com. Website : rsjmutiarasukma.ntbprov.go.id.</p>', '5f5126421371eed0824de50d60d5b191.jpg', 2, '2019-10-16 07:46:04'),
(2, 'Visi Misi', 'visi-misi', '<h1><strong>Visi:</strong></h1>\r\n<p>Terwujudnya pelayanan informasi yang transparan dan akuntabel untuk memenuhi hak pemohon informasi</p>\r\n<h1><strong>Misi:</strong></h1>\r\n<p><br /> 1. Meningkatkan pengelolaan dan pelayanan informasi publik<br /> 2. Membangun dan mengembangkan system penyediaan dan pelayanan informasi publik<br /> 3. Meningkatkan pengelolaan dokumentasi dan informasi publik.</p>', 'd6a7bdc94e3fd3774fb586e1cf8954ad.jpeg', 2, '2019-10-16 07:52:34'),
(3, 'Struktur Organisasi', 'struktur-organisasi', '<p><img src=\"../../upload/Profile/struktur.jpg\" alt=\"Struktur Organisasi\" width=\"800\" height=\"400\" /></p>', '57685825b27aebf80bfd631927c69ef6.jpg', 2, '2019-10-16 08:04:29'),
(4, 'TUGAS POKOK DAN FUNGSI PEJABAT PENGELOLA INFORMASI DAN INFORMASI RUMAH SAKIT JIWA MUTIARA SUKMA', 'tugas-pokok-dan-fungsi-pejabat-pengelola-informasi-dan-informasi-rumah-sakit-jiwa-mutiara-sukma', '<p><strong>PPID mempunyai tugas dan wewenang sebagai berikut :</strong><br />1. Mengkoordinasikan dan mengkonsolidasikan pengumpulan bahan informasi dan dokumentasi<br />2. Menyimpan, mendokumentasikan, menyediakan dan memberi pelayanan informasi kepada publik<br />3. Melakukan verifikasi bahan informasi publik<br />4. Melakukan uji konsekuensi atas informasi yang dikecualikan<br />5. Menyediakan informasi dan dokumentasi untuk diakses oleh masyarakat</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Kewenangan PPID terdiri atas :</strong><br />1. Menolak memberikan informasi yang dikecualikan sesuai dengan ketentuan peraturan perundang-undangan<br />2. Mengkoordinasikan pemberian pelayanan informasi dengan unit terkait<br />3. Menentukan atau menetapkan suatu informasi dapat/tidaknya diakses oleh publik</p>', 'adaab4115c25540a924f3d15f3ce5921.jpeg', 2, '2019-10-16 08:50:21'),
(5, 'MEKANISME / ALUR PELAYANAN PERMOHONAN INFORMASI PUBLIK', 'mekanisme-alur-pelayanan-permohonan-informasi-publik', '<p>Berikut langkah-langkah melakukan permohonan Informasi Publik</p>\r\n<p>&nbsp;</p>\r\n<ol type=\"1\">\r\n<li>Pemohon informasi datang ke desk layanan informasi dan mengisi formulir permintaan informasi dengan melampirkan fotocopy KTP pemohon/identitas lain yang sah atau pengguna informasi.</li>\r\n<li>Petugas memberikan tanda bukti penerimaan permintaan informasi kepada pemohon.</li>\r\n<li>Petugas memproses permintaan informasi sesuai dengan formulir yang telah di tandatangani oleh pemohon.</li>\r\n<li>Petugas memenuhi permintaan informasi sesuai dengan yang diminta oleh pemohon, dan apabila informasi yang diminta tidak dalam penguasaan dan atau termasuk kategori informasi yang dikecualikan, PPID menyampaikan alasan sesuai dengan ketentuan peraturan perundangan yang berlaku.</li>\r\n<li>Petugas memberi tanda bukti penyerahan informasi kepada pemohon.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><img src=\"../upload/Profile/alur-permohonan-info.jpg\" alt=\"\" /></p>', '83e32d63b5319f99c9fffd9e04d91bed.jpg', 2, '2019-10-16 08:54:06'),
(6, 'TATA CARA PENYELESAIAN SENGKETA INFORMASI', 'tata-cara-penyelesaian-sengketa-informasi', '<p><img src=\"../upload/Profile/Tata-Cara-Penyelesaian-Sengketa.jpg\" alt=\"\" width=\"923\" height=\"735\" /></p>\r\n<p>&nbsp;</p>\r\n<ol type=\"1\">\r\n<li>Permohonan Penyelesaian Sengketa Informasi dapat diajukan secara langsung (datang langsung), melalui permohonan secara tertulis (surat) dikirim melalui email atau surat tercatat dan secara online;</li>\r\n<li>Permohonan Penyelesaian Sengketa Informasi Secara Langsung;</li>\r\n<li>Pemohon mengisi Form Permohonan Penyelesaian Sengketa Informasi yang telah disediakan petugas;\r\n<ol type=\"a\">\r\n<li>Membawa bukti surat permohonan informasi kepada Badan Publik dan tanda terimanya;</li>\r\n<li>Membawa bukti jawaban permohonan informasi dari Badan Publik beserta tanda terimanya (jika ada);</li>\r\n<li>Membawa bukti pengajuan keberatan kepada Badan Publik dan tanda terimanya;</li>\r\n<li>Membawa bukti jawaban keberatan dari Badan Publik beserta tanda terimanya (jika ada);</li>\r\n<li>Membawa bukti identitas (jika individu maka dibuktikan dengan Kartu Tanda Penduduk dan jika Badan Hukum dibuktikan dengan Anggaran Dasar yang telah mendapat pengesahan sebagai Badan Hukum dan bila dikuasakan dibuktikan dengan surat kuasa);</li>\r\n</ol>\r\n</li>\r\n<li>Permohonan Penyelesaian Sengketa Informasi Secara Tertulis;</li>\r\n<ol type=\"a\">\r\n<li>Mengirim Surat Permohonan Penyelesaian Sengketa Informasi yang ditujukan ke Ketua Komisi Informasi Provinsi Jawa Barat dengan melampirkan;bukti surat permohonan informasi kepada Badan Publik dan tanda terimanya;</li>\r\n<li>Bukti jawaban permohonan informasi dari Badan Publik beserta tanda terimanya (jika ada);</li>\r\n<li>Bukti pengajuan Keberatan kepada Badan Publik dan tanda terimanya;</li>\r\n<li>Bukti jawaban keberatan dari Badan Publik beserta tanda terimanya (jika ada);</li>\r\n<li>Bukti identitas (jika individu maka dibuktikan dengan Kartu Tanda Penduduk dan jika Badan Hukum dibuktikan dengan Anggaran Dasar yang telah mendapat pengesahan sebagai Badan Hukum dan bila dikuasakan dibuktikan dengan surat kuasa);</li>\r\n</ol>\r\n<li>Permohon Penyelesaian Sengketa Informasi Secara Online<br />Permohonan Penyelesaian Sengketa Informasi Secara Online dapat dikirim ke rsjmutiarasukma@gmail.com</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Sanksi Pidana UU No 14 Tahun 2008 Tentang Keterbukaan Informasi Publik</strong></p>\r\n<p><strong>Pasal 51</strong></p>\r\n<p>Menggunakan informasi publik secara melawan hukum dipidana penjara paling lama 1 (satu) tahun dan/ atau pidana denda paling banyak Rp. 5 Juta rupiah.</p>\r\n<p><strong>Pasal 52</strong></p>\r\n<p>Badan Publik yang sengaja tidak menyediakan, tidak memberikan, dan /atau tidak menerbitkan Informasi Publik dan mengakibatkan kerugian dikenakan pidana kurungan paling lama 1 (satu) tahun dan /atau pidana denda paling banyak Rp. 5 Juta rupiah.</p>\r\n<p><strong>Pasal 53</strong></p>\r\n<p>Orang yang sengaja melawan hukum menghancurkan, merusak, dan / atau menghilangkan dokumen Informasi Publik dalam bentuk apapun dipidana dengan pidana penjara paling lama 2 (dua) tahun dan/atau Pidana denda paling banyak Rp. 10 Juta rupiah.</p>\r\n<p><strong>Pasal 54 ayat (1)</strong></p>\r\n<p>Dengan sengaja dan tanpa hak mengakses; memperoleh; memberikan informasi yang dikecualikan pidana penjara paling lama 2 tahun dan denda paling banyak Rp. 10 Juta rupiah.</p>\r\n<p><strong>Pasal 54 ayat (2)</strong></p>\r\n<p>Dengan dengaja dan tanpa hak mengakses; memperoleh; memberikan informasi dikecualikan yang membahayakan kemanan dan ekonomi negara, pidana pencjara paling lama 3 tahun dan denda paling banyak Rp. 20 Juta rupiah.</p>\r\n<p><strong>Pasal 55</strong></p>\r\n<p>Sengaja membuat Informasi Publik tidak benar atau menyesatkan dan mengakibatkan kerugian orang lain, pidana penjara paling lama 3 tahun dan denda paling banyak Rp. 5 juta rupiah.</p>\r\n<p><strong>Pasal 56</strong></p>\r\n<p>Pelanggaran juga duancam dengan sanksi UU lain yang bersifat khusus</p>\r\n<p><strong>Pasal 57</strong></p>\r\n<p>Tuntutan pidana merupakan delik aduan dan diajukan melalui peradilan Pidana.</p>\r\n<p>Sumber :</p>\r\n<p><em>www.komisisiinformasi.go.id</em></p>\r\n<p>&nbsp;</p>', '676ee75067e8f336a73c45bfbc6d7e3f.jpg', 2, '2019-10-16 08:57:33'),
(7, 'Hak-hak Pemohon Informasi', 'hak-hak-pemohon-informasi', '<p>Berdasarkan Undang-undang Keterbukaan Informasi Publik No. 14/2008 :</p>\r\n<ol>\r\n<li>Pemohon Informasi berhak untuk meminta seluruh informasi yang berada di Badan Publik kecuali :\r\n<ol>\r\n<li>Informasi yang apabila dibuka dan diberikan kepada pemohon informasi dapat:\r\n<ul>\r\n<li>Menghambat proses penegakan hukum;</li>\r\n<li>Menganggu kepentingan perlindungan hak atas kekayaan intelektual dan perlindungan dari persaingan usaha tidak sehat;</li>\r\n<li>Membahayakan pertahanan dan keamanan Negara;</li>\r\n<li>Mengungkap kekayaan alam Indonesia;</li>\r\n<li>Merugikan ketahanan ekonomi nasional;</li>\r\n<li>Merugikan kepentingan hubungan luar negeri;</li>\r\n<li>Mengungkap isi akta otentik yang bersifat pribadi dan kemauan terakhir ataupun wasiat seseorang;</li>\r\n<li>Mengungkap rahasia pribadi;</li>\r\n<li>Memorandum atau surat-surat antar Badan Publik atau intra Badan Publik yang menurut sifatnya dirahasiakan kecuali atas putusan Komisi Informasi atau Pengadilan;</li>\r\n<li>Informasi yang tidak boleh diungkapkan berdasarkan Undang-undang.</li>\r\n</ul>\r\n</li>\r\n<li>Badan Publik juga dapat tidak memberikan informasi yang belum dikuasai atau didokumentasikan.</li>\r\n</ol>\r\n</li>\r\n<li>Biaya yang dikenakan bagi permintaan atas salinan informasi berdasarkan Peraturan Pimpinan Badan Publik.</li>\r\n<li>Pemohon Informasi berhak untuk mendapatkan pemberitahuan tertulis atas diterima atau tidaknya permohonan informasi dalan jangka waktu 10 (sepuluh) hari kerja sejak diterimanya permohonan informasi oleh Badan Publik.</li>\r\n<li>Badan Publik dapat memperpanjang waktu untuk memberi jawaban tertulis 1 x 7 hari kerja.</li>\r\n<li>PASTIKAN ANDA MENDAPAT TANDA TERIMA PERMINTAAN INFORMASI BERUPA NOMOR PENDAFTARAN KE PETUGAS INFORMASI/PPID.</li>\r\n<li>Bila tanda terima tidak diberikan tanyakan kepada petugas informasi alasannya, mungkin permintaan informasi anda kurang lengkap.</li>\r\n<li>Apabila Pemohon Informasi tidak puas dengan keputusan Badan Publik (misal menolak permintaan anda atau memberikan hanya sebagian yang diminta), maka pemohon informasi dapat mengajukan keberatan kepada atasan PPID dalam jangka waktu 30 (tiga puluh) hari kerja sejak di permohonan informasi ditolak.</li>\r\n<li>Atasan PPID wajib memberikan tanggapan tertulis atas keberatan yang diajukan Pemohon Informasi selambat-lambatnya 30 (tiga puluh) hari kerja sejak keberatan tertulis yang diajukan oleh Pemohon Informasi diterima.</li>\r\n<li>Apabila Pemohon Informasi tidak puas dengan keputusan Atasan PPID, maka pemohon informasi dapat mengajukan keberatan kepada Komisi Informasi dalam jangka waktu 14 (empat belas) hari kerja sejak tanggapan dari atasan PPID diterima oleh Pemohon Informasi Publik.</li>\r\n</ol>', '1e132628997d6af781becd3658133926.jpg', 2, '2019-10-16 08:58:34'),
(8, 'Kewajiban Badan Publik', 'kewajiban-badan-publik', '<div class=\"container-fluid bg-grey\">\r\n<div class=\"container\">\r\n<p><strong>Pasal 7 UU No. 14 Tahun 2008&nbsp;</strong>tentang Keterbukaan Informasi Publik</p>\r\n<ol>\r\n<li>Badan Publik wajib menyediakan, memberikan dan/atau menerbitkan Informasi Publik yang berada di bawah kewenangannya kepada Pemohon Informasi Publik, selain informasi yang dikecualikan sesuai dengan ketentuan;</li>\r\n<li>Badan Publik wajib menyediakan Informasi Publik yang akurat, benar, dan tidak menyesatkan;</li>\r\n<li>Untuk melaksanakan kewajiban sebagaimana dimaksud pada angka 2, Badan Publik harus membangun dan mengembangkan sistem informasi dan dokumentasi untuk mengelola Informasi Publik secara baik dan efisien sehingga dapat diakses dengan mudah;</li>\r\n<li>Badan Publik wajib membuat pertimbangan secara tertulis setiap kebijakan yang diambil untuk memenuhi hak setiap orang atas Informasi Publik;</li>\r\n<li>Pertimbangan sebagaimana dimaksud pada angka 4, antara lain memuat pertimbangan politik, ekonomi, sosial, budaya, dan/atau pertahanan dan keamanan Negara;</li>\r\n<li>Dalam rangka memenuhi kewajiban sebagaimana dimaksud pada angka 1 sampai dengan angka 4, Badan Publik dapat memanfaatkan sarana dan/atau media elektronik dan nonelektronik</li>\r\n</ol>\r\n<p><strong>Pasal 4 PERKI No. 1 Th. 2010&nbsp;</strong>tentang Standar Layanan Informasi Publik</p>\r\n<ol>\r\n<li>Menetapkan peraturan mengenai standar prosedur operasional layanan Informasi Publik;</li>\r\n<li>Membangun dan mengembangkan sistem informasi dan dokumentasi untuk mengelola Informasi Publik secara baik dan efisien;</li>\r\n<li>Menunjuk dan mengangkat PPID untuk melaksanakan tugas dan tanggung jawab serta wewenangnya;</li>\r\n<li>Menganggarkan pembiayaan secara memadai bagi layanan Informasi Publik sesuai dengan peraturan perundang-undangan yang berlaku;</li>\r\n<li>Menyediakan sarana dan prasarana layanan Informasi Publik, termasuk papan pengumuman dan meja informasi di setiap kantor Badan Publik, serta situs resmi bagi Badan Publik Negara;</li>\r\n<li>Menetapkan standar biaya perolehan salinan Informasi Publik;</li>\r\n<li>Menetapkan dan memutakhirkan secara berkala Daftar Informasi Publik atas seluruh Informasi Publik yang dikelola;</li>\r\n<li>Menyediakan dan memberikan Informasi Publik;</li>\r\n<li>Memberikan tanggapan atas keberatan yang diajukan oleh Pemohon Informasi Publik yang mengajukan keberatan;</li>\r\n<li>Membuat dan mengumumkan laporan tentang layanan Informasi Publik sesuai dengan Peraturan ini serta menyampaikan salinan laporan kepada Komisi Informasi; dan</li>\r\n<li>Melakukan evaluasi dan pengawasan terhadap pelaksanaan layanan Informasi Publik pada instansinya.</li>\r\n</ol>\r\n<p><strong>Jenis Informasi Publik</strong></p>\r\n<ol>\r\n<li>Informasi yang wajib disediakan dan diumumkan secara berkala adalah informasi yang telah dikuasai dan didokumentasikan oleh Badan Publik untuk diumumkan secara teratur dan rutin tanpa ada permintaan;</li>\r\n<li>Informasi yang wajib diumumkan secara serta merta, adalah informasi yang apabila tidak disampaikan dapat mengancam hajat hidup orang banyak dan ketertiban umum yang berhubungan dengan tupoksi Badan Publik tanpa ada permintaan;</li>\r\n<li>Informasi yang wajib tersedia setiap saat, adalah informasi yang telah dikuasasi dan didokumentasikan oleh Badan Publik serta telah dinyatakan terbuka sebagai informasi yang dapat diakses oleh pengguna informasi bilamana ada permintaan;</li>\r\n<li>Informasi yang dikecualikan, adalah informasi yang dikuasai dan didokumentasikan oleh Badan Publik yang tidak dapat diakses oleh pemohon informasi berdasarkan alasan-alasan pengecualian.</li>\r\n</ol>\r\n</div>\r\n</div>\r\n<div class=\"container list-group\">&nbsp;</div>', '10c2baf0c723ffeb55b1cc2281dc3d40.jpg', 2, '2019-10-16 08:59:42'),
(9, 'Alur Penanganan Keluhan', 'alur-penanganan-keluhan', '<p><img src=\"../upload/Profile/alurpenanganankeluhan.jpg\" alt=\"\" width=\"800\" height=\"800\" /></p>', 'e071033ed5d99bdeaea5ec488d33b4af.jpg', 2, '2019-10-16 09:00:48'),
(10, 'TATA CARA MENGAJUKAN KEBERATAN', 'tata-cara-mengajukan-keberatan', '<p><img src=\"../upload/Profile/alur-keberatan.jpg\" alt=\"\" width=\"580\" height=\"827\" /></p>', 'b0cbffedfb36b5afb9eada3343ca6c0d.jpg', 2, '2019-10-16 09:01:39');
