INSERT INTO `sekilas_mataram` (`id`, `judul`, `kategori`, `konten`, `tanggal`) VALUES
(7, 'Sejarah Berdirinya RSJ Prov. NTB', '8', '<p style=\"text-align: center;\"><img alt=\"\" src=\"/admin/images/berita/images/Microsoft%20PowerPoint%20-%20Profil%20RSJ-%20FIX.pptx.pdf_page_02%281%29.jpg\" style=\"height:309px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/Microsoft%20PowerPoint%20-%20Profil%20RSJ-%20FIX.pptx.pdf_page_03%281%29.jpg\" style=\"height:309px; width:400px\" /></p>\r\n\r\n<p><span style=\"color:#000000\"><strong>1. SEJARAH BERDIRINYA&nbsp; RSJ PROVINSI</strong>&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">Rumah Sakit Jiwa (RSJ) Mataram didirikan berdasarkan surat Penunjukan Direktur Jenderal Pelayanan Kesehatan tanggal 31 Oktober 1983 No. 17867/Yankes/DKJ/1983 kepada PT. Yodya Karya, Jl. D.I Panjaitan No.8 Cawang Jakarta dan Perwakilannya di Provinsi Nusa Tenggara Barat sebagai Konsultan Perencanaan, dengan tugas pembuatan Masterplan Rumah Sakit Jiwa Mataram dan pembuatan design/dokumen tender dan memberikan penjelasan dalam &rdquo;aanwijzing&rdquo;. Rumah Sakit Jiwa Mataram didirikan dengan pertimbangan bahwa Rumah Sakit Jiwa Selebung (milik Daerah) tidak dapat dikembangkan karena letaknya terpencil dan bangunannya tidak memenuhi syarat sebagai Rumah Sakit.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">Pembiayaan pembangunan Rumah Sakit Jiwa Mataram berasal dari Anggaran Pembangunan tahun 1982/1983, mulai beroperasi tanggal 27 Oktober 1987, diresmikan 27 Januari 1990 oleh Menteri Kesehatan RI (Bapak Dr. Adhyatma MPH). Pada awal beroperasi hanya melayani rawat jalan sekaligus sebagai unit gawat darurat. Pelayanan rawat inap baru dilaksanakan tahun 1988/1989 dengan 2 ruangan perawatan (Ruang Mawar dan Melati). Struktur Organisasi Rumah Sakit Jiwa Mataram semula adalah Rumah Sakit Jiwa Klas C berdasarkan SK. MenKes: 395/MenKes/SK/VI/1989 tanggal 19 Juni 1989. Rumah Sakit Jiwa Mataram sejak semula direncanakan sebagai Rumah Sakit Jiwa Klas B, untuk itu Rumah Sakit Jiwa Selebung diintegrasikan dengan Rumah Sakit Jiwa Mataram dan menjadi Rumah Sakit Jiwa Mataram Kelas B berdasarkan SK MenKes RI Nomor: 656/Menkes/SK/X/1991 tanggal 30 Oktober 1991.</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">Tahun 1991, RSJ Mataram menambah kapasitas pelayanan rawat inapnya dengan penambahan 2 ruang perawatan (ruang angsoka dan Dahlia) dan tahun 1996 kembali memperluas ruang perawatan dengan membangun ruang rehabilitasi (ruang sandat),IGD, gizi dan IPRS, ruang generator dan incenerator. Tahun 2000 dibangun ruang khusus terapi dan rehabilitasi narkoba dan tahun 2004 dilakukan pengembangan dan diresmikan sebagai pusat rehabilitasi narkoba &rdquo;One Stop Centre (OSC)&rdquo;, dua tahun kemudian (2005) RSJ Mataram membangun klinik VCT Bale matahari dan yang terakhir tahun 2007 pembangunan ruang perawatan kelas I dan II (ruang Flamboyan) untuk mengganti ruang Angsoka yang sebelumnya merupakan kelas I dan II. Sampai dengan Desember 2009, RSJ Provinsi sudah memiliki 6 ruang perawatan, 1 ruang rehabilitasi dan IGD. Sebelum otonomi daerah RSJ Mataram merupakan RS khusus milik pemerintah pusat dan sejak otonomi daerah tahun 2001, RSJ Mataram menjadi milik Pemerintah Daerah dan merupakan Unit Pelaksana Teknis Daerah (UPTD) Dinas Kesehatan Provinsi NTB berdasarkan Peraturan Daerah No.13 tahun 2001. Sejak bulan Agustus 2008 berdasarkan Peraturan Daerah No. 8 Tahun 2008 <strong>RSJ Mataram</strong> berubah status menjadi Lembaga Teknis Daerah (LTD) dengan nama <strong>RSJ Provinsi</strong> yang merupakan unsur pelayanan kesehatan khusus jiwa yang berada dibawah dan bertanggung jawab kepada Gubernur melalui Sekretaris Daerah dan secara teknis operasional berkoordinasi dengan Kepala Dinas Kesehatan&nbsp; dengan status Rumah Sakit Khusus Kelas B.</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">Sejak diresmikan tahun 1990 sampai dengan sekarang, RSJ Provinsi telah berganti pimpinan 5 kali, berikut periode kepepimpinan RSJ Mataram-RSJ Provinsi :</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">1. Tahun 1987 - 1990: Dr. Haryono Padmosudiro, SpKJ</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">2. Tahun 1990 - 1999: Dr. Ngadiono Hastering, SpKJ</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">3. Tahun 1999 - 2004 : Dr. Helmy Azhar, SpKJ</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">4. Tahun 2004 - 2006: Dr. Endro Suprayitno, SpKJ</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">5. Tahun 2007 - 2019: Dr. Elly Rosila Wijaya, SpKJ., MM.</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">6. Tahun 2019 - Sekarang: Dr. Evi Kustini Somawijaya</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\"><strong>2. LANDASAN HUKUM</strong></span></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Nama Rumah Sakit&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : RSJ Provinsi</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Pemilik&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Pemerintah Provinsi NTB</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Alamat&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; : Jl. Ahmad Yani No. 1 Selagalas&ndash;Mataram</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Telepon&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 0370 671515 &ndash; 672140</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Fax&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 0370 671515</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Website&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : www.RSJ.NTBPROV.go.id</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">email&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : info@rsj.ntbprov.go.id</span>,<span style=\"color:#000000\"> rsjprovntb@gmail.com</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Kelas&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : B</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Jumlah Tempat Tidur&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 100 TT</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Dasar Hukum/Landasan Operasional berdirinya RSJ Provinsi :</span></li>\r\n</ul>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">SK. MenKes: 395/MenKes/SK/VI/1989 tanggal 19 Juni 1989 tentang Pembentukan Rumah Sakit Jiwa di Mataram;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">&nbsp;SK MenKes RI Nomor: 656/Menkes/SK/X/1991 tanggal 30 Oktober 1991 tentang Peningkatan Kelas Rumah Sakit Jiwa Mataram;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Daerah Provinsi NTB No.9 tahun 2001 tentang Retribusi Pelayanan Kesehatan pada Rumah Sakit Jiwa, Balai Laboratorium Kesehatan dan Balai Kesehatan Mata Masyarakat;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Daerah Provinsi NTB No. 13 tahun 2001 tentang Kedudukan, Tugas, Fungsi dan Susunan Organisasi RSJ Mataram;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Daerah Provinsi NTB No.8 tahun 2008 tanggal 25 Agustus 2008 tentang Organisasi dan Tata Kerja Inspektorat, Bappeda dan Lembaga Teknis Daerah Provinsi Nusa Tenggara Barat;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Gubernur NTB No. 22 tahun 2008&nbsp; tanggal 26 Agustus 2008 tentang Rincian Tugas, Fungsi dn Tata Kerja Inspektorat, Bappeda dan Lembaga Teknis Daerah Provinsi Nusa Tenggara Barat;</span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">Peraturan lain yang menjadi dasar hukum RSJ Provinsi NTB dalam operasionalnya adalah peraturan-peraturan sebagai berikut :</span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-Undang Dasar 1945 Pasal H ayat 1 yang menegaskan tentang hak untuk hidup sejahtera lahir batin, bertempat tinggal dan mendapatkan lingkungan yang baik, sehat dan hak mendapatkan pelayanan kesehatan;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-Undang Nomor 28 tahun 1999 tentang Penyelenggaraan Negara yang bersih dan bebas dari korupsi, kolusi dan nepotisme (Lembaran Negara Tahun 1999 Nomor 75, Tambahan Lembaran Negara Nomor 3851);</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-Undang No.17 tahun 2003 tentang Keuangan Negara (Lembaran Negara Republik Indonesia Tahun 2003 Nomor 47, Tambahan Lembaran Negara Republik Indonesia Nomor 4286);</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-Undang No.1 tahun 2004 tentang Perbendaharaan Negara(Lembaran Negara Republik Indonesia Tahun 2004 Nomor 5, Tambahan Lembaran Negara Republik Indonesia Nomor 4355);</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-Undang No. 15 tahun 2004 tentang Pemeriksaan Pengelolaan dan Tanggung jawab Keuangan Daerah (Lembaran Negara Republik Indonesia Tahun 2004 Nomor 66, Tambahan Lembaran Negara Republik Indonesia Nomor 4400);</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-Undang No.25 tahun 2004 tentang Sistem Perencanaan Pembangunan Nasional;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-Undang No. 32 tahun 2004 tentang Pemerintahan Daerah (Lembaran Negara Tahun 2004 Nomor 125, Tambahan Lembaran Negara Nomor 4437) yang kemudian diubah dengan UU No.8 Tahun 2005 tentang Penetapan PP Pengganti UU No.3 Tahun 2005 tentang perubahan No.32 Tahun 2004 tentang Pemerintah Daerah menjadi UU (Lembaran Negara Tahun 2005 No.108, Tambahan Lembaran Negara No.4548);</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-undang No. 33 tahun 2004 tentang Perimbangan Keuangan Antara Pemerintah Pusat dan Pemerintah Daerah;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-Undang RI No. 36 tahun 2009 tentang Kesehatan (Tambahan Lembaran Negara Republik Indonesia No. 5063)</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Undang-Undang&nbsp; RI No. 44 tahun 2009 tentang Rumah Sakit (Tambahan Lembaran Negara Republik Indonesia No. 5072)</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Pemerintah No. 58 tahun 2005 tentang Pengelolaan Keuangan Daerah;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Pemerintah No.65 tahun 2005 tentang Pedoman Penyusunan dan Penerapan Standar Pelayanan Minimal (Lembaran Negara Republik Indonesia Tahun 2005 Nomor 150, Tambahan Lembaran Negara Republik Indonesia Nomor 4585);</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Pemerintah No.8 tahun 2006 tentang Laporan Keuangan dan Kinerja Instansi Pemerintah;</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Pemerintah RI No. 41 tahun 2007 tentang Organisasi Perangkat Daerah</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Pemerintah Nomor 8 Tahun 2008 tentang Tahapan, Tata Cara Penyusunan, Pengendalian dan Evaluasi Pelaksanaan Rencana Pembangunan Daerah (Tambahan Lembaran Negara RI No.4815);</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan Menteri Kesehatan RI No.1045/Menkes/PER/XI/2006 tentang Pedoman Organisasi Rumah Sakit di Lingkungan Depkes</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Instruksi Presiden Indonesia Nomor 07 tahun 1999 tentang Akuntabilitas Kinerja Instansi Pemerintah;</span></li>\r\n</ol>\r\n', '2014-04-24'),
(8, 'Falsafah, Visi, Misi, Tujuan Strategis dan Nilai-nilai Dasar', '8', '<hr />\r\n<p style=\"text-align:center\"><span style=\"color:#000000\"><u><span style=\"font-size:18px\"><strong>Falsafah, Visi, Misi, Tujuan Strategis dan Nilai-nilai Dasar</strong></span></u></span></p>\r\n\r\n<p><span style=\"color:#000000\">Berdasarkan Peraturan Gubernur Nusa Tenggara Barat no 28 Tahun 2012 tentang Pola Tata Kelola Rumah Sakit Jiwa Provinsi Nusa Tenggara Barat, Falsafah, Visi, Misi, Tujuan Strategis dan Nilai-Nilai Dasar RSJ Prov. NTB adalah sebagai berikut:</span></p>\r\n\r\n<p><span style=\"color:#000000\"><u><span style=\"font-size:16px\"><strong>Falsafah</strong></span></u></span></p>\r\n\r\n<p><span style=\"color:#000000\">Falsafah rumah sakit adalah: Tumbuh dan berkembang secara berkesinambungan</span></p>\r\n\r\n<p><span style=\"color:#000000\"><u><span style=\"font-size:16px\"><strong>Visi rumah sakit</strong></span></u></span></p>\r\n\r\n<p style=\"margin-left:28.35pt\"><span style=\"color:#000000\">&ldquo;Rumah Sakit Jiwa Dambaan Masyarakat Dengan Mutu Terkini&rdquo;</span></p>\r\n\r\n<p><span style=\"color:#000000\"><u><span style=\"font-size:16px\"><strong>Misi rumah sakit</strong></span></u></span></p>\r\n\r\n<ol style=\"list-style-type:lower-alpha\">\r\n	<li>\r\n	<p><span style=\"color:#000000\">Meningkatkan ketertiban dan kelancaran pelayanan dan pengelolaan&nbsp; administrasi perkantoran</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"color:#000000\">Meningkatkan kemudahan dan keterjangkauan pelayanan kesehatan jiwa dan Napza secara paripurna dan bermutu standar nasional</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"color:#000000\">Meningkatkan ketersediaan fasilitas fisik, peralatan medis dan non medis sesuai standar untuk menunjang pelayanan</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"color:#000000\">Meningkatkan kelancaran dan kemudahan pelayanan keperawatan profesional untuk mencapai kepuasan pelanggan</span></p>\r\n	</li>\r\n</ol>\r\n\r\n<p><span style=\"color:#000000\"><strong><span style=\"font-size:16px\"><u>Tujuan strategis</u></span></strong></span></p>\r\n\r\n<ol style=\"list-style-type:lower-alpha\">\r\n	<li><span style=\"color:#000000\">terwujudnya pelayanan yang sesuai standar;</span></li>\r\n	<li><span style=\"color:#000000\">meningkatnya kepercayaan pelanggan;</span></li>\r\n	<li><span style=\"color:#000000\">meningkatnya profesionalisme SDM yang berbasis kompetensi nasional;</span></li>\r\n	<li><span style=\"color:#000000\">tersedianya bangunan fisik dan peralatan sesuai standar.</span></li>\r\n</ol>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:16px\"><strong><u>Nilai-Nilai Dasar ( Core Value)</u></strong></span></span></p>\r\n\r\n<ol style=\"list-style-type:lower-alpha\">\r\n	<li><span style=\"color:#000000\">Bisnis rumah sakit yang sehat, mengelola rumah sakit dengan pola pengelolaan bisnis yang sehat, tidak semata-mata untuk mencari keuntungan (not for profit) &nbsp;dengan mengedepankan pelayanan yang professional, terjangkau dan mudah di akses oleh masyarakat;</span></li>\r\n	<li><span style=\"color:#000000\">Ramah, dalam memberikan pelayanan mengutamakan keramahan dan santun berlandaskan komitmen dan budaya kasih sayang;</span></li>\r\n	<li><span style=\"color:#000000\">Aktif, semua petugas aktif memberikan informasi kepada pasien dan keluarganya, secara aktif membangun kemitraan dengan individu, keluarga mereka, &nbsp;&nbsp;lembaga lain dan masyarakat pada umumnya, atas dasar &nbsp;kepercayaan, saling menghormati dan saling pengertian untuk keberhasilan &nbsp;mengatasi masalah kesehatan yang kompleks;</span></li>\r\n	<li><span style=\"color:#000000\">Inovatif, semua pegawai harus terus menerus berinovasi mengembangkan pelayananan yang profesional dan bermutu untuk&nbsp; menyenangkan pelanggan;</span></li>\r\n	<li><span style=\"color:#000000\">Normatif, memberikan pelayanan sesuai standar, memahami peraturan-peraturan,&nbsp; berkomitmen serta mampu menghindari kekeliruan, kesalahan dan berkemauan untuk menegakkan kebenaran.</span></li>\r\n</ol>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:16px\"><u><strong>Motto</strong></u></span></span></p>\r\n\r\n<p style=\"margin-left:28.35pt\"><span style=\"color:#000000\">&ldquo;Melayani dengan empati&rdquo;</span></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<div id=\"__if72ru4sdfsdfrkjahiuyi_once\" style=\"display:none;\">&nbsp;</div>\r\n\r\n<div id=\"__hggasdgjhsagd_once\" style=\"display:none;\">&nbsp;</div>\r\n\r\n<div id=\"__if72ru4sdfsdfruh7fewui_once\" style=\"display:none;\">&nbsp;</div>\r\n', '2014-05-13'),
(10, 'Tupoksi', '8', '<p style=\"text-align:center\"><span style=\"color:#000000\"><span style=\"font-size:16px\"><strong>Tugas Pokok dan Fungsi Rumah Sakit Jiwa Mutiara Sukma Provinsi NTB</strong></span></span></p>\r\n\r\n<hr />\r\n<p><span style=\"color:#000000\"><strong><u><span style=\"font-size:16px\">Tugas Pokok</span></u></strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Berdasarkan Peraturan Gubernur Nusa Tenggara Barat no 28 tahun 2012 pasal 7 ayat 2,&nbsp;Rumah Sakit mempunyai tugas membantu Gubernur dalam menyelenggarakan tugas umum pemerintahan, melaksanakan upaya kesehatan khusus jiwa secara berdayaguna dan berhasilguna dengan mengutamakan upaya penyembuhan dan pemulihan yang dilaksanakan secara serasi dan terpadu dengan upaya peningkatan kesehatan khusus jiwa, pencegahan penyakit khusus jiwa dan melaksanakan upaya rujukan kesehatan khusus jiwa, melaksanakan pelayanan NAPZA, melaksanakan pelayanan bermutu sesuai standar pelayanan rumah sakit jiwa kelas B;</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\"><strong><u><span style=\"font-size:16px\">Fungsi</span></u></strong></span></p>\r\n\r\n<p><span style=\"color:#000000\">Berdasarkan Peraturan Gubernur Nusa Tenggara Barat no 28 tahun 2012 pasal 7 ayat 3, Rumah Sakit Jiwa Provinsi NTB&nbsp;mempunyai fungsi:</span></p>\r\n\r\n<ol style=\"list-style-type:lower-alpha\">\r\n	<li><span style=\"color:#000000\">melaksanakan pelayanan pencegahan, pemulihan dan rehabilitasi kesehatan jiwa;</span></li>\r\n	<li><span style=\"color:#000000\">melaksanakan upaya kesehatan jiwa masyarakat;</span></li>\r\n	<li><span style=\"color:#000000\">melaksanakan pelayanan upaya pencegahan, terapi dan rehabiltasi penyalahgunaan narkotika, psikotropika, dan zat adiktif lainnya;</span></li>\r\n	<li><span style=\"color:#000000\">melaksanakan pelayanan rujukan;</span></li>\r\n	<li><span style=\"color:#000000\">melaksanakan pendidikan dan pelatihan serta penelitian di bidang kesehatan jiwa;</span></li>\r\n	<li><span style=\"color:#000000\">melaksanakan pengkoordinasian dan pembinaan rumah sakit jiwa;</span></li>\r\n	<li><span style=\"color:#000000\">melaksanakan pengendalian dan evaluasi pelaksanaan tugas sesuai tugas pokok dan fungsinya; dan</span></li>\r\n	<li><span style=\"color:#000000\">melaksanakan tugas lain yang diberikan oleh Gubernur sesuai dengan tugas dan fungsinya.</span></li>\r\n</ol>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n', '2014-05-13'),
(11, 'SDM', '8', '<p><img alt=\"\" src=\"/admin/images/berita/images/Microsoft%20PowerPoint%20-%20Profil%20RSJ-%20FIX.pptx.pdf_page_05%281%29.jpg\" style=\"height:618px; width:800px\" /></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<div id=\"__if72ru4sdfsdfrkjahiuyi_once\" style=\"display:none;\">&nbsp;</div>\r\n\r\n<div id=\"__hggasdgjhsagd_once\" style=\"display:none;\">&nbsp;</div>\r\n\r\n<div id=\"__if72ru4sdfsdfruh7fewui_once\" style=\"display:none;\">&nbsp;</div>\r\n', '2014-05-13'),
(17, 'Pantai Pink Jadi Kawasan Pariwisata Ecotourism', '5', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:justify\"><span style=\"color:#000000\"><strong>Sumber : ntbprov.go.id</strong></span></td>\r\n			<td style=\"text-align:justify\">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"color:#000000\"><img src=\"http://www.ntbprov.go.id/img_news/img_7524.jpg\" style=\"float:left\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Keindahan dan pesona Pantai Pink di kawasan Tanjung Ringgit, Kabupaten Lombok Timur, berhasil menarik simpati investor asal Swedia, PT. Eco Solution Lomboks untuk berinvestasi di Kawasan Pantai yang terkenal dengan keindahan pasir pantainya yang berwarna pink.</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Hal itu disampaikan John Higson CEO-PT. Eco Solution Lomboks saat mempersentasikan mastesplan pengembangan kawasan Tanjung Ringgit, dihadapan Menteri Pariwisata dan Industri Kreatif Republik Indonesia, Ibu Mari Elka Pangestu yang didampingi Wakil Gubernur NTB, H. Muh. Amin, S.H.,M.Si beserta pejabat lainnya (29/1)</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Dalam persentasinya, investor asal Swedia, John Higson mengatakan, tujuan dari pengembangan kawasan Tanjung Ringgti adalah untuk membangun kawasan ecoregion terbesar di Asia, yang merupakan platform untuk pembangunan wilayah dan investasi. Dengan harapan, mereka bisa mengembangkan pembangunan yang melibatkan masyarakat, serta membuat kerjasama-kerjasama dengan berbagai kelompok masyarakat, pengusaha ditingkat lokal dengan tujuan untuk mendorong pembangunan wilayah. &ldquo;Prinsip keberlanjutan bukan saja aspek pembangunan, tetapi juga dalam konteks bagaimana mata pencaharian itu bisa terus berkesinambungan,&rdquo; ucapnya dengan senyum</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Selain pasilitas Villa dan transportasi laut, kawasan Tanjung Ringgit juga akan dibangun Studio Music Rekaman, Klinik-klinik untuk kesehatan dan kecantikan, pusat pendidikan masyarakat, Blue school sebagai pusat pendidikan konservasi dan budidaya perikanan yang berkelanjutan, dan sarana kegiatan olahraga air. Untuk itu, investor asal Swedia tersebut, sangat menginginkan keterlibatan masyarakat untuk menyediakan sarana dan fasilitas. &ldquo;Setelah semua proses terselesaikan, kami akan segera melakukan pembangunan, karena kami sudah tidak sabar untuk segera membangun kawasan ini,&rdquo; ujarnya melalui penerjemahnya.</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Duta besar Swedia, Eva Polana dalam sambutan singkatnya mengatakan, suasana di sekitar Pantai Pink seperti Surga. Untuk itu, dia merasa sangat senang, ada investor asal negaranya yang berminat untuk melakukan investasinya di Lombok, khususnya di Kawasan Tanjung Ringgit. Dia berharap, pembangunan kawasan ecotourism terbesar di kawasan Asia tersebut segera terealisasi. &ldquo;Di Negara Swedia, saat ini temperatur cuaca mines 20 derajat, itulah yang membuat suasana di Pantai Pink itu seperti Surga,&rdquo; katanya dengan senyumnya yang khas.</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Menparekraf RI, Mari Elka Pangestu mengaku, sangat kagum dengan masterplan yang dipersentasikan direktur PT. Eco Solutions Lombok yang akan berinvestasi di Kawasan Tanjung Ringgit. Menurutnya, pembagunan dengan konsep ecotourism terbesar di Asia tersebut, dimana proses perancangannya melibatkan pakar dan ahli tata bangunan dengan konsep berkelanjutan yang lebih cenderung untuk menghasilkan energi baru terbarukan. Untuk itu, pemerintah pusat mendukung penuh rencana investasi itu.</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Menteri berharap, pengembangan kawasan Pantai Pink, benar-benar sesuai dengan konsep dari masterplan yang telah dipersentasikan, yakni selalu menjaga dan memperhatikan alam sekitar Kawasan Tanjung Ringgit. Proyek investasi yang diperkirakan mampu menyerap kurang lebih 10 ribu tenaga kerja itu, diharapkan untuk memperhatikan masyarakat sekitar. &ldquo;Berikan mereka pelatihan, sehingga ketika mega proyek ini berjalan, mereka bisa menjadi bagian didalamnya,&rdquo; ungkapnya. Selanjutnya dilakukan penanaman pohon bersama sebagai simbol suksesnya kerjasama yakni penanaman pohon ketapang kencana. (Mawardi-Humas NTB)</span></p>\r\n', '2014-07-04'),
(21, 'Laporan Pendapatan Bulan Januari 2014', '18', '<p>Laporan Realisasi pendapatan BLUD Rumah Sakit Jiwa Provinsi Nusa Tenggara Barat Tahun Anggaran 2014 bulan januari</p>\r\n\r\n<p><a href=\"http://rsj.ntbprov.go.id/file/LAPORAN%20PENDAPATAN%20BLUD%20PEBRUARI%20%202014%20-%201.pdf\">http://rsj.ntbprov.go.id/file/LAPORAN%20PENDAPATAN%20BLUD%20PEBRUARI%20%202014%20-%201.pdf</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', '2014-10-10'),
(22, 'Struktur Organisasi', '8', '<h1 style=\"text-align:center\"><strong>Struktur Organisasi RSJ Mutiara Sukma Provinsi NTB</strong></h1>\r\n\r\n<h1 style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/Microsoft%20PowerPoint%20-%20Profil%20RSJ-%20FIX.pptx.pdf_page_04%281%29.jpg\" style=\"height:618px; width:800px\" /></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:.25in\"><span style=\"color:#000000\">Berdasarkan Peraturan Daerah Provinsi Nusa Tenggara Barat nomor: 8 tahun 2008 tanggal 25 Agustus 2008, yang diubah dengan Perda Provinsi NTB Nomor 9 tahun 2011, Rumah Sakit Jiwa Provinsi NTB dalam melaksanakan tugas pokok dan fungsinya bertanggung jawab kepada Gubernur melalui Sekretaris Daerah dan secara teknis operasional berkoordinasi dengan Kepala Dinas Kesehatan Provinsi Nusa Tenggara Barat.</span></p>\r\n\r\n<p style=\"margin-left:.25in\"><span style=\"color:#000000\">Adapun Struktur Organisasi Rumah Sakit Jiwa Provinsi NTB terdiri dari :</span></p>\r\n\r\n<ol style=\"list-style-type:lower-alpha\">\r\n	<li><span style=\"color:#000000\">Direktur</span></li>\r\n	<li><span style=\"color:#000000\">Sub Bagian Tata Usaha</span>\r\n	<ol>\r\n		<li><span style=\"color:#000000\">Urusan umum</span></li>\r\n		<li><span style=\"color:#000000\">Urusan Kepegawaian</span></li>\r\n		<li><span style=\"color:#000000\">Urusan Perlengkapan</span></li>\r\n		<li><span style=\"color:#000000\">Urusan keuangan</span></li>\r\n		<li><span style=\"color:#000000\">Urusan Perencanaan, Program dan Pelaporan</span></li>\r\n		<li><span style=\"color:#000000\">Urusan Kerjasama dan IT</span></li>\r\n	</ol>\r\n	</li>\r\n	<li><span style=\"color:#000000\">Seksie Pelayanan Medik</span>\r\n	<ol>\r\n		<li><span style=\"color:#000000\">Instalasi gawat darurat</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi rehabilitasi mental</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi rawat inap</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi rawat jalan</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi intensif psikiatrik</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi terapi dan rehabilitasi narkoba dan HIV/AIDS</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi rekam medik</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi kesehatan jiwa masyarakat (Keswamas)</span></li>\r\n	</ol>\r\n	</li>\r\n	<li><span style=\"color:#000000\">Seksie Penunjang Medik</span>\r\n	<ol>\r\n		<li><span style=\"color:#000000\">Instalasi gizi</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi laboratorium</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi farmasi</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi pemeliharaan saran prasarana rumah sakit (IPSPRS)</span></li>\r\n		<li><span style=\"color:#000000\">Instalasi pendidikan dan penelitian (Diklit)</span></li>\r\n	</ol>\r\n	</li>\r\n	<li><span style=\"color:#000000\">Seksie Keperawatan</span></li>\r\n</ol>\r\n\r\n<div id=\"__if72ru4sdfsdfrkjahiuyi_once\" style=\"display:none;\">&nbsp;</div>\r\n\r\n<div id=\"__hggasdgjhsagd_once\" style=\"display:none;\">&nbsp;</div>\r\n\r\n<div id=\"__if72ru4sdfsdfruh7fewui_once\" style=\"display:none;\">&nbsp;</div>\r\n', '2014-10-14'),
