(30, 'Profil Pimpinan Rumah Sakit Jiwa Mutiara Sukma', '8', '<p style=\"text-align: center;\"><img alt=\"\" src=\"/admin/images/berita/images/Microsoft%20Word%20-%20CV%20PEJABAT.doc.pdf_page_1.jpg\" style=\"height:1056px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Microsoft%20Word%20-%20CV%20PEJABAT.doc.pdf_page_2.jpg\" style=\"height:1056px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Microsoft%20Word%20-%20CV%20PEJABAT.doc.pdf_page_3.jpg\" style=\"height:1056px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Microsoft%20Word%20-%20CV%20PEJABAT.doc.pdf_page_4.jpg\" style=\"height:1056px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Microsoft%20Word%20-%20CV%20PEJABAT.doc.pdf_page_5.jpg\" style=\"height:1056px; width:816px\" /></p>\r\n', '2014-10-27'),
(31, 'Tupoksi Subbag TU', '8', '<h1 style=\"text-align: center;\"><u><span style=\"font-size:16px\"><span style=\"color:#000000\">Tugas dan Kewajiban Sub Bagian Tata Usaha</span></span></u></h1>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"color:#000000\">Berdasarkan Pergub No 28 Tahun 2012, Tugas dan Kewajiban Kepala Sub Bagian Tata Usaha adalah sebagai berikut:</span></span></p>\r\n\r\n<ol style=\"list-style-type:lower-alpha\">\r\n	<li><span style=\"font-size:14px\"><span style=\"color:#000000\">perencanaan, penyelenggaraan dan akuntabilitas di bidang ketatausahaan;</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"color:#000000\">penyelenggaraan administrasi umum, keuangan, kepegawaian, perlengkapan, perencanaan dan pelaporan serta urusan kerjasama;</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"color:#000000\">menyusun Standar Prosedur Operasional penyelenggaraan ketatausahaan;</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"color:#000000\">menilai mutu pelayanan ketatausahaan;</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"color:#000000\">membuat usulan rencana kebutuhan dan pengembangan SDM di lingkup Tata Usaha;</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"color:#000000\">membuat visualisasi informasi kegiatan pelayanan ketatausahaan;</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"color:#000000\">membuat laporan berkala ketatausahaan; dan</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"color:#000000\">pelaksanaan tugas kedinasan lain yang diberikan oleh atasan sesuai dengan tugas pokok dan fungsinya.</span></span></li>\r\n</ol>\r\n', '2014-10-27'),
(32, 'Tupoksi Seksi Keperawatan', '8', '<h1 style=\"text-align: center;\"><span style=\"color:#000000\"><u>Tugas dan Kewajiban Seksi Keperawatan.</u></span></h1>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Berdasarkan Pergub No 28 Tahun 2012 tentang Pola Tata Kelola Rumah Sakit Jiwa Provinsi Nusa Tenggara Barat, Tugas dan Kewajiban Kepala Seksi Keperawatan adalah sebagai berikut:</span></span></p>\r\n\r\n<ol style=\"list-style-type:lower-alpha\">\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">menyusun perencanaan, fasilitasi dan akuntabilitas di bidang keperawatan;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">menyusun standar asuhan keperawatan;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">menyusun Standar Prosedur Operasional penyelenggaraan keperawatan;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">menilai mutu keperawatan;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">membuat usulan rencana kebutuhan dan pengembangan SDM keperawatan;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">membuat visualisasi informasi kegiatan keperawatan;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">membuat laporan berkala keperawatan; dan</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">pelaksanaan tugas kedinasan lain yang diberikan oleh atasan sesuai dengan tugas pokok dan fungsinya.</span></span></li>\r\n</ol>\r\n', '2014-10-27'),
(33, 'Tupoksi Seksi Pelayanan Medik', '8', '<h1 style=\"text-align:center\"><span style=\"color:#000000\"><span style=\"font-size:18px\"><strong><u>Tugas dan Kewajiban Seksi Pelayanan Medik.</u></strong></span></span></h1>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Berdasarkan Pergub No 28 Tahun 2012 tentang Pola Tata Kelola Rumah Sakit Jiwa Provinsi Nusa Tenggara Barat, Tugas dan Kewajiban Kepala Seksi Pelayanan Medik adalah sebagai berikut:</span></span></p>\r\n\r\n<ol style=\"list-style-type:lower-alpha\">\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">menyusun perencanaan, fasilitasi dan akuntabilitas di bidang pelayanan medis;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">menyusun standar pelayanan medis;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">menyusun Standar Prosedur Operasional penyelenggaraan pelayanan medis;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">menilai mutu pelayanan medis;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">membuat usulan rencana kebutuhan dan pengembangan SDM pelayanan medik;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">membuat visualisasi informasi kegiatan pelayanan medik;</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">membuat laporan berkala pelayanan medik; dan</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">pelaksanaan tugas kedinasan lain yang diberikan oleh atasan sesuai dengan tugas pokok dan fungsinya.</span></span></li>\r\n</ol>\r\n', '2014-10-27'),
(34, 'Tupoksi Seksi Penunjang Medik', '8', '<h1 style=\"text-align: center;\"><u>Tugas dan Kewajiban Seksi Penunjang Medis</u></h1>\r\n\r\n<p><span style=\"color:#000000\">Berdasarkan Pergub No 28 Tahun 2012 tentang Pola Tata Kelola Rumah Sakit Jiwa Provinsi NTB, Tugas dan Kewajiban Kepala Seksi Penunjang Medis adalah sebagai berikut:</span></p>\r\n\r\n<ol>\r\n	<li><span style=\"color:#000000\">menyusun perencanaan, fasilitasi dan akuntabilitas di bidang tehnis penunjang medis;</span></li>\r\n	<li><span style=\"color:#000000\">menyusun standar kegiatan penunjang medis;</span></li>\r\n	<li><span style=\"color:#000000\">menyusun Standar Prosedur Operasional penyelenggaraan kegiatan penunjang medis;</span></li>\r\n	<li><span style=\"color:#000000\">menilai mutu penunjang medis;</span></li>\r\n	<li><span style=\"color:#000000\">membuat usulan rencana kebutuhan dan pengembangan SDM penunjang medis;</span></li>\r\n	<li><span style=\"color:#000000\">membuat usulan rencana pengembangan dan mengkoordinasikan pelaksanaan kegiatan pendidikan;</span></li>\r\n	<li><span style=\"color:#000000\">pelaksanaan kegiatan pelatihan dan penelitian kesehatan jiwa;</span></li>\r\n	<li><span style=\"color:#000000\">membuat visualisasi informasi kegiatan penunjang medis;</span></li>\r\n	<li><span style=\"color:#000000\">membuat laporan berkala penunjang medis; dan</span></li>\r\n	<li><span style=\"color:#000000\">pelaksanaan tugas kedinasan lain yang diberikan oleh atasan sesuai dengan tugas pokok dan fungsinya.</span></li>\r\n</ol>\r\n', '2014-10-27'),
(38, 'UU Keswa, Berikan Perlindungan Hak Orang Dengan Gangguan Jiwa', '13', '<p><span style=\"color:#000000\">Sumber : buk.depkes.go.id</span></p>\r\n\r\n<p><span style=\"color:#000000\"><img src=\"http://buk.depkes.go.id/images/stories/news2014/Berita%20UU%20Keswa3.JPG\" style=\"float:right; height:156px; margin:10px; width:234px\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Jakarta &ndash; Tanggal 8 Juli 2014 merupakan sejarah lahirnya Undang-Undang Nomor 18 tentang Kesehatan Jiwa yang telah disahkan dalam rapat Paripurna DPR dan ditandatangani oleh Presiden RI tanggal 7 Agustus 2014. Lahirnya UU Keswa ini membawa semangat bahwa setiap orang dapat mencapai kualitas hidup yang baik, menikmati kehidupan kejiwaan yang sehat, bebas dari ketakutan, tekanan dan gangguan lain yang dapat mengganggu kesehatan jiwa, serta memberikan perlindungan kepada warga negara dan terwujudnya pelayanan kesehatan jiwa yang menjamin perlindungan hak Orang Dengan Gangguan Jiwa (ODGJ)dan Orang Dengan Masalah Kejiwaan (ODMK).</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\"><img src=\"http://buk.depkes.go.id/images/stories/news2014/Berita%20UU%20Keswa2.JPG\" style=\"float:right; height:156px; margin:10px; width:234px\" />&ldquo;UU Keswa ini membuka peluang terselenggaranya program promosi dan prevensi bagi kelompok rentan (population at risk), antara lain korban bencana dan konflik, korban kekerasan rumah tangga, korban perdagangan orang, warga binaan lapas dan kelompok berkebutuhan khusus. Sehingga upaya rehabilitasi dilakukan melalui pencegahan kekambuhan, perawatan dan pengasuhan (home care), pelatihan vocasional, bimbingan mental, sosial dan spiritual, konseling psikososial, serta bantuan asistensi sosial,&rdquo; ungkap Dirjen Bina Upaya Kesehatan, Prof. DR. dr. Akmal Taher, Sp.U(K) yang membuka kegiatan Sosialisasi Undang-Undang Kesehatan Jiwa (7/10).</span></p>\r\n\r\n<p><span style=\"color:#000000\"><img src=\"http://buk.depkes.go.id/images/stories/news2014/Berita%20UU%20Keswa1.JPG\" style=\"float:right; height:156px; margin:10px; width:234px\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Permasalahan serius dihadapkan pada UU Keswa, bahwa akses ODGJ ke fasilitas pelayanan kesehatan masih rendah, perlakuan diskriminatif terhadap ODGJ masih cukup tinggi, serta upaya kesehatan jiwa saat ini dilaksanakan baru sebatas pengobatan dan rehabilitas dan belum banyak menjangkau upaya promotif dan preventif. Untuk itulah dibutuhkan aturan yang komprehensif yang menjamin pemenuhan hak ODGJ dan ODMK.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Melihat data Riset Kesehatan Dasar 2013 pada penduduk usia diatas 15 tahun, ditemukan prevalensi ODGJ ringan atau gangguan mental emosional, seperti gangguan kecemasan dan depresi sebesar 6% atau 16 juta orang. Sedangkan ODGJ berat, seperti Psikosis sebesar 1,72/ 1.000 atau estimasi 400. 000 orang dan 14,3% (57.000) ODGJ berat pernah dipasung oleh keluarga.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Dengan prevalensi tersebut menunjukkan bahwa upaya kesehatan jiwa tidak hanya tugas Pemerintah saja, melainkan juga peran aktif keluarga, pendidikan dan masyarakat, agar tercapainya tingkat kesembuhan dan pemulihan yang optimal bagi ODGJ.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Dirjen Bina Upaya Kesehatan menjelaskan pengaturan secara komprehensif terhadap kesehatan jiwa diharapkan dapat memberikan perlindungan kepada warga negara dan terwujudnya pelayanan kesehatan jiwa yang menjamin perlindungan hak-hak ODGJ, sehingga tercapai jaminan pelayanan kesehatan yang paripurna sebagaimana diamanahkan oleh Undang-Undang Dasar Negara Republik Indonesia Tahun 1945.</span></p>\r\n', '2014-11-03'),
(40, 'Rencana Kerja ARSAWAKOI Berintegrasi Dengan Program Kementerian Kesehatan', '13', '<p><span style=\"color:#000000\">Sumber : buk.depkes.go.id</span></p>\r\n\r\n<p><span style=\"color:#000000\"><img src=\"http://buk.depkes.go.id/images/stories/news2014/Pelantikan%20ARSAWAKOI.2.JPG\" style=\"float:right; height:156px; margin:10px; width:234px\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Jakarta &ndash; Sebagai rangkaian kegiatan Hari Kesehatan Jiwa Sedunia telah dilaksanakan pelantikan Asosiasi Rumah Sakit Jiwa dan Ketergantungan Obat Indonesia (ARSAWAKOI) tepat pada tanggal 8 Oktober 2014.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Pelantikan yang dipimpin oleh Ketua Umum Persatuan Rumah Seluruh Indonesia (PERSI), DR. dr. Sutoto, M.Kes dan disaksikan Direktur Bina Kesehatan Jiwa, Kementerian Kesehatan dr. Eka Viora, Sp.KJ melantik 19 pengurus ARSAWAKOI sebagai ketua dr. H. Bambang Eko Sunaryanto, Sp.KJ, MARS.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\"><img src=\"http://buk.depkes.go.id/images/stories/news2014/Pelantikan%20ARSAWAKOI.3.JPG\" style=\"float:right; height:156px; margin:10px; width:234px\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Ketua ARSAWAKOI menyampaikan dengan disahkannya UU Keswa ini artinya rencana kerja ARSAWAKOI harus berintegrasi dengan program Kementerian Kesehatan, seperti peningkatan mutu dan layanan dengan akreditasi rumah sakit; memperkuat pelayanan kesehatan primer dan sekunder; memberikan bimbingan dan pengampuan di Puskesmas maupun RSUD; serta mendorong dan mengaktifkan kembali tim pelaksana kesehatan jiwa di Provinsi dan Kabupaten. &rdquo;Kepada para pimpinan RS Jiwa dan RSKO untuk menetapkan paket rawat inap dan rawat jalan di INA CBG&rsquo;s, apabila tarifnya tidak sesuai dengan layanan, masih terlalu murah atau mahal, maka bisa dilakukan rasionalisasi sistem pembiayaan, sehingga apa yang dibayar BPJS Kesehatan sesuai dengan pelayanan yang diberikan.&rdquo;</span></p>\r\n\r\n<p><span style=\"color:#000000\"><img src=\"http://buk.depkes.go.id/images/stories/news2014/Pelantikan%20ARSAWAKOI.1.JPG\" style=\"float:right; height:156px; margin:10px; width:234px\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Ketua Umum PERSI menjelaskan bahwa sampai tahun ini baru sekitar 63 rumah sakit yang lulus akreditasi versi 2012. Mengapa sedikit, karena rumah sakit masih takut dengan standar akreditasi baru. Padahal akreditasi ini tidak perlu ditakutkan, tetapi harus dijalankan dan dipelajari sesuai dengan modul yang kearah manajemen resiko. &rdquo;Misalnya, penerapan tentang standar hak pasien, jika rumah sakit mempelajari akreditasi baru, maka kemungkinan kecil untuk dituntut akan sedikit, karena rumah sakit bekerja sesuai dengan Standar Operasional Prosedur (SOP).&rdquo;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Ketua Umum PERSI juga menceritakan strategi yang harus ditempuh agar rumah sakit mau melakukan akreditasi. Bagi RS khusus tipe C dan D, diberikan dispensasi hanya untuk 1x akreditasi bisa mempelajari tentang sasaran keselamatan pasien, hak pasien dan keluarga, kualifikasi pendidikan staf, dan tata kelola kepemimpinan dan pengarahan. Jika lulus maka akan mendapatkan sertifikat lulus Perdana, selanjutnya Dasar, Madya, Utama dan Paripurna.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Direktur Bina Kesehatan Jiwa menambahkan sekitar 24% pasien di pelayanan kesehatan primer memiliki diagnosis gangguan jiwa (WHO) yang ditemukan, seperti cemas, penyalahgunaan NAPZA, depresi, psikosis termasuk bipolar, epilepsi/kejang, gangguan perkembangan (anak dan remaja), gangguan tingkah laku (anak dan remaja), demensia. &rdquo;Dengan adanya UU Keswa ini, diharapkan pelayanan kesehatan primer mampu memberikan pelayanan kesehatan jiwa, sekaligus para ODGJ akan mendapatkan perlindungan, tidak ada diskriminasi,&rdquo;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Pada kesempatan yang sama, Direktur Bina Kesehatan Jiwa membahas agenda Kesehatan Jiwa bahwa Indonesia menjadi tuhan rumah ASEAN Mental Health bulan Mei 2015 yang dilaksanakan di Yogyakarta.</span></p>\r\n', '2014-11-03'),
(43, 'Ringkasan RKA Tahun 2015', '10', '<p>RINGKASAN RKA</p>\r\n\r\n<hr />\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/rka002%281%29.jpg\" style=\"height:990px; width:800px\" /></p>\r\n\r\n<hr />\r\n<p>RINCIAN ANGGARAN PENDAPATAN</p>\r\n\r\n<hr />\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/rka003.jpg\" style=\"height:686px; width:800px\" /></p>\r\n', '2015-08-01'),
(44, 'LAKIP 2015', '10', '<p><img alt=\"\" src=\"/admin/images/berita/images/lakip001.jpg\" style=\"height:1131px; width:800px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/lakip002.jpg\" style=\"height:1131px; width:800px\" /></p>\r\n\r\n<p>Data lengkap LAKIP Tahun 2015 bisa didapatkan pada Sekretariat PPID Rumah Sakit Jiwa Mutiara Sukma.</p>\r\n', '2015-08-01'),
(45, 'RENCANA KERJA TAHUN 2015', '10', '<p><img alt=\"\" src=\"/admin/images/berita/images/renja001.jpg\" style=\"height:1131px; width:800px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/renja002.jpg\" style=\"height:1131px; width:800px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Data Lengkap Rencana Kerja RSJ Mutiara Sukma bisa didapatkan dengan mengunjungi Sekretariat PPID Rumah Sakit Jiwa Mutiara Sukma.</span></p>\r\n', '2015-08-03');
INSERT INTO `sekilas_mataram` (`id`, `judul`, `kategori`, `konten`, `tanggal`) VALUES
(50, 'MENGASUH ANAK DENGAN ENERGI DAN EMOSI POSITIF', '11', '<p style=\"margin-left:14.2pt; text-align:right\">sumber: majalah mutiara sukma januari-maret 2015</p>\r\n\r\n<p style=\"margin-left:14.2pt; text-align:justify\"><span style=\"color:#000000\"><strong>&ldquo;ibu bangga kepadamu nak&rdquo;</strong></span></p>\r\n\r\n<p style=\"margin-left:14.2pt; text-align:justify\"><span style=\"color:#000000\"><strong>&ldquo;anakku hebat, ayah bangga&rdquo;</strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Seringkah anda mengucapkan kata-kata tersebut? Setiap hari, seminggu sekali? Atau bahkan satu bulan sekali? Menjadi orangtua yang positif, asyik, <em>supportive, friendly</em>, itu perlu berlatih!&nbsp; Salah satunya dengan mengucapkan kata-kata tersebut diatas dengan sesering mungkin</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Energi dan emosi positif sejatinya selalu ada di setiap diri orangtua. Tidak ada orangtua yang tak memiliki rasa sayang dan perhatian kepada anaknya, walaupun secuil. Hanya saja, rasa sayang kita masih terbungkus dalam kebiasaan-kebiasaan pola asuh klasik yang umumnya kurang peka pada suara hati anak dan dunianya.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Pola asuh orang tua sangat mempengaruhi setiap kepribadian yang telah terbentuk. Segala gaya atau model pengasuhan orang tua akan membentuk suatu kepribadian yang berbeda-beda sesuai apa yang telah diajarkan oleh orang tua. Orang tua merupakan lingkungan pertama bagi anak yang sangat berperan penting dalam setiap perkembangan anak khususnya perkembangan kepribadian anak. Oleh karena itu, diperlukan cara yang tepat untuk mengasuh anak sehingga terbentuklah suatu kepribadian anak yang diharapkan oleh orang tua sebagai harapan masa depan. Pola asuh yang baik untuk pembentukan kepribadian anak adalah pola asuh orang tua yang memprioritaskan kepentingan anak, akan tetapi dengan pengawasan dan pengendalian orang tua. Sehingga terbentuklah karakteristik anak yang dapat mengontrol diri, anak yang mandiri, mempunyai hubungan yang baik dengan teman, mampu menghadapi stres dan mempunyai minat terhadap hal-hal baru.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Satu-satunya cara meraih energi dan emosi positif dalam pengasuhan anak tak lain dengan cara mengenali diri Anda sebagai orangtua dan anak Anda dengan jujur dan tulus. Tanpa rasa gengsi atau menganggap remeh posisi Anda dan anak.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Untuk menjadi orangtua yang asyik, mungkin bisa menerapkan tips seperti ini :</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih sabar dan menghalau gengsi</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih mengejar <em>Golden Moment</em> dan memberikan apresiasi.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih mengungkapkan cinta dan kasih sayang</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih tidak meremehkan</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih memberikan pujian</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih memuliakan anak</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih memandang anak sama pentingnya</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih mendongeng</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih menjaga wajah manis</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih meminta maaf</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ndash; Berlatih menjadi teman</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Menjadi orangtua asyik bukan berarti kita harus menjelma laksana malaikat. Lakukan perubahan semampu kita. Semuanya butuh proses dan latihan keras. Lakukan yang terbaik dari apa yang kita bisa, maka efek dari semangat perubahan bakal langsung kita rasakan.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Tidak ada kata mustahil dan sulit bagi setiap orangtua untuk bisa menemukan masa emas bagi anak. Kuncinya, setiap orangtua bisa memahami anak sebagai individu yang memiliki suara hati. Tidak lagi sebagai objek yang bisa diperlakukan sesuka hati masa depannya.</span></p>\r\n\r\n<p style=\"margin-left:14.2pt; text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Poin-poin yang mendasari pola asuh (Teguh Iman Perdana)</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\"><strong>Cara pandang terhadap anak:</strong><br />\r\n1. Anak adalah amanah istimewa, amanah itu pasti akan dimintai pertanggungjawabannya</span></p>\r\n\r\n<p style=\"margin-left:7.1pt; text-align:justify\"><span style=\"color:#000000\">2. Anak adalah investasi masa depan kita sesungguhnya &ldquo;sesungguhnya Allah SWT akan mengangkat derajat hambanya yg saleh dalam surga, lalu hambanya tsb b&rsquo;kata &ldquo;wahai Tuhanku, bagaimana aku bisa mendapatkan semua ini? Allah SWT menjawab: &ldquo;Ini semua doa anakmu yg meminta ampun padamu (HR imam ahmad 2/509)</span></p>\r\n\r\n<p style=\"margin-left:7.1pt; text-align:justify\"><span style=\"color:#000000\">3. Anak adalah sandaran kita di kala senja.. Sandaran disini maksudnya walaupun anak sdh mandiri, a child is always a child. Ciptakan memori menyenangkan sejak dini, karena mendoakan org tua, melakukan amal ibadah</span></p>\r\n\r\n<p style=\"margin-left:7.1pt; text-align:justify\"><span style=\"color:#000000\">4. Anak dan org tua : resiprokal (timbal balik!). Anak harus berbakti pada org tua, org tua jg harus memuliakan/menghargai anak spt memuji anak, menjaga kehormatan didepan org lain</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&nbsp;&ldquo;Children learn what they live&rdquo; &ndash; Dorothy Law Noltz, Phd</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:7.1pt; text-align:justify\"><span style=\"color:#000000\"><strong>Teknik bahasa kasih</strong></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Perbaiki kata-kata org tua: lembut, afirmatif, persuasif, memuji, empati &amp; mau mendengarkan</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Efektifkan waktu berkualitas: perhatikan pada apa yg dilakukannya, pujilah aktifitasnya, menawarkan diri utk mencari sesuatu yg diinginkan anak, ajak ngobrol, dengarkan yg jadi perhatiannya dengan sungguh-sungguh dan penuh empati. Intinya: jadi ayah &amp; ibu yg komunikatif.</span></li>\r\n	<li style=\"text-align:justify\"><span style=\"color:#000000\">Beri sentuhan fisik yg mendukung.. Dpt memberikan efek asosiatif spt menepuk punggung/pundaknya saat kita bangga &amp; senang akan prestasinya. Kelak, tiap kali anak kita mendapat sentuhan macam itu, ia akan m&rsquo;hubungkannya dgn rasa dihormati &amp; dihargai</span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">&mdash; The power of hugging &ldquo;stiap org butuh 4x pelukan/hari utk tetap hidup, 8x utk sehat, 12x utk awet muda &amp; bahagia. Saat berpelukan, tubuh melepaskan hormon oxytocin yg nyambung dgn rasa damai &amp; cinta. Hormon ini membuat jantung &amp; pikiran sehat *Virginia Satix, family therapist*</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">&mdash; Kesabaran yg dibangun melalui kesadaran</span></p>\r\n\r\n<p style=\"margin-left:7.1pt; text-align:justify\"><span style=\"color:#000000\">4. Beri anak kita servis/pelayanan spt membawakan minum air putih menjelang tidur</span></p>\r\n\r\n<p style=\"margin-left:7.1pt; text-align:justify\"><span style=\"color:#000000\">5. Beri anak hadiah2 kecil, nilai sejati adl memberi perhatian &amp; apresiasi</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\"><span style=\"color:#000000\">6. Teknik bicara saat anak tidur: Bicaralah dgn lembut di telinganya saat ia tidur, ungkapkan apa yg jadi harapan kita.</span></p>\r\n\r\n<p style=\"margin-left:21.3pt; text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&mdash; Berdoalah dgn sungguh2 &amp; jgn pernah putus asa di berbagai kesempatan, doa adl senjata org beriman, apalagi doa seorang ibu utk anaknya, digambarkan tanpa batas menuju &lsquo;DIA&rsquo; &amp; hindari doa yg tidak baik</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&mdash; Pengasuhan anak perlu kerjasama ayah &amp; ibu</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', '2015-09-08'),
(52, 'DPA Tahun 2015', '10', '<p><img alt=\"\" src=\"/admin/images/berita/images/DPA2015008.jpg\" style=\"height:1131px; width:800px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/DPA2015009.jpg\" style=\"height:1131px; width:800px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Data DPA lengkap bisa di dapatkan dengan mengunjungi Sekretariat PPID Rumah Sakit Jiwa Mutiara Sukma.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '2015-11-10'),
