(59, 'Tata Cara Memperoleh Informasi Publik', '20', '<p><span style=\"color:#000000\">MEKANISME PERMOHONAN INFORMASI PUBLIK</span></p>\r\n\r\n<ol>\r\n	<li><span style=\"color:#000000\">Pemohon informasi datang ke desk layanan informasi dan mengisi formulir permintaan informasi dengan melampirkan fotocopy KTP pemohon/identitas lain yang sah atau pengguna informasi.</span></li>\r\n	<li><span style=\"color:#000000\">Petugas memberikan tanda bukti penerimaan permintaan informasi kepada pemohon.</span></li>\r\n	<li><span style=\"color:#000000\">Petugas memproses permintaan informasi sesuai dengan formulir yang telah di tandatangani oleh pemohon.</span></li>\r\n	<li><span style=\"color:#000000\">Petugas memenuhi permintaan informasi sesuai dengan yang diminta oleh pemohon, dan apabila informasi yang diminta tidak dalam penguasaan dan atau termasuk kategori informasi yang dikecualikan, PPID menyampaikan alasan sesuai dengan ketentuan peraturan perundangan yang berlaku.</span></li>\r\n	<li><span style=\"color:#000000\">Petugas memberi tanda bukti penyerahan informasi kepada pemohon.</span></li>\r\n</ol>\r\n', '2015-11-14'),
(60, 'Cara Mengajukan Keberatan', '20', '<p><span style=\"color:#000000\">TATA CARA MENGAJUKAN KEBERATAN :</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sesuai dengan Undang-Undang Republik Indonesia Nomor 14 Tahun 2008 Tentang Keterbukaan Informasi Publik BAB VIII Pasal 36 tata cara mengajukan keberatan adalah sebagai berikut :</span></p>\r\n\r\n<ol>\r\n	<li><span style=\"color:#000000\">Keberatan diajukan oleh pemohon Informasi publik dalam jangka waktu paling lambat 30 (tiga puluh) hari kerja kepada atasan Pejabat Pengelola Informasi dan Dokumentasi.</span></li>\r\n	<li><span style=\"color:#000000\">Atasan pejabat pengelola informasi memberikan tanggapan atas keberatan yang diajukan oleh pemohon Informasi Publik dalam jangka waktu paling lambat 30 (tiga puluh) hari kerja sejak diterimanya keberatan secara tertulis.</span></li>\r\n	<li><span style=\"color:#000000\">Alasan tertulis disertakan bersama tanggapan apabila atasan pejabat Pengelola Informasi dan Dokumentasi menguatkan putusan yang ditetapkan oleh bawahannya.</span></li>\r\n</ol>\r\n', '2015-11-14'),
