(63, 'pengaduan pejabat publik', '20', '<p style=\"text-align:center\"><span style=\"color:#000000\"><strong>Tata Cara Pengaduan Penyalahgunaan Wewenang Pejabat Badan Publik</strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Dalam upaya mewujudkan tata pemerintahan yang baik&nbsp; <em>(good governance) </em>di lingkungan RSJ Mutiara Sukma Provinsi NTB dan untuk membangun kepercayaan masyarakat <em>(trust) </em>terhadap pelayanan publik yang dilakukan RSJ Mutiara Sukma, maka perlu ditegakkan prinsip akuntabilitas dalam pelayanan publik sebagai salah satu indikator <em>good governance. </em>Dengan demikian keberadaan kontrol sosial dari masyarakat terhadap pejabat/penyelenggara pelayanan publik menjadi sangat penting. Oleh karena itu, RSJ Mutiara Sukma telah membangun fasilitas dan mekanisme layanan pengaduan masyarakat sehingga masyarakat bisa mengadukan/melaporkan langsung atas semua tindakan pejabat badan publik dalam menjalankan tugas dan fungsinya di RSJ Mutiara Sukma jika terjadi dugaan pelanggaran.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">RSJ Mutiara Sukma, dalam rangka memberikan pelayanan yang berkualitas, cepat, mudah, terjangkau, dan terukur, telah menetapkan Standar Pelayanan yang bisa dijadikan acuan penilaian oleh masyarakat berkaitan dengan kualitas pelayanan yang diberikan. Di samping itu juga telah diumumkan Maklumat Pelayanan sebagai kewajiban dan janji Penyelenggara pelayanan publik kepada masyarakat untuk menegakkan Standar Pelayanan yang telah ditetapkan.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Berikut Layanan Pengaduan kami &nbsp;jika ada penyalahgunaan wewenang pejabat publik di lingkungan RSJ Mutiara Sukma:</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Ruang Pengaduan Masyarakat</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" style=\"heigh