(68, 'Laporan Pengaduan Masyarakat', '', '<p><span style=\"font-size:12px\"><strong>LAPORAN PENANGANAN PENGADUAN MASYARAKAT</strong></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><strong>RUMAH SAKIT JIWA PROVINSI NUSA TENGGARA BARAT</strong></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><strong>BULAN : SEPTEMBER 2014</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"height:587px; width:831px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:45px\">\r\n			<h1><span style=\"font-size:12px\">NO.</span></h1>\r\n			</td>\r\n			<td style=\"width:191px\">\r\n			<h1><span style=\"font-size:12px\">Asal pengaduan</span></h1>\r\n			</td>\r\n			<td style=\"width:198px\">\r\n			<h1><span style=\"font-size:12px\">Isi Pengaduan</span></h1>\r\n			</td>\r\n			<td style=\"width:142px\">\r\n			<h1><span style=\"font-size:12px\">Tgl. Pengaduan</span></h1>\r\n			</td>\r\n			<td style=\"width:255px\">\r\n			<h1><span style=\"font-size:12px\">Posisi Pengaduan</span></h1>\r\n			</td>\r\n			<td style=\"width:236px\">\r\n			<h1><span style=\"font-size:12px\">Hasil Penanganan</span></h1>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:51px; width:45px\">\r\n			<h1><span style=\"font-size:12px\">1.</span></h1>\r\n			</td>\r\n			<td style=\"height:51px; width:191px\">\r\n			<h1><span style=\"font-size:12px\">Warga Kecamatan Gunung Sari melalui SMS Center.</span></h1>\r\n			</td>\r\n			<td style=\"height:51px; width:198px\">\r\n			<h1><span style=\"font-size:12px\">Pengaduan Pelayanan penjemputan pasien yang tidak sesuai dengan prosedur pelayanan Rumah Sakit Jiwa serta pola tarif yang tidak sesuai dengan Pergub Nomor 1 Tahun 2012.</span></h1>\r\n			</td>\r\n			<td style=\"height:51px; width:142px\">\r\n			<h1><span style=\"font-size:12px\">2 September 2014</span></h1>\r\n			</td>\r\n			<td style=\"height:51px; width:255px\">\r\n			<h1><span style=\"font-size:12px\">Setelah dilakukan penelusuran didapatkan fakta bahwa pada hari Sabtu jam 15.30 wita datang guide menemui petugas keamanan (SATPAM) minta untuk dilakukan penjemputan seorang pasien wanita dari Eropa di Gili Trawangan dengan kondisi agresif, yang dilakukan penjemputan oleh tenaga keamanan dan sopir yang seharusnya dilakukan oleh tim penjemputan yang terdiri dari tenaga dokter, perawat dan tenaga keamanan, dengan tarif yang disepakati Rp. 4.000.000,- (empat juta rupiah).</span></h1>\r\n			</td>\r\n			<td style=\"height:51px; width:236px\">\r\n			<h1><span style=\"font-size:12px\">Telah dilakukan BAP (Berita Acara Pemeriksaan) kepada tenaga keamanan (SATPAM) dan sopir yang telah melakukan penjemputan pasien yang tidak sesuai dengan prosedur, dan telah diberikan teguran dan pembinaan untuk tidak melakukan tindakan yang tidak sesuai dengan prosedur yang telah ditetapkan oleh Rumah Sakit Jiwa Provinsi NTB.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></h1>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"margin-left:6.3pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:6.3pt\"><span style=\"font-size:12px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mataram,&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Oktober 2014</span></p>\r\n\r\n<p style=\"margin-left:6.3pt\"><span style=\"font-size:12px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Direktur Rumah Sakit Jiwa&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:6.3pt\"><span style=\"font-size:12px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp