p;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; NIP. 19610131 198801 2 001</strong></span></p>\r\n\r\n<p style=\"margin-left:6.3pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:6.3pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:6.3pt\">&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong>LAPORAN PENANGANAN PENGADUAN MASYARAKAT</strong></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><strong>RUMAH SAKIT JIWA MUTIARA SUKMA</strong></span></p>\r\n\r\n<p style=\"margin-left:-14.2pt\"><span style=\"font-size:12px\"><strong>BULAN : FEBRUARI 2015</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"height:939px; width:820px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:32px; width:45px\">\r\n			<h1><span style=\"font-size:12px\">NO.</span></h1>\r\n			</td>\r\n			<td style=\"height:32px; width:191px\">\r\n			<h1><span style=\"font-size:12px\">Asal pengaduan</span></h1>\r\n			</td>\r\n			<td style=\"height:32px; width:198px\">\r\n			<h1><span style=\"font-size:12px\">Isi Pengaduan</span></h1>\r\n			</td>\r\n			<td style=\"height:32px; width:141px\">\r\n			<h1><span style=\"font-size:12px\">Tgl. Pengaduan</span></h1>\r\n			</td>\r\n			<td style=\"height:32px; width:255px\">\r\n			<h1><span style=\"font-size:12px\">Posisi Pengaduan</span></h1>\r\n			</td>\r\n			<td style=\"height:32px; width:314px\">\r\n			<h1><span style=\"font-size:12px\">Hasil Penanganan</span></h1>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:218px; width:45px\">\r\n			<h1><span style=\"font-size:12px\">1.</span></h1>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:218px; width:191px\">\r\n			<p><span style=\"font-size:12px\">Ombudsman Republik Indonesia&nbsp; Perwakilan Nusa Tenggara Barat</span></p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:218px; width:198px\">\r\n			<h1><span style=\"font-size:12px\">Permintaan klarifikasi I terkait penyelesaian laporan Saudara A.A.B Yudistira tentang proses permintaan data rekan medis.</span></h1>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:218px; width:141px\">\r\n			<h1><span style=\"font-size:12px\">12 Pebruari 2015</span></h1>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:218px; width:255px\">\r\n			<h1><span style=\"font-size:12px\">1.Pelapor menyatakan pernah dirawat di RSJ Mutiara Sukma sejak tahun 2000 s.d 2010.</span></h1>\r\n\r\n			<ol>\r\n				<li><span style=\"font-size:12px\">Pelapor menyatakan pernah minta data terkait rekam&nbsp; medis kepada RSJ Mutiara Sukma namun terkesan dipersulit.</span></li>\r\n				<li><span style=\"font-size:12px\">Pelapor&nbsp; merasa keberatan dengan pihak RSJ Mutiara Sukma&nbsp; yang tidak menghiraukan permintaan rekam medis.</span></li>\r\n			</ol>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:218px; width:314px\">\r\n			<h1><span style=\"font-size:12px\">1.Rekam Medis adalah rahasia kedokteran yang tertera dalam UU no. 44 tahun 2009 tentang RUMAH SAKIT yang menyatakan bahwa yang dimaksud dengan Rahasia Kedokteran adalah segala sesuatu yang berhubungan dengan hal yang ditemukan oleh dokter dan dokter gigi dalam rangka pengobatan dan dicatat dalam rekam medis yang dimiliki pasien dan bersifat rahasia dan dalam UU RI No. 36 tahun 2009 tentang KESEHATAN pada pasal 57 menyatakan :</span></h1>\r\n\r\n			<h1><span style=\"font-size:12px\">a.Setiap orang berhak atas rahasia kondisi kesehatan pribadinya yang telah dikemukakan kepada penyelenggara pelayanan kesehatan.</span></h1>\r\n\r\n			<h1><span style=\"font-size:12px\">b.Ketentuan hak mengenai hak atas rahasia kondisi kesehatan pribadi sebagaimana dimaksud pada ayat (1) tidak berlaku dalam hal :</span></h1>\r\n\r\n			<h1><span style=\"font-size:12px\">1)Perintah undang undang</span></h1>\r\n\r\n			<h1><span style=\"font-size:12px\">2)Perintah pengadilan</span></h1>\r\n\r\n			<h1><span style=\"font-size:12px\">3)Izin yang bersangkutan</span></h1>\r\n\r\n			<h1><span style=\"font-size:12px\">4)Kepentingan masyarakat</span></h1>\r\n\r\n			<h1><span style=\"font-size:12px\">5)Kepentingan orang tersebut.</span></h1>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"height:411px; width:822px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:218px; width:45px\">\r\n			<h1>&nbsp;</h1>\r\n			</td>\r\n			<td style=\"height:218px; width:191px\">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:218px; width:198px\">\r\n			<h1>&nbsp;</h1>\r\n			</td>\r\n			<td style=\"height:218px; width:141px\">\r\n			<h1>&nbsp;</h1>\r\n			</td>\r\n			<td style=\"height:218px; width:255px\">\r\n			<h1>&nbsp;</h1>\r\n			</td>\r\n			<td style=\"height:218px; width:314px\">\r\n			<h1><span style=\"font-size:12px\">2.A.A.B Yadistira memang benar adalah pasien RSJ Mutiara Sukma sejak tgl. 20 April 2000 s/d 12 Nopember 2011. Setelah kami telusuri ternyata yang bersangkutan tidak pernah mengajukan permintaan resmi secara tertulis kepada RSJ Mutiara Sukma sehingga permintaan tidak dapat dipenuhi.</span></h1>\r\n\r\n			<h1><span style=\"font-size:12px\">3.Rekam Medis hanya dapat diberikan apabila ada permintaan resmi secara tertulis oleh yang bersangkutan atau lembaga terkait sesuai dengan maksud dan tujuan yang jelas.&nbsp;</span></h1>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"margin-left:6.3pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:22.0cm\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:552.85pt\"><span style=\"font-size:12px\">Mataram,&nbsp;&nbsp; 2 Maret &nbsp;2015</span></p>\r\n\r\n<p style=\"margin-left:552.85pt\"><spa