le=\"font-size:12px\">Posisi Pengaduan</span></h1>\r\n			</td>\r\n			<td style=\"width:236px\">\r\n			<h1><span style=\"font-size:12px\">Hasil Penanganan</span></h1>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:51px; width:45px\">\r\n			<h1><span style=\"font-size:12px\">1.</span></h1>\r\n			</td>\r\n			<td style=\"height:51px; width:172px\">\r\n			<h1><span style=\"font-size:12px\">Saudara Farid</span></h1>\r\n			</td>\r\n			<td style=\"height:51px; width:217px\">\r\n			<h1><span style=\"font-size:12px\">Pengaduan pelayanan ketidaknyamanan pengunjung &nbsp;atas perlakuan&nbsp; petugas parkir di area parkir Rumah Sakit Jiwa Mutiara Sukma.&nbsp;</span></h1>\r\n			</td>\r\n			<td style=\"height:51px; width:142px\">\r\n			<h1><span style=\"font-size:12px\">26 September 2015</span></h1>\r\n			</td>\r\n			<td style=\"height:51px; width:255px\">\r\n			<h1><span style=\"font-size:12px\">Setelah dilakukan penelusuran didapatkan fakta bahwa pada hari Sabtu 26 September 2015 jam 10.30 wita datang pengunjung untuk menjenguk keluarga yang dirawat di bangsal flamboyan pada saat di area parkir terjadi kesalah pahaman antara petugas parkir dengan pengunjug terkait pengaturan parkir yang pada saat kejadian area parkir sudah penuh.</span></h1>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:51px; width:236px\">\r\n			<h1><span style=\"font-size:12px\">Telah dilakukan pemanggilan &nbsp;kepada petugas parkir tersebut&nbsp; terkait kronologis kejadian diarea parkir rumah sakit&nbsp; dan telah diberikan teguran dan pembinaan untuk tidak melakukan tindakan yang tidak sesuai dengan prosedur yang telah ditetapkan oleh Rumah Sakit Jiwa Mutiara Sukma.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></h1>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"margin-left:6.3pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:6.3pt\"><span style=\"font-size:12px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:6.3pt\"><span style=\"font-size:12px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; Mataram,&nbsp;&nbsp; 10 Oktober&nbsp; 2015</span></p>\r\n\r\n<p style=\"margin-left:6.3pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:6.3pt\"><span style=\"font-size:12px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&', '2015-12-10');
INSERT INTO `sekilas_mataram` (`id`, `judul`, `kategori`, `konten`, `tanggal`) VALUES
(69, 'Roadshow tim pokja rumpun Kesra Provinsi NTB', '13', '<p style=\"text-align:justify\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/ibu.jpg\" style=\"border-style:solid; border-width:3px; float:left; height:218px; margin:4px 3px; width:285px\" /></span><span style=\"color:#000000\"> D</span><span style=\"color:#000000\">al</span><span style=\"color:#000000\">a</span><span style=\"color:#000000\">m</span><span style=\"color:#000000\"> ran</span><span style=\"color:#000000\">gka</span><span style=\"color:#000000\"> menyamakan p</span><span style=\"color:#000000\">ersep</span><span style=\"color:#000000\">si lintas program pokja rumpun kesra Provinsi NTB, beberapa hari yang lalu telah dilaksanak</span><span style=\"color:#000000\">an kegiatan ro</span><span style=\"color:#000000\">a</span><span style=\"color:#000000\">dshow tim pokja rumpun kesra Pr</span><span style=\"color:#000000\">ovinsi NTB ke seluruh wilayah kabupaten di pulau Lombok. Kegiatan roadsh</span><span style=\"color:#000000\">ow tersebut d</span><span style=\"color:#000000\">ila</span><span style=\"color:#000000\">ksanakan hari S</span><span style=\"color:#000000\">enin, 1</span><span style=\"color:#000000\">1/4 2016&nbsp; untuk wilayah kabupaten Lombok Timur, serta hari selasa 12/4 2016 untuk wilayah lombok te</span><span style=\"color:#000000\">ngah. Di Kabupaten Lombok timur sendiri kegiatan roadshow di </span><span style=\"color:#000000\">pusatkan di kantor Bappeda Lombok Timur, dan hadiri oleh seluruh kepala pimpinan SKPD yang terhimpun dalam pokja rumpun kesra Provinsi NTB. Pimpinan dalam kelompok kesra tersebut antara lain, Kepala Biro Kesra Provinsi NTB, Kepala Dinas Kesehatan&nbsp; Provinsi NTB, Penjabat Struktural RSU Provinsi NTB, Direktur RSJ Mutiara Sukma, kepala Dinas Sosial, Kepala Dinas Tenaga Kerja dan Transmigrasi serta pimpinan pimpinan SKPD terkait.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Untuk kegiatan roadshow di wilayah Lombok timur, rapat atau pertemuan dipimpin oleh Bapak Drs. H </span><span style=\"color:#000000\">. Lalu Syafii, MM, selaku&nbsp; Asisten III Provinsi Nusa Tenggara Barat. Dalam sambutannya, Bapak Asisten III Provinsi Nusa Tenggara Barat, menekankan perlunya sharing anggaran untuk program-program yang terkait dengan kesejahteraan masyarakat.&nbsp; Khusus kesehatan jiwa, Bapak Asisten III, menyoroti perkembangan Program Bebas pasung yang telah dicanangkan oleh Gubernur NTB beberapa tahun yang lalu. beliau mengatakan bahwa d<em>i Kabupaten </em>Lombok Timur&nbsp; masih ada penderita gangguan jiwa yang terpasung<em>, &quot;Oleh karena kita sudah mempunyai peraturan Gubernur terkait pasung serta adanya Undang-Undang kesehatan jiwa, maka tidak boleh lagi ada penderita yang terpasung&rdquo; </em>tegas Bapak Drs. H . Lalu Syafii, MM, saat itu. Selain di Lombok Timur, kegiatan roadshow juga dilakukan di Lombok Tengah. Namun hal yang menarik di Lombok tengah adalah kegiatan tersebut di hadiri Wakil Bupati Lombok Tengah, Bapak Lalu Pathul Bahri,S.IP. Dalam sambutannya Bapak Wakil Bupati mengapreaseasi kegiatan road show ini. &ldquo; <em>saya sangat berterimakasih atas kehadiran bapak ibu semua, tentunya kegiatan ini merupakan penguatan atau koordinasi dari semua SKPD yang ada di Lombok Tengah maupun Provinsi NTB</em> &ldquo; ujar pak Wakil Bupati. Lebih lanjut,&nbsp; Bapak Wakil Bupati Lombok tengah mengharapkan dalam kegiatan roadshow yang dilakukan oleh rumpun kesra pemprov NTB ini, terjadi persamaan persepsi dan hasil yang maksimal, sehingga dalam melaksanakan&nbsp; program &ndash; program di rumpun kesra tersebut tidak terjadi tumpang tindih kepentigan antara SKPD Provinsi dengan SKPD di Kabupaten.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Terkait kesehatan jiwa, dalam pertemuan tersebut muncul beberapa hal tentang pelayanan kesehatan jiwa, salah satunya adalah pembiayaan penderita kesehatan jiwa dan program bebas pasung yang telah diluncurkan oleh Gubernur Provinsi NTB pada tahun 2018. dr. Elly Rosilla Wijaya, SpKJ. MM, selaku Direktur RSJ Mutiara Sukma, dalam pemaparannya menekankan perlu adanya peraturan Bupati, sebagai turunan atau petunjuk teknis atau regulasi terkait Program Bebas Pasung. dr.Elly menjelaskan bahwa RSJ Mutiara Sukma merupakan pemberi pelayanan di bidang kesehatan jiwa. &ldquo;<em>RSJ adalah rumah sakit khusus yang memberikan pelayanan dalam bidang kesehatan jiwa, oleh karena itu, dalam memberikan pelayanan, tentunya kami akan memberikan pelayanan sebaik baiknya, sesuai standar mutu yang ada, dan dan tentu saja dalam pelayanan itu kami membutuhkan anggaran.</em> &ldquo; ujar dr. Elly saat itu. Menurut dr Elly, anggaran berasal dari pembayaran keluarga pasien. Namun, cara pembayarannyalah yang bermacam-macam. Khusus untuk penderita pasung dan penderita gangguan jiwa yang terlantar hal itu sudah di atur dalam undang-undang kesehatan jiwa, yaitu penderita pasung atau yang terlantar menjadi tanggung jawab pemerintah serta pemerintah daerah. Bunda (panggilan akrab dr. elly oleh karyawannya) menegaskan bahwa dana dari pemerintah pusat di kucurkan lewat BPJS, sedangkan anggaran dari pemerintah daerah, pos anggaranya ada di dinas kesehatan. Bagi penderita yang tidak terdaftar dari kedua institusi tersebut tentunya akan menjadi tanggung jawab dari pemerintah kabupaten. Di akhir pemaparannya dr. Elly Rosilla Wijaya, SpKJ. MM, menyampaikan ucapan terima kasih kepada pemerintah kabupaten Lombok Tengah dan beberapa kabupaten lainya karena telah menanda tangani perjanjian kerjasama dengan RSJ Mutiara Sukma. Sehingga, bagi penderita gangguan jiwa yang terlantar maupun yang di pasung atau yang tidak memiliki identitas keluarga dapat di rawat di RSJ Mutiara Sukma.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Dalam kesempatan tersebut,&nbsp; ibu direktur RSJ Mutiara Sukma, tidak lupa menitipkan pesan bahwa tidak boleh lagi menyebut penderita gangguan jiwa dengan sebutan &ldquo;ORANG GILA atau JOGANG&rdquo;. &ldquo;<em>Saat ini sudah ada undang &ndash; undang kesehatan jiwa, dalam undang &ndash; undang tersebut sebutan untuk penderita gangguan jiwa adalah ODGJ atau orang dengan dengan gangguan jiwa. Sebutan ORANG GILA akan menyakiti perasaan mereka dan itu melaggar HAM</em> &ldquo; ungkap dr. Elly.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Kegiatan roadshow rumpun Kesra Provinsi NTB ini rencananya akan dilaksanakan di seluruh kabupaten/kota wilayah Provinsi NTB. Namun, di akhir acara roadshow kemarin, seluruh kepala SKPD telah menanda tangani hasil kepakatan yang di bahas.&nbsp; Beberapa program kerja yang disepakati antara lain&nbsp; adanya persamaan persepsi antara Pemerintah Provinsi NTB dengan Pemerintah Kabupaten tentang Program Generasi Emas, NTB Bebas Pasung, Program ASHAR (Aksi Seribu Hari Pertama Kehidupan), dan Program Rumpun Kesejahteraan Rakyat lainnya. Khusus kesehatan jiwa, secara tehnis akan di bentuk Tim Community Mental Health Nursing (CMHN), pendataan penderita gangguan jiwa sampai ke seluruh Kabupaten&nbsp;&nbsp; berkerjasama dengan Kepala Desa/Lurah, Camat, Dinas Kesehatan, Dinas Sosial, Tenaga Kerja, Dinas Kependudukan dan Catatan Sipil,&nbsp; dan PKK serta membentuk kelompok Swabantu. (arif rahman)</span></p>\r\n', '2016-04-14'),
(71, 'Penerapan Kebijakan Program Kawasan Tanpa Rokok  di RSJ Mutiara Sukma Provinsi NTB', '13', '<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><img alt=\"\" src=\"/admin/images/berita/images/DSCF5707.jpg\" style=\"float:left; height:128px; width:150px\" />Sejak di tetapkannya peraturan daerah Nomor 3 tahun 2014 oleh Gubernur Provinsi NTB tentang kawasan tanpa rokok, hampir tidak pernah di temukan lagi putung rokok di lingkungan RSJ Mutiara Sukma. Bagi karyawan atau pengunjung yang kebetulan perokok, maka&nbsp; tidak diperkenankan lagi untuk merokok di sekitar lingkungan Rumah Sakit Jiwa Mutiara Sukma.&nbsp; &nbsp;Kebijakan KTR merupakan salah satu kebijakan Gubernur NTB yang bertujuan untuk memberikan perlindungan yang efektif terhadap paparan asap rokok orang lain dan&nbsp; memberikan ruang dan lingkungan yang bersih dan sehat bagi masyarakat. Selain itu, tujuan di tetapkannya KTR yaitu untuk mencegah bertambahnya perokok pemula dan melindungi kesehatan masyarakat secara umum dari dampak buruk rokok baik Iangsung maupun tidak langsung, sehingga terwujudnya kesejahteraan masyarakat.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Peraturan Gubernur ini berisi tentang peraturan mengenai fasilitas atau tempat dilarang merokok (fasilitas pelayanan kesehatan, tempat proses belajar mengajar, tempat anak bermain, tempat ibadah, angkutan umum, tempat kerja, tempat umum). Oleh karena itu, pihak-pihak seperti pedagang di kantin RSJ atau keluarga dan pengunjung&nbsp; dilarang untuk menyediakan tempat merokok, dan memberikan rokok kepada pasien, dengan begitu lingkungan yang sehat bagi masyarakat dapat di wujudkan.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Peraturan mengenai kawasan tanpa rokok ini telah ditetapkan sejak Mei 2014, sehingga rumah sakit jiwa mutiara sukma sebagai institusi kesehatan yang bernaung di bawah pemerintah daerah NTB wajib menerapkan peraturan tersebut. Penerapan dari kebijakan ini tidak lepas dari peran dari <em>stakeholder</em> terkait. &nbsp;Selain memberikan teguran langsung, advokasi serta sosialisi Rumah sakit jiwa Mutiara Sukma sebagai kawasan tanpa asap rokok dilakukan melalui pemasangan poster dan spanduk KTR, seperti contoh telah tersedianya spanduk di ruang publik misanya di ruang tunggu serta ruang rawat inap, sedangkan untuk advokasi, kegiatan yang dilakukan adalah mengingatkan perokok akan bahaya merokok dan sanksi denda 50 juta apabila perokok merokok di kawasan RSJ Mutiara Sukma sebagaimana bunyi peraturan daerah Nomor 3 tahun 2014 tentang KTR&nbsp; yaitu&nbsp; Setiap orang yang merokok di kawasan Tanpa Rokok sebagaimana dimaksud dalam Pasal 16 ayat (1) dipidana dengan pidana kurungan paling lama 3 (tiga) hari atau denda paling banyak Rp50.000.000,(lima puluh juta rupiah).</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Rumah sakit jiwa Mutiara Sukma berikhtiar untuk melayani masyarakat NTB sebaik- baiknya sebagaimana mottonya yaitu &ldquo;Melayani dengan Empati&rdquo;. Selain itu, RSJ Mutiara Sukma bertekad untuk menjadikan lingkungan Rumah Sakit Jiwa Mutiara Sukma sebagai kawasan tanpa asap rokok&nbsp; serta kawasan tanpa kegiatan memproduksi, menjual, mengiklankan, dan/atau mempromosikan produk tembaka, Hal ini dilakukan sebagai suatu kewajiban dan tanggung jawab Rumah Sakit Jiwa Mutiara Sukma sebagai instansi pemerintah yang bergerak di bidang kesehatan, sehingga hak &ndash; hak masyarakat terhadap kebutuhan udara bersih dapat terpenuhi. (arif rahman)</span></p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n', '2016-04-16'),
(76, 'Penerapan Kebijakan Program Kawasan Tanpa Rokok  di RSJ Mutiara Sukma Provinsi NTB', 'Tes', '<p style=\"text-align:justify\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/DSCF5707.jpg\" style=\"float:left; height:128px; width:150px\" />Sejak di tetapkannya peraturan daerah Nomor 3 tahun 2014 oleh Gubernur Provinsi NTB tentang kawasan tanpa rokok, hampir tidak pernah di temukan lagi putung rokok di lingkungan RSJ Mutiara Sukma. Bagi karyawan atau pengunjung yang kebetulan perokok, maka&nbsp; tidak diperkenankan lagi untuk merokok di sekitar lingkungan Rumah Sakit Jiwa Mutiara Sukma.&nbsp;</span></p>\r\n\r\n<hr />\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&nbsp;Kebijakan KTR merupakan salah satu kebijakan Gubernur NTB yang bertujuan untuk memberikan perlindungan yang efektif terhadap paparan asap rokok orang lain dan&nbsp; memberikan ruang dan lingkungan yang bersih dan sehat bagi masyarakat. Selain itu, tujuan di tetapkan nya KTR yaitu untuk mencegah bertambahnya perokok pemula dan melindungi kesehatan masyarakat secara umum dari dampak buruk rokok baik Iangsung maupun tidak langsung, sehingga terwujudnya kesejahteraan masyarakat. Peraturan Gubernur ini berisi tentang peraturan mengenai fasilitas atau tempat dilarang merokok (fasilitas pelayanan kesehatan, tempat proses belajar mengajar, tempat anak bermain, tempat ibadah, angkutan umum, tempat kerja, tempat umum). Oleh karena itu, pihak-pihak seperti pedagang di kantin RSJ atau keluarga dan pengunjung&nbsp; dilarang untuk menyediakan tempat merokok, dan memberikan rokok kepada pasien, dengan begitu lingkungan yang sehat bagi masyarakat dapat di wujudkan.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Peraturan mengenai kawasan tanpa rokok ini telah ditetapkan sejak Mei 2014. Rumah Sakit Jiwa Mutiara Sukma sebagai institusi kesehatan yang bernaung di bawah pemerintah daerah NTB, wajib menerapkan peraturan tersebut. Selain memberikan teguran langsung, advokasi serta sosialisi Rumah sakit jiwa sebagai kawasan tanpa asap rokok dilakukan melalui pemasangan poster dan spanduk KTR, seperti contoh tersedianya spanduk di ruang publik misanya di ruang tunggu serta ruang rawat inap, sedangkan untuk advokasi, kegiatan yang dilakukan adalah mengingatkan perokok akan bahaya merokok dan sanksi denda 50 juta apabila perokok merokok di kawasan RSJ Mutiara Sukma sebagaimana bunyi peraturan daerah Nomor 3 tahun 2014 tentang KTR,&nbsp; yaitu&nbsp; Setiap orang yang merokok di kawasan Tanpa Rokok sebagaimana dimaksud dalam Pasal 16 ayat (1) dipidana dengan pidana kurungan paling lama 3 (tiga) hari atau denda paling banyak Rp 50.000.000,(lima puluh juta rupiah).</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Rumah Sakit Jiwa Mutiara Sukma berikhtiar untuk melayani masyarakat NTB sebaik- baiknya sebagaimana mottonya yaitu &ldquo;Melayani dengan Empati&rdquo;. Selain itu, RSJ Mutiara Sukma bertekad untuk menjadikan lingkungan Rumah Sakit Jiwa Mutiara Sukma sebagai kawasan tanpa asap rokok, serta kawasan tanpa kegiatan memproduksi, menjual, mengiklankan, dan/atau mempromosikan produk tembaka, Hal ini dilakukan sebagai suatu kewajiban dan tanggung jawab Rumah Sakit Jiwa Mutiara Sukma sebagai instansi pemerintah yang bergerak di bidang kesehatan, sehingga hak &ndash; hak masyarakat terhadap kebutuhan udara bersih dapat terpenuhi. (refo)</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', '2016-04-16'),
(78, 'Kunjungan â€œbenchmarkingâ€ RSJ Kalawa Atei, Kalimantan tengah.', 'Tes', '<p style=\"text-align:justify\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/rsj%20kalawa.jpg\" style=\"float:left; height:178px; width:255px\" />Senin, 18 april 2016, Kemarin,&nbsp; Rumah Sakit Jiwa Mutiara Sukma, menerima kunjungan dari Kalimantan Tengah yaitu rombongan yang terdiri dari anggota Komisi C DPRD Provinsi Kalimantan Tengah, Biro Kesra, Bappeda serta pejabat struktural dari Rumah Sakit Jiwa Kalawa Atei, Kalimantan tengah. Rombongan yang berjumlah sekitar 24 orang ini langsung di sambut oleh direktur RSJ Mutiara Sukma dr. Elly Rosilla Wijaya SpKJ, MM di aula rumah sakit jiwa mutiara Sukma. Menurut informasi yang terima, tujuan rombongan tersebut datang ke RSJ Mutiara Sukma adalah untuk melakukan &ldquo;<em>benchmarking&rdquo;</em> atau kegiatan studi banding terhadap pelayanan kesehatan jiwa di Provinsi NTB khusus nya di Rumah sakit jiwa mutiara Sukma. Dalam sambutannya&nbsp; dr.Elly Rosilla Wijaya SpKJ, MM, menyampaikan ucapan selamat datang kepada rombongan dari Kalimantan tengah ini. Dihadapan tamunya, dr Elly lalu mempromosikan wisata pulau Lombok serta mengapreaseasi atas dipilihnya RSJ Mutiara Sukma sebagai tujuan &ldquo;<em>benchmarking&rdquo;</em>. Ia mengatakan bahwa kunjungan ini adalah suatu hal yang luar biasa dimana sekelompok SKPD yang terdiri dari Komisi C DPRD bersama lintas sektor melakukan &ldquo;<em>benchmarking&rdquo;</em> khusus untuk kesehatan jiwa.</span></p>\r\n\r\n<p style=\"margin-left:35.45pt; text-align:justify\"><span style=\"color:#000000\">&ldquo;<em>pertama saya mengucapkan selamat di Provinsi NTB pulau dengan seribu masjid, dengan segala kekayaan alamnya yang indah, maka saya menyarankan kepada ibu, bapak agar melihat keindahan Nusa Tenggara Barat khususnya pulau Lombok,</em> ujar dr Elly<em>.</em> <em>&ldquo;Hari ini sebenarnya kami sedang ada roadsohw rumpun kesra Provinsi NTB untuk melakukan sinergitas kegiatan atau program yang akan di lakukan tahun 2017.&nbsp; Namun, karena hari ini saya ada tamu, maka saya &nbsp;iijn kepada Bapak asisten III, untuk menerima tamu-tamu saya dari kalimantan tengah,ungkap dr Elly kemudian..</em></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">dr.Elly Rosilla Wijaya SpKJ, MM megatakan, walaupun sebelumnya sudah pernah kesini, namun pulau Lombok ini berbeda dari hari ke hari karena pembangan NTB begitu pesat, &ldquo; menurutnya, pembangunan di Provinsi NTB telah banyak perubahan sejak kepindahan beliau dari Provinsi jawa tengah, Tahun 2000 silam,</span></p>\r\n\r\n<p style=\"margin-left:35.45pt; text-align:justify\"><span style=\"color:#000000\">&ldquo;<em>ketika saya datang tahun 2000 dulu, mataram masih sepi sekali, tapi sekarang betul- betul luar biasa, dan baru-baru ini kami baru saja mendapatkan penghargaan untuk wisata halal di tingkat dunia</em> ujar dr Elly mempromosikan NTB. <em>Di sini ibu bapak akan dimanjakan dengan pemandangan alam yang begitu indah, di sini ada wisata kerajinan yang luar biasa, di pulau lombok ini ada mutiara yang indah dan kami ambil namanya untuk nama Rumah Sakit Jiwa ini. Selain itu, Lombok terkenal juga dengan wisata kulinernya, dan yang paling terkenal adalah ayam taliwang, jadi saya harapkan dompet yg terbawa dari Kalimantan, jangan sampai masih&nbsp; terisi, kosongkan di sini, kalau perlu tambah dengan gesekan sehingga ada kenangan indah yang terbawa ke kalimantan</em>, ujar dr elly lebih lanjut.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Setelah mempromosikan wisata NTB, ibu direktur RSJ Mutiara Sukma kemudian mempresentasikan perkembangan dan pelayanan di RSJ Mutiara Sukma, kepada para rombongan. Di akhir kegiatan salah seorang peserta dari rombongan Kalteng yaitu Bapak Ahmad Amur anggota DPRD dari fraksi PPP, kemudian menyampaikan apreaseasi atas sambutan yang diberikan oleh ibu direktur.</span></p>\r\n\r\n<p style=\"margin-left:35.45pt; text-align:justify\"><span style=\"color:#000000\"><em>&ldquo;dari apa yg ibu sampaian tadi saya sampai terkagum kagum karena kita melihat kondisi RSJ kita yang berada di kalimantan tengah sangat jauh, selama ini kesan saya bahwa RSJ itu penuh dengan jeruji, penuh dengan segala macam yang bersifat angkerlah gitu, jadi mohon setelah acara ini kami bisa diberikan sedikit ilmu agar kami bisa mengubah tampilan&nbsp; RSJ kami menjadi seperti RSJ Mutiara Sukma ungkap beliau anggota dewan ini </em></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Setelah bediskusi panjang lebar dan bebagi pengalaman, kegiatan &ldquo;<em>benchmarking&rdquo;</em> ini berakhir hingga pukul 12.30 wita. selanjutnya acara &nbsp;dilanjutkan dengan makan siang bersama serta keliling ke area Rumah Sakit jiwa Mutiara Sukma. Setelah pukul 13.00 Wita, rombongan dari Kalimantan Tengah ini, kemudian meninggalkan Rumah Sakit jiwa Mutiara Sukma.(refo)</span></p>\r\n', '2016-04-19'),
(87, 'Puluhan Anggota komisi 4 DPRD Provinsi Kepulauan Bangka Belitung beserta ke RSJ Mutiara Sukma', 'Tes', '<p style=\"text-align:justify\"><img alt=\"\" src=\"/admin/images/berita/images/IMG_9148%281%29.jpg\" style=\"float:left; height:167px; width:250px\" />Setelah&nbsp; kemarin menerima kunjungan dari rombongan DPRD Kalimantan Tengah serta rombongan&nbsp; RSJ Kalawa Atei Kalimantan Tengah, Hari ini,&nbsp; Kamis 21 april 2016, yang bertepatan dengan hari kartini, RSJ Mutiara Sukma kembali kedatangan tamu yaitu dari Provinsi kepulauan Bangka Belitung.&nbsp; Rombongan yang berjumlah sekitar puluhan orang itu merupakan Anggota komisi 4 DPRD Provinsi Kepulauan Bangka Belitung beserta pejabat struktural&nbsp; RSJ kepulauan bangka Belitung.</p>\r\n\r\n<p style=\"text-align:justify\">Rombongan tersebut di sambut&nbsp; langsung oleh direktur RSJ Mutiara Sukma dr. Elly Rosilla Wijaya, SpKJ., MM berserta pejabat struktural di aula utama&nbsp; RSJ Mutiara Sukma. Dalam sambutannya&nbsp; dr. elly menyampaikan ucapan selamat datang kepada robongan&nbsp; dari Bangka Belitung ini dan menyampaikan apreaseasi&nbsp; atas kunjungannya ke RSJ&nbsp; Mutiara Sukma.</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo; <em>Bapak wakil ketua komisi IV &nbsp;DPRD Kepulauan Bangka Belitung, Direktur RSJ Bangka Belitung, dr. Heru beserta rombogan, pertama-tama saya atas nama civitas RSJ&nbsp; Mutiara Sukma mengucapkan terima kasih atas kepercayaannya mengunjungi Rumah Sakit Jiwa kami,</em> <em>yang berada di pulau Lombok</em>. ujar dr elly mengawali kata sambutannya. &nbsp;<em>Provinsi NTB ini tidak jauh berbeda dengan kepulauan Bangka Belitung, karena NTB juga terdiri dari 2 pulau besar, yaitu pulau Lombok dan pulau Sumbawa. Wilayah kerja kami di Pulau Sumbawa lebih besar, pulau lombok ini 1/3 nya pulau sumbawa, yang jarak tempuhnya kalau dari sini ke pulau sumbawa kira-kira 12 jam dengan menggunakan Bis</em>, ujar ibu elly menjelaskan gambaran wilayah kerja RSJ Mutiara Sukma.</p>\r\n\r\n<p style=\"text-align:justify\">Lebih lanjut, dihadapan tamunya ini, ibu dr elly menjelaskan tentang gambaran umum RSJ Mutiara Sukma yang berdiri di atas tanah seluas 6 hektar serta merupakan milik Pemda Provinsi NTB. Selanjutnya, dr elly dengan detail menyampaikan bagaimana persiapan RSJ Mutiara Sukma dalam menghadapi&nbsp; akreditasi, bagaimana &nbsp;pengalaman RSJ menjadi badan layanan umum daerah serta bagaimana pelayanan kesehatan jiwa masyarakat maupun pelayanan di dalam RSJ sendiri.</p>\r\n\r\n<p style=\"text-align:justify\"><em>&ldquo;Saat ini jumlah tempat tidur kami ada 100 tempat tidur dengan BOR diatas 90 %, dan tahun ini kami sudah membuat kebijakan untuk menambah tempat tidur menjadi 150 tempat tidur&rdquo;</em>&nbsp; ujar dr elly dalam menjelaskan pelayanan rawat inap di&nbsp; RSJ Mutiara Sukma. &ldquo; <em>sesuai dengan visi kami, yaitu rumah sakit jiwa dambaan masyarakat dengan mutu layanan terkini, maka kami harapkan masyarakat NTB agar memanfaatkan RSJ Mutiara Sukma&nbsp; sebagai&nbsp; tempat perawatan dan pengobatan orang dengan gangguan jiwa, jadi dambaan masyarakat artinya orang dengan gangguan jiwa di rawat di sini&nbsp; dan kami akan melayani nya sesuai dengan martabatnya sebagai manusia</em>&rdquo; Ujar dr elly rosilla wijaya, direktur RSJ Mutiara Sukma.</p>\r\n\r\n<p style=\"text-align:justify\">Beliau direktur kemudian menjelaskan&nbsp; bahwa sejak tahun 2014, bangsal &ndash; bangsal di RSJ Mutiara Sukma yang masil ada kerangkengnya sudah tidak ada karena semuanya sudah direnovasi. Dalam hal perawatan penderita dengan gangguan jiwa semua dilakukan dengan konsep seperti di rumah mereka sendiri, aman dan nyaman.&nbsp; bahkan untuk&nbsp; ruang kelas 3 berdasarkan&nbsp; ketentuan kementrian kesehatan maka jumlah maksimal tempat tidur adalah 6 buah dan&nbsp; pengawan penderita di awasi langsung oleh perawat melalui layar&nbsp; cc tivi</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;<em>mudah-mudahan apa yang di hajatkan oleh bapak ibu sekalian bisa terpenuhi dan informasi-informasi apa yang di minta dapat tersampaikan. Namun, jika ada yang terlewatkan kita bisa berdiskusi dan nanti kalo berkenan bapak ibu, boleh melakukan hospital tour untuk melihat pelayanan di RSJ Mutiara Sukma,</em> ujar dr elly.&nbsp; selanjutnya untuk menutup kata sambutannya dr elly tidak lupa mempromisakan wisata NTB di hadapan para tamunya tersebut. &nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Sementara itu, ketua rombongan dari &nbsp;kepulauan bangka belitung yaitu wakil ketua Komisi IV DPRD Kepulauan Bangka Belitung mengatakan bahwa tujuan dari kedatangan mereka ke <em>RSJ Mutiara Sukma</em> adalah untuk belajar bagaimana cara memberikan pelayanan serta cara memberikan hak kepada penderita yang mengalami gangguna jiwa. Menurut beliau antara Provinsi NTB dan Provinsi Kepulauan Bangka Belitung Benar memilki kesamaan yaitu memiliki 2 pulau besar,&nbsp; yaitu pulau Bangka dan Pulau Belitung.</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;<em>Kami dengan pak heru ( direktur RSJ Babel) dengan nawaitu betul-betul ingin tau dan ingin belajar bagaimana sesunguhnya pelayanan RSJ itu mampu berkerja dengan hati, saya yakin bahwa pekerjaan merawat mereka dengan gangguan jiwa ini merupakan &nbsp;pekerjaan sosial yang insya allah gajinya adalah sorga</em> &ldquo; ujar ketua rombongan dari Bangka Belitung ini. kunjungan dari rombongan DPRD Bangka Belitung ini, berakhir dengan melakukan kunjungan ke ruang rawat jalan dan rawat inap setelah itu tamu kemudian meninggalkan RSJ Mutiara Sukma (refo).</p>\r\n', '2016-04-21'),
(92, 'kunjungan anggota Komisi C DPRD Provinsi Kalimantan Tengah', '13', '<p style=\"text-align:justify\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/rsj%20kalawa%283%29.jpg\" style=\"float:left; height:151px; width:255px\" />Senin, 18 april 2016, Kemarin, Rumah Sakit Jiwa Mutiara Sukma, menerima kunjungan dari Kalimantan Tengah yaitu rombongan yang terdiri dari anggota Komisi C DPRD Provinsi Kalimantan Tengah, Biro Kesra, Bappeda serta pejabat struktural dari Rumah Sakit Jiwa Kalawa Atei, Kalimantan tengah. Rombongan yang berjumlah sekitar 24 orang ini langsung di sambut oleh direktur RSJ Mutiara Sukma dr. Elly Rosilla Wijaya SpKJ, MM di aula rumah sakit jiwa mutiara Sukma. Menurut informasi yang terima, tujuan rombongan tersebut datang ke RSJ Mutiara Sukma adalah untuk melakukan &ldquo;benchmarking&rdquo; atau kegiatan studi banding terhadap pelayanan kesehatan jiwa di Provinsi NTB khusus nya di Rumah sakit jiwa mutiara Sukma. Dalam sambutannya dr.Elly Rosilla Wijaya SpKJ, MM, menyampaikan ucapan selamat datang kepada rombongan dari Kalimantan tengah ini. Dihadapan tamunya, dr Elly lalu mempromosikan wisata pulau Lombok serta mengapreaseasi atas dipilihnya RSJ Mutiara Sukma sebagai tujuan &ldquo;benchmarking&rdquo;. Ia mengatakan bahwa kunjungan ini adalah suatu hal yang luar biasa dimana sekelompok SKPD yang terdiri dari Komisi C DPRD bersama lintas sektor melakukan &ldquo;benchmarking&rdquo; khusus untuk kesehatan jiwa.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ldquo;pertama saya mengucapkan selamat di Provinsi NTB pulau dengan seribu masjid, dengan segala kekayaan alamnya yang indah, maka saya menyarankan kepada ibu, bapak agar melihat keindahan Nusa Tenggara Barat khususnya pulau Lombok, ujar dr Elly. &ldquo;Hari ini sebenarnya kami sedang ada roadsohw rumpun kesra Provinsi NTB untuk melakukan sinergitas kegiatan atau program yang akan di lakukan tahun 2017. Namun, karena hari ini saya ada tamu, maka saya iijn kepada Bapak asisten III, untuk menerima tamu-tamu saya dari kalimantan tengah,ungkap dr Elly kemudian..</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">dr.Elly Rosilla Wijaya SpKJ, MM megatakan, walaupun sebelumnya sudah pernah kesini, namun pulau Lombok ini berbeda dari hari ke hari karena pembangan NTB begitu pesat, &ldquo; menurutnya, pembangunan di Provinsi NTB telah banyak perubahan sejak kepindahan beliau dari Provinsi jawa tengah, Tahun 2000 silam,</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ldquo;ketika saya datang tahun 2000 dulu, mataram masih sepi sekali, tapi sekarang betul- betul luar biasa, dan baru-baru ini kami baru saja mendapatkan penghargaan untuk wisata halal di tingkat dunia ujar dr Elly mempromosikan NTB. Di sini ibu bapak akan dimanjakan dengan pemandangan alam yang begitu indah, di sini ada wisata kerajinan yang luar biasa, di pulau lombok ini ada mutiara yang indah dan kami ambil namanya untuk nama Rumah Sakit Jiwa ini. Selain itu, Lombok terkenal juga dengan wisata kulinernya, dan yang paling terkenal adalah ayam taliwang, jadi saya harapkan dompet yg terbawa dari Kalimantan, jangan sampai masih terisi, kosongkan di sini, kalau perlu tambah dengan gesekan sehingga ada kenangan indah yang terbawa ke kalimantan, ujar dr elly lebih lanjut.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Setelah mempromosikan wisata NTB, ibu direktur RSJ Mutiara Sukma kemudian mempresentasikan perkembangan dan pelayanan di RSJ Mutiara Sukma, kepada para rombongan. Di akhir kegiatan salah seorang peserta dari rombongan Kalteng yaitu Bapak Ahmad Amur anggota DPRD dari fraksi PPP, kemudian menyampaikan apreaseasi atas sambutan yang diberikan oleh ibu direktur.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">&ldquo;dari apa yg ibu sampaian tadi saya sampai terkagum kagum karena kita melihat kondisi RSJ kita yang berada di kalimantan tengah sangat jauh, selama ini kesan saya bahwa RSJ itu penuh dengan jeruji, penuh dengan segala macam yang bersifat angkerlah gitu, jadi mohon setelah acara ini kami bisa diberikan sedikit ilmu agar kami bisa mengubah tampilan RSJ kami menjadi seperti RSJ Mutiara Sukma ungkap beliau anggota dewan ini</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Setelah bediskusi panjang lebar dan bebagi pengalaman, kegiatan &ldquo;benchmarking&rdquo; ini berakhir hingga pukul 12.30 wita. selanjutnya acara dilanjutkan dengan makan siang bersama serta keliling ke area Rumah Sakit jiwa Mutiara Sukma. Setelah pukul 13.00 Wita, rombongan dari Kalimantan Tengah ini, kemudian meninggalkan Rumah Sakit jiwa Mutiara Sukma.(arif rahman)</span></p>\r\n', '2016-04-19'),
(93, 'Rawat Jalan', '9', '<p style=\"text-align:center\"><span style=\"font-size:20px\"><span style=\"color:rgb(0, 0, 0)\"><strong>RAWAT JALAN</strong></span></span></p>\r\n\r\n<hr />\r\n<p><span style=\"font-size:18px\"><span style=\"color:rgb(0, 0, 0)\">Pelayanan Rawat Jalan yang tersedia</span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:18px\"><span style=\"color:rgb(0, 0, 0)\">Pemeriksaan dan Konseling gangguan jiwa ringan &ndash; berat (cemas, depresi, skizofrenia, autisme, anak hyperaktif, gangguan jiwa lansia dll)</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"color:rgb(0, 0, 0)\">Pemeriksaan, konseling dan tes psikologi (tes IQ, MMPI, minat bakat, tes pejabat publik, tes keperibadian dll)</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"color:rgb(0, 0, 0)\">Pemeriksaan, terapi dan rehabilitasi penyalahgunaan zat (Narkoba)</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"color:rgb(0, 0, 0)\">Pemeriksaan, konseling dan tes HIV/AIDS (Klinik VCT &ldquo;Bale Matahari)</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"color:rgb(0, 0, 0)\">Pelayanan pemeriksaan gigi dan mulut</span></span></li>\r\n</ol>\r\n', '2016-06-22'),
(94, 'Rawat Inap', '9', '<p style=\"text-align: center;\"><span style=\"font-size:20px\"><strong><span style=\"color:rgb(0, 0, 0)\">RAWAT INAP</span></strong></span></p>\r\n\r\n<hr />\r\n<p><span style=\"color:#000000\">Memberikan pelayanan Rawat Inap kepada pasien dengan fasilitas enam bangsal yang terdiri dari lima bangsal untuk pasien psikotik dan satu bangsal untuk korban penyalahgunaan Narkoba (One Stop Center &ldquo;Wisma Anggrek&rdquo;).</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pelayanan kelas yang ditawarkan:</span></p>\r\n\r\n<ol>\r\n	<li><span style=\"color:#000000\">Rawat inap kelas I (Flamboyan) dengan kapasitas 12 ruangan pasien</span></li>\r\n	<li><span style=\"color:#000000\">Rawat inap kelas II</span></li>\r\n	<li><span style=\"color:#000000\">Rawat inap kelas III</span></li>\r\n	<li><span style=\"color:#000000\">HCU (High Care Unit)</span></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:18.0pt\"><span style=\"color:#000000\">Kapasitas ruangan rawat inap kelas II dan Rawat inap kelas III rata-rata sebanyak 20 pasien.</span></p>\r\n', '2016-06-22'),
(95, 'Layanan Penunjang', '9', '<p style=\"text-align: center;\"><span style=\"color:#000000\"><span style=\"font-size:20px\"><strong>PELAYANAN PENUNJANG</strong></span></span></p>\r\n\r\n<hr />\r\n<p><span style=\"color:#000000\">Pemeriksaan dan konsultasi radiology (Rontgen)</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pelayanan elektromedik (EEG, EKG dll)</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pemeriksaan laboratorium rutin lengkap, Narkoba dan HIV/AIDS</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"color:#000000\">INSTALASI LABORATORIUM KLINIK</span></strong></p>\r\n\r\n<p><span style=\"color:#000000\">Melayani:</span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">Pemeriksaan darah urine, feses rutin</span></li>\r\n	<li><span style=\"color:#000000\">Pemeriksaan golongan darah</span></li>\r\n	<li><span style=\"color:#000000\">Kimia klinik</span></li>\r\n	<li><span style=\"color:#000000\">Parasit malaria</span></li>\r\n	<li><span style=\"color:#000000\">Widal slide</span></li>\r\n	<li><span style=\"color:#000000\">Gula darah dll.</span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"color:#000000\">INSTALASI FARMASI</span></strong></p>\r\n\r\n<p><span style=\"color:#000000\">Melayani obat-obatan untuk pasien jiwa dan obat-obatan psikotropika sesuai dengan resep dokter.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"color:#000000\">FISIOTERAPI</span></strong></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">EEG</span></li>\r\n	<li><span style=\"color:#000000\">EKG</span></li>\r\n	<li><span style=\"color:#000000\">TERAPI LATIHAN</span></li>\r\n	<li><span style=\"color:#000000\">INFRA MERAH</span></li>\r\n	<li><span style=\"color:#000000\">STIMULASI LISTRIK</span></li>\r\n	<li><span style=\"color:#000000\">FARADISASI</span></li>\r\n	<li><span style=\"color:#000000\">TREADMILL</span></li>\r\n	<li><span style=\"color:#000000\">STATIC BICYCLE</span></li>\r\n	<li><span style=\"color:#000000\">BRAIN MAPPING</span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"color:#000000\">KONSELING PSIKOLOGI</span></strong></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">Tes IQ</span></li>\r\n	<li><span style=\"color:#000000\">MMPI</span></li>\r\n	<li><span style=\"color:#000000\">Minat Bakat</span></li>\r\n	<li><span style=\"color:#000000\">Tes Pejabat Publik</span></li>\r\n	<li><span style=\"color:#000000\">Tes Kepribadian</span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"color:#000000\">REHABILITASI MEDIK</span></strong></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">Terapi kelompok</span></li>\r\n	<li><span style=\"color:#000000\">Terapi keluarga</span></li>\r\n	<li><span style=\"color:#000000\">Terapi kerja</span></li>\r\n	<li><span style=\"color:#000000\">Terapi gerak</span></li>\r\n	<li><span style=\"color:#000000\">Terapi relaksasi</span></li>\r\n	<li><span style=\"color:#000000\">Terapi prilaku</span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"color:#000000\">INSTALASI GAWAT DARURAT</span></strong></p>\r\n\r\n<p><span style=\"color:#000000\">Buka 24 jam terutama pelayanan gawat darurat psikiatrik.</span></p>\r\n', '2016-06-22'),
(96, 'Realisasi Anggaran APBD RSJ MS Tahun 2015', '10', '<p><img alt=\"\" src=\"/admin/images/berita/images/realisasi%20anggaran%20apbd%202015.jpg\" style=\"height:778px; width:880px\" /></p>\r\n', '2016-06-27'),
