(98, 'Rekrutmen Tenaga Non PNS 2016', '20', '<p><span style=\"color:#000000\">Dibutuhkan 2 Orang Tenaga IT (1 pria dan 1 wanita) untuk ditempatkan di RSJ Mutiara Sukma dengan persyaratan sebagai berikut:</span></p>\r\n\r\n<p><span style=\"color:#000000\">1. Pendidikan SMK jurusan Komputer</span></p>\r\n\r\n<p><span style=\"color:#000000\">2. Bisa mengoperasikan komputer (minimal Office)</span></p>\r\n\r\n<p><span style=\"color:#000000\">3. Untuk Pelamar laki-laki diutamakan yang memiliki kemampuan hardware dan jaringan</span></p>\r\n\r\n<p><span style=\"color:#000000\">4. Umur maksimal 30 tahun.</span></p>\r\n\r\n<p><span style=\"color:#000000\">5. Melngkapi dokumen persyaratan :</span></p>\r\n\r\n<p><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; a. Surat lamaran bermaterai ditujukan kepada Direktur RSJ Mutiara Sukma.</span></p>\r\n\r\n<p><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; b. FC Ijasah SMK yang sudah dilegalisir</span></p>\r\n\r\n<p><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; c. FC KTP / SIM</span></p>\r\n\r\n<p><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; d. Pas Photo warna 3x4 sebanyak 2 Lembar</span></p>\r\n\r\n<p><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; e. SKCK (Surat Keterangan Catatan Kepolisian)</span></p>\r\n\r\n<p><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; f.&nbsp; Surat keterangan sehat.</span></p>\r\n\r\n<p><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; g. Surat rekomendasi dari tempat bekerja sebaelumnya (Jika ada)</span></p>\r\n\r\n<p><span style=\"color:#000000\">&nbsp;&nbsp;&nbsp; h. Sertifikat yang berkaitan dengan IT jika ada.</span></p>\r\n\r\n<p><span style=\"color:#000000\">6. Dokumen persyaratan diantar langsung ke RSJ Mutiara Sukma paling lambat tanggal 16 Juli 2016.</span></p>\r\n\r\n<p><span style=\"color:#000000\">7. Seleksi akan dilaksanakan tanggal 21 Juli 2016.</span></p>\r\n', '2016-06-27'),
(103, 'MENGENAL VIRUS ZIKA SEBAGAI UPAYA RSJ MUTIARA SUKMA MENGHADAPI KASUS VIRUS ZIKA', '13', '<p style=\"text-align:justify\"><span style=\"color:#000000\">Memasuki musim penghujan, kita musti waspada dengan munculnya kejadian penyakit Demam Berdarah serta penyakit- penyakit lainnya yang di sebabkan oleh gigitan nyamuk Aedes aegypti.&nbsp;berdasarkan berbagai literatur terdapat beberapa penayakit akibat gigitan nyamuk tersebut antara lain Virus Zika, chikungunya dan demam berdarah dengue . Untuk kasus infeksi virus Zika,&nbsp;Belakangan ini,&nbsp;tengah hangat-hangatnya dibicarakan diberbagai media, dampak dari virus ini&nbsp; cukup memperihatinkan bagi kesehatan, sehingga, WHO atau Organisasi Kesehatan Dunia&nbsp;membuat satgas khusus untuk serangan virus ini. apa itu virus zika ? berikut akan dipaparkan apa itu virus zika yang kami kutip atau lebih tepatnya saya copas dari http://bidanku.com/mengenal-virus-zika-penyebab-gejala-dan-pencegahannya.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Apa Itu Penyakit Zika?</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Belakangan ini penyakit Zika begitu marak dibicarakan dan begitu booming diberbagai pemberitaan. Nyamuk Aedes disebut-sebut sebagai salah satu penyebab virus ini bisa menyebar antara satu penderita ke penderita lainnya.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Sebagaimana dikutip dari Wikipedia, menjelaskan bahwa virus Zika adalah sejenis virus yang berasal dari family flaviviridae dan genus flavivirus yang mana, dua jenis virus ini berasa dari nyamuk jenis Aedes.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Virus Zika yang telah menginfeksi manusia akan dapat menimbulkan beberapa gangguan pada tubuhnya. Beberapa gangguan yang mungkin dinampakan diantaranya adalah demam, mata merah (konjungtivitis), nyeri dibagian persendian dan juga ruam dibagian kulit.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Jika dilihat sekilas, dampak dari virus Zika, cenderung lebih mirip dengan penyakit dengue dan chikungunga, serta masa berlangsungnya bisa terjadi dalam beberapa hari bahkan satu minggu.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Nah, kondisi inilah yang pada umumnya akan membuat si penderita yang terinfeksi virus Zika mengalami kondisi yang cukup mengkhawatirkan. Betapa tidak, beberapa dampak atau resiko yang dirasakan seperti halnya demam, nyeri sendi dan resiko lain, akan tentu saja membuat si penderita tidak mampu menjalankan aktivitasnya sehari-hari.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Terutama, bila terjadi pada anak-anak, kondisi seperti ini tentu saja akan membuat setiap orangtua merasa khawatir dan terus-terusan dihantui dengan perasaan yang tidak tenang akan kesehatan si buah hatinya. Untuk itulah, mewaspadai segala macam ancaman penyakit adalah perioritas paling penting dalam menjaga agar tubuh tetap sehat.</span></p>\r\n\r\n<h2 style=\"text-align:justify\"><span style=\"color:#000000\">Penyebaran Virus Zika</span></h2>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Virus Zika awalnya diketahui pada tahun 1947, untuk pertama kali virus jenis ini ditemukan pada seekor monyet rhesus di hutan Zika. Virus ini kemudian ditemukan kembali pada nyamuk spesies Aedes Africanus di tempat yang sama yakni di hutan Zika pada tahun 1948. Sementara pada manusia, virus ini diketahui menjangkiti seorang warga di daratan Nigeria pada tahun 1954.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Virus jenis ini, kemudian menjadi penyakit endemis dan mulai menyebar ke luar Afrika dan Asia pada tahun 2007 kemarin di wilayah Pasifik Selatan. Virus Zika kemudian kembali merebak ke permukaan dan menjadi ke khawatiran paling besar di dunia kesehatan tatkala belakangan ini, mulai ditemukan pada beberapa penderita yang menyerang masyarakat Brazil.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Adapun penyebaran virus ini mulai terjadi pada bulan Januari di tahun 2016 kemarin. Penyebaran ini mulai merebak ke Amerika Utara, Karibia, Amerika Selatan, Afrika dan Samoa (Ocenia). Sementara di tanah air sendiri, virus ini sudah ditemukan pada tahun 2015 lalu di Jambi.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Sementara untuk penyebaran di Samudra Pasifik sendiri, pada tahun 2014 virus ini menyebar ke wilayah timur melintasi Samudra Pasifik hingga ke bagian Polinesia Perancis, kemudian masuk ke Pulau Paskah di tahun 2015.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Pada awal tahun 2016 kemarin, Pusat Kontrol dan Pencegahan Penyakit (CDC) Amerika Serikat sampai mengeluarkan panduan perjalanan untuk negara-negara terjangkit wabah ini, termasuk mengeluarkan pandua pencegahan yang dipertingkatkan dan pertimbangan untuk menunda kehamilan bagi seorang wanita. Hal serupa pun bahkan dilakukan oleh beberapa negara latin seperti Ekuador, Kolumbia dan daerah sekitarnya yang memberikan himbauan untuk masyarakat wanitanya agar menunda kehamilan sampai resiko tentang virus tersebut bisa diketahui cara penangannnya.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Melihat reaksi yang begitu besar terhadap penyakit ini, maka sudah semestinya kita turut serta dalam menjaga dan menggalangkan hidup sehat. Agar demikian, segala ancaman sakit dan resiko dari serangan virus akan dapat diminimalisir.</span></p>\r\n\r\n<h2 style=\"text-align:justify\"><span style=\"color:#000000\">Penyebab Virus Zika</span></h2>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Penyebab peyakit Zika (Zika disease) ataupun demam Zika (Zika fever) pada dasarnya adalah virus Zika itu sendiri. Virus jenis ini akan dapat disebarkan kepada manusia oleh nyamuk berspesies Aedes yang terinfeksi dengan jenis virus serupa. Nyamuk ini akan menjadi terinfeksi setelah si nyamuk mengigit penderita yang menderita atau telah terinfeksi dengan virus yang sama.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Pada konsepnya, setelah si nyamuk menggit si penderita, maka ia akan bisa sangat aktif di siang hari dan hidup serta berkembang biak di dalam ataupun di luar ruangan yang jaraknya dekat dengan manusia. Sama halnya dengan penyebaran virus lain, nyamuk yang terinfeksi virus Zika lebih cenderung menempati daerah-daerah atau tempat-tempat yang terdapat genangan air dan bersuhu lembab.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Meskipun kasus ini jarang terjadi, akan tetapi rupanya bahaya virus ini bisa berdampak besar untuk si penderita, terutama wanita yang sedang hamil. Pada kasus tertentu, virus Zika dapat ditransmisikan dari seorang ibu ke bayi dalam kandungannya.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">Dengan demikian, virus ini akan berkemungkinan dapat ditularkan dari si ibu hamil kepada janin yang dikandungnya. Bukan hanya itu, resiko lain yang juga bisa menyerang si bayi bila tidak terjadi dalam kandungan adalah virus yang satu ini dapat ditularkan pada saat proses persalinan. Dengan kata lain, kemungkinan lain yang juga bisa terjadi adalah ketika persalinan seorang ibu hamil yang terinfeksi virus yang satu ini akan berkemungkinan menularkan virusnya terhadap bayi yang baru dilahirkannya.( Arif Rahman)</span></p>\r\n\r\n<div style=\"border: medium; border-image: none; text-align: justify; color: rgb(0, 0, 0); overflow: hidden; text-decoration: none; background-color: rgb(255, 255, 255);\"><br />\r\n<span style=\"color:#000000\">Sumber : </span><a href=\"http://bidanku.com/mengenal-virus-zika-penyebab-gejala-dan-pencegahannya#ixzz4D27YjUAJ\"><span style=\"color:#000000\">Mengenal Virus Zika, Penyebab, Gejala dan Pencegahannya - Bidanku.com</span></a><span style=\"color:#000000\"> </span><a href=\"http://bidanku.com/mengenal-virus-zika-penyebab-gejala-dan-pencegahannya#ixzz4D27YjUAJ\"><span style=\"color:#000000\">http://bidanku.com/mengenal-virus-zika-penyebab-gejala-dan-pencegahannya#ixzz4D27YjUAJ</span></a></div>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<div style=\"border: medium; border-image: none; text-align: justify; color: rgb(0, 0, 0); overflow: hidden; text-decoration: none; background-color: rgb(255, 255, 255);\">&nbsp;</div>\r\n', '2016-06-30'),
