(113, 'SAMBUTAN PAK GUBERNUR NTB DALAM SURVEI AKREDITASI KARS DI RSJMS', '11', '<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><img alt=\"\" src=\"/admin/images/berita/images/IMG_2129uu.jpg\" style=\"float:left; height:245px; width:399px\" />Selasa 6 September 2016, penilaian akreditasi paripurna versi 2012 resmi dilaksanakan di RSJ&nbsp; Mutiara Sukma Provinsi NTB. kegiatan yang di jadwalkan selama 3 hari ini pertama kali dilaksanakan di Provinsi NTB. Hadir dalam acara pembukaan&nbsp; adalah Gubernur provinsi NTB,&nbsp; Dr. TGH, Zainul majdi, MA, yang sekaligus membuka kegiatan ini. Dalam sambutannya pertama kali Bapak Gubernur, menyampaikan selamat datang kepada tim penilai atau surveyor akreditasi dari KARS yaitu bapak dr. Muhammad Aminullah Moeloek, Sp.KJ. dr. Dyah Wiryastini, MARS serta Gandauli Panggabean, SKM, MARS. Bapak gubernur menyampaikan dan berharap kepada tim survey untuk dapat melihat Rumah Sakit Jiwa Mutiara Sukma dan memberikan &nbsp;penilaian yang objektif. <em>Tentu saya berharap Bapak ibu surveyor &nbsp;bisa melihat rumah sakit kam , dan mudah mudahan nati tentu berdasarkan&nbsp; penilaian yang objektif dapat memberikan &nbsp;akreditasi yang paripurna mudah mudahan ya,</em> ujar Bapak Gubernur&nbsp; berharap, yang disambut tepuk tengan meriah dari para hadirin, </span><span style=\"color:rgb(0, 0, 0)\">selajutnya Bapak Gubernur NTB,&nbsp; Dr. TGH, Zainul majdi, MA kemudian melajutkan sambutannya. Berikut kata sambutan beliau yang dapat kami himpun: <em>Bapak- ibu sekedar mengingatkan kepada kita semua bahwa sentrum ikhtiar dari&nbsp; pembangunan itu adalah ada pada manusia dalam arti mengihktiarkan secara maksimal,&nbsp; agar manusia yang menghuni republik ini sehat lahir dan bathin , badannya sehat, jiwa sehat, mentalnya juga sehat, maka RSJ Mutira Sukma selain tentu pentinng untuk pemerintah Provinsi NTB sebagai salah saat proline atau perangkat di baris depan untuk memberikan pelayanana publik terkait dengan tupoksiya, tentu juga yang lebih penting adalah karena RSJ berada dalam konteks menwujudkan ihktiar, manusia NTB yang sehat lahir dan batin, dan tidak perlu saya mengutip apa yang di sampaikan oleh ibu direktur &nbsp;RSJ, bahwa trend kunjungan dari penderita gagguan jiwa di NTB menurut beliau meningkat, dari waktu ke waktu tertutama di saat moment politik tertentu, banyak yang kurang sehat, situasi tertentu, situasi ekonomi tertentu, hal ini akan berimbas ke kekondisi kesehatan jiwa masyarakat, nah tentu bapak-ibu, Rumah Sakit Jiwa Mutiara sukma ini tidak bisa berdiri sendiri, dalam setiap pertemuan saya sering mengingatkan kepada ibu direktur atau pada saat beliau memberikan laporan agar RSJ, &nbsp;memperbanyak perjumpaan dengan masyarakat dan turun ke masyarakat, menggandeng pemangku amanah pembangunan yang lain, kaum perempuan terutama, kelompok yang memilki pengaruh, baik formal maupun informal, di tengah masyarat agar kesehatan&nbsp; jiwa ini menjadi perhaian kita semua, saya dan kita semua melihat ,&nbsp; bahwa orang yang mempunyai masalah kejiwaan apalagi yang akut, itu bisa melakukan tindakan yang sulit kita nalar, Tidak terduga destruktif, bukan hanya akan berkaitan untuk pribadinya, tapi juga orang lain. maka tentu semakin banyak orang- orang yang memilki gangguan jiwa di masyarakat itu potensial atau berbanding lurus dengan masalah- masalah sosial. yang terjadi di masyarakat tersebut, maka, untuk itulah saya berharap Rumah Sakit Jiwa Mutiara sukma ini, bisa memberikan pelayanan yang terbaik sehingga setelah keluar dari sini mudah-mudahan sehat jiwanya, tidak bolak balik keluar masuk ya. &nbsp;saya bersyukur tadi bapak ibu ya, bagaimana para karyawan, dari Rumah Sakit Jiwa Mutiara sukma ini &nbsp;mempunyai suara yang bagus , paduan suara nya, yang bagus ( di sambut tepuk tangan ) Nah, itu bagian dari terapi juga bapak ibu ya, kalo saya ambil analognya, kalo dulu saya sebagai seorang muslim misalnya, saya membaca sejarah dari dakwah&nbsp; Nabi besar kita Muhammad Saw, bahwa salah satu, awal- awal yang beliau lakukan di madinah, adalah memillih tukang adzan yang paling bagus suaranya, maka ada namanya sahabat bilal bin abi rabah, apa argumentasi Rasulullah, saat itu,&nbsp; beliau mengatakan suara yang bagus itu bisa menggugah dan menyehatkan hati,k alo karyawan nya sudah bagus- bagus suaranya, jadikan itu bagian dari terapi juga ya..bagian &nbsp;dari suara yang bagus, menenangkan, sehingga tercipta suasana yang kondusif di rumah sakit jiwa ini, dan bisa lebih cepat dari proses terapi atau rehabilitasi, maka pada kesempatan ini, sekali lagi &nbsp;saya menyampaikan selamat kepada &nbsp;Rumah Sakit Jiwa Mutiara Sukma, saya diberitahu oleh ibu direktur bahwa ini adalah akreditasi paripurna yang pertama, ya ibu ya,&nbsp; bahkan RSU belum ya.. bagi saya proses akreditasi ini tidak hanya pengakuan formal dari alat Negara terhadap kualitas dari&nbsp; pelayanan rumah sakit, tapi juga menurut saya yang paling substansial dalah bahwa dengan akreditasi ini menunjukan semangat pelayanan yang insya allah lebih baik lagi di rumah sakit kita, dan itulah esensi yang di harapakan oleh masyarakat, institusi yang infrastrukrturnya yang semakin baik , sumberdaya manusia nya semakin cerdas dan legkap,&nbsp; diharapkan bisa memberikan pelayanan yang lebih sempurna dan manusiawi kepada seluruh masyarakat, terimakasih dan selamat untuk RSJ Mutiara Sukma semoga semua ikhtiar yang dilakukan ini membawa kebaikan, untuk masyarakat NTB.&nbsp; Satu hal lagi tadi saya seumur-umur jadi Gubernur, 8 tahun ini belum pernah&nbsp; melihat ada safety brefing seperti tadi, tolong nanti dipertemuan-pertemuan yang penting harus ada safety breafing yaa.., supaya kita tau bapak-ibu kalo ada kejadian yang tidak kita harapkan&hellip;..nudzubilah minjalik.. ,&nbsp; seperti itu tadi,&nbsp; supaya kita tau bersikap , lari lewat mana, kemudian bagaimana proses evakuasi dst, saya pikir itu penting betul ya. Terutama pada pertemuan-pertemuan di hotel misalnya, melibatkan banyak orang,&nbsp; apalagi aksesnya terbatas, itu menurut saya harus kita tradisikan di NTB.&nbsp; terima kasih bu, Rumah Sakit Jiwa Mutiara sukma sudah jadi model ini &nbsp;ujar Bapak Gubernur di sambut tepuk tangan para hadirin, Demikian, wabillahi taufik wal hidayah wasalammu alaikum warahmatullahi wabarakatuh. &nbsp;ujar beliau &nbsp;menutup Kata sambutannya. (arif rahman)</em></span></p>\r\n', '2016-09-08'),
(116, 'IBU KAPOLDA NTB: ODGJ, bukan orang yang harus di jauhi tetapi harus kita perhatikan', '11', '<div>\r\n<div class=\"_1mf _1mj\" style=\"text-align: justify;\">\r\n<p><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0)\"><img alt=\"\" src=\"/admin/images/berita/images/Q.JPG\" style=\"float:left; height:229px; width:321px\" />Hari ini, SENIN, 20-9 -2016. Rumah Sakit Jiwa Mutiara Sukma Provinsi NTB mendapat kunjungan dari puluhan pengurus yayasan kemala Bhayangkari Provinsi NTB. Rombongan yang di ketuai oleh ibu kapolda Ny Hj. Anna Umar septono, tiba di Rumah Sakit Jiwa Mutiara Sukma sekitar pukul 08.00 Wita, dan di sambut langsung oleh Direktur Rumah Sakit Jiwa Mutiara Sukma, ibu dr. Hj.Elly Rosila Wijaya,SpKj.,MM, di aula utama gedung RSJ Mutiara Sukma. Dalam sambutannya ibu kapolda menyampaikan bahwa tujuan dari rombongan ibu-ibu bhayangkari ke RSJ adalah dalam rangka kegiatan anjangsana peduli kasih, dari kesatuan gerak bhayangkari ke 64, serta untuk memberikan perhatian, yang lebih dekat dan rasa empati kepada ODGJ atau orang dengan gangguan jiwa.<em>&rdquo;Ibu elly dan hadirin yang kami hormati, sebenarnya sudah lama kami merencanakan untuk berkunjung ke Rumah Sakit Jiwa Mutiara Sukma, namun karena adanya</em></span></span><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0)\"><em>berbagai kegiatan maka terpaksa kami tunda, dan Alhamdulillah hari ini, niat kami tersebut dapat kami wujudkan&ldquo; </em>ujar ibu kapolda NTB membuka sambutannya.</span></span><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0)\">Lebihlanjut, ibu kapolda yang juga ketua pengurus yayasan kemala Bhayangkari Provinsi NTB ini menyampaikan bahwa ODGJ (orang dengan gangguan jiwa) bukanlah orang yang harus dijauhi tetapi harus kita perhatikan, serta harus kita berikan rasa kasih sayang. </span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n<span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0)\">&ldquo; s<em>audara-saudara kita yang dirawat di RSJ, mereka bukan orang yang harus di jauhi tetapi harus kita perhatikan, mari kita berikan rasa kasih sayang kita kepada mereka, agar proses penyebuhan dan pemulihan mereka lebih cepat, dan mereka dapat beraktivitas kembali seperti sediakala&rdquo; </em>ungkap beliau. Selanjutnya, ibu kapolda menghimbau kepada seluruh pengurus yayasan kemala Bhayangkari Provinsi NTB agar tidak sungkan mengingatkan kepada masyarakat terutama kepada keluarga ODGJ dan lingkungannya untuk tidak menjauhi penderita gangguan jiwa atau ODGJ. &ldquo; <em>Bagi ibu - ibu bhayangkari yang ada di sini perlu juga di ketahui, apabila ada di antarakita yang mempunyai permasalahan dengan kejiwaan, atau mengetahui ada masyarakat, tetangganya atau keluarganya yang mengalami permasalahan dengan kejiwaaan maka saya himbau kepada kita semua, mari kita ingatkan keluarga tersebut, untuk tidak menjauhi atau, bersikap keras terhadap mereka, bahwa orang yang mengalami masalah dengan kejiwaan dapat di sembuhkan dengan cara kita memberikan limpahan kasih sayang dan perhatian, seperti yang kita lihat di RSJ Mutiara Sukma ini.</em> Ujar Ny Hj. Anna Umar septono, ketua pengurus yayasan kemala Bhayangkari Provinsi NTB menutup kata sambutannya. selanjutnya,dari tuan Rumah, ibu dr. Hj. Elly Rosilla Wijaya., SpKj.,MM, selaku Direktur Rumah Sakit Jiwa Mutiara Sukma menyampaikan selamat datang kepada rombongan pengurus yayasan kemala Bhayangkari Provinsi NTB. &quot;<em>Ibu - ibu sekalian, pertama &ndash; tama, tidak ada kata yang bisa saya ucapkan selain ucapan terimakasih atas perhatian ibu-ibu kepada Rumah Sakit Jiwa Mutiara Sukma Provinsi NTB, khususnya kepada ODGJ yang sedang di rawat di RSJ, selanjutnya, selamat datang di Rumah Sakit Jiwa Mutiara Sukma Provinsi NTB dambaan masyarakat. </em>Ujar ibu dokter Elly menyambut kedatangan rombongan dari kapolda ini. Lebih lanjut, Ibu direktur menjelaskan bahwa kata Rumah Sakit Jiwa Mutiara Sukma, dambaan masyarakat merupakan visi dari Rumah Sakit Jiwa Mutiara Sukma, dimana maksudnya kata bu elly adalah seluruh civitas RSJ Mutiara Sukma akan mengimplementasikan apa yang menjadi dambaan masyarakat NTB yaitu memiliki RSJ yang bersahabat, yang welcome, yang ramah, serta memberikan pelayanan yang menyenangkan kepada masyarakat NTB, sehingga, ketika mereka datang kesini bukan karena mereka terpaksa, tapi karena mereka betul betul membutuhkan suatu unit pelayanan yang penting untuk kesehatan mereka terutama kesehatan jiwa. Setelah acara penyambutan, rombongan dari polda NTB ini, selanjutnya berkesempatan untuk melihat langsung pelayanan kesehatan jiwa di ruang rawat inap RSJ Mutiara Sukma, sekaligus mengunjungi pusat Rehabilitasi mental RSJ Mutiara Sukma. Di akhir kunjungan, tim liputan mencoba menanyakan kesan dari rombongan ini, secara acak tim liputan langsung menanyakan bagaimana kesannya terhadap RSJ Mutiara Sukma, ibu yang di tanya menyatakan sangat terkesan dengan pelayanan yang di berikan oleh petugas RSJ Mutiara Sukma, &ldquo; <em>kesan saya RSJ MutiaraSukma sudah cukup luar biasa, bersih ya!, apalagi nanti kalo semua bangunan nya sudah jadi, akan sangat luar biasa,dan saya yakin pasiennya akan tambah senang lagi berobat ke RSJ Mutiara Sukma, maju terus RSJ Mutiara Sukma.</em> ujar beliau, yang di akhir wawancara ternyata beliau adalah ibu serly, wakil ketua pengurus yayasan kemala Bhayangkari Provinsi NTB. (arif rahman)</span></span></div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"_1mf _1mj\" style=\"text-align: justify;\">&nbsp;</div>\r\n</div>\r\n', '2016-09-19'),
(117, 'AKSI LEPAS PASUNG', '11', '<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Hari ini, Rabu, 28 Septemb</span><span style=\"color:rgb(0, 0, 0)\"><img alt=\"\" src=\"/admin/images/berita/images/1.jpg\" style=\"float:left; height:206px; width:279px\" /></span><span style=\"color:rgb(0, 0, 0)\">er 2016, bertempat di desa teruai kecamatan pujut Lombok tengah, gabungan tim dari RSJ Mutiara Sukma, ibu-ibu bhayangkara, FKPPI serta tim dari Dinas Kesehatan Provinsi NTB, secara bersama sama melakukan aksi sosial yaitu melepas penderita gangguan jiwa yang mengalami pemasungan. Pukul 13.00 Wita, Gabungan Tim ini langsung menuju ke lokasi, desa teruai kecamatan pujut dengan di pimpin langsung oleh ibu Anna Umar Septono selaku ketua yayasan kemala Bhayangkari NTB serta ibu dr. Elly Rosila Wijaya, SpKj., MM, direktur RSJ Mutiara Sukma. Menurut dr Elly. Kegiatan ini merupakan rangkaian kegiatan hari kesehatan jiwa sedunia 2016 yang jatuh pada tanggal 10 oktober nanti. Adapun salah satu kegiatannya adalah melakukan pelayanan lansung pada masyarakat, khususnya untuk fokus terhadap penuntasan NTB bebas pasung 2018 sedangkan bagi yayasan kemala Bhayangkara kegiatan ini merupakan rangkaian aksi peduli dalam rangka HKGB ke 64 atau hari kesatuan gerak bhayangkari yang ke 64. &ldquo; <em>alhamdulillah, atensi masyarakat&nbsp; atensi ibu- ibu bayangakari, FKPPI juga, Dinas Kesehatan rovinsi NTB, Dikes kabupaten loteng, semua sangat perhatian, karena kita sudah kerja sama dengan polda, dengan FKPPI dengan karang karuna, untuk penuntasan pasung. ya mudah mudahan 2018, kita tuntas, </em>&ldquo; ujar dokter elly. &nbsp;</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Tiba di desa teruai, rombongan langsung menuju ke rumah penderita yang jaraknya sekitar 1 KM dari Puskesmas teruai. Di dusun tempat penderita, sudah berkumpul warga sekitar yang ingin melihat aksi sosial bebas pasung ini. &ldquo; <em>kami sangat berterima kasih dan bersyukur, kayak apa, gitu, kayak rembulan jatuh </em>ujar seorang keluarga penderita sambil menunjuk ke atas langit. &ldquo;<em>artinyakan gini bu</em>, <em>upaya kami untuk, merawat saudara kami ini, jadinya ada sedikit harapan gitu bu ! ujarnya kemudian . menurut penuturan keluarga. Penderita. </em>Sebut saja <em>Ambu</em> adalah anak pertama dari 4 bersaudara, ambu dulunya adalah seorang peternak dan penggembala sapi. Namun, pada tahun 1993 beberapa bulan setelah menikah tingkah laku ambu terlihat aneh, ia terlihat suka bicara sendiri dan ngelantur. Oleh keluarga ambu di bawa berobat ke Rumah Sakit Jiwa Mataram. Namun, begitu pulang ke rumah beberapa minggu kemudian Ambu kumat kembali. Kondisi ambu yang kumat kumatan mengakibatkan keluarga jenuh apalagi setelah di tinggal meniggal oleh bapaknya. &ldquo;<em>Saudara kami ini, sekitar tahun 1993 awalanya bicara nya ngelantur, terus kita bawa ke rsj saat itu , keluar masuk udah berkali kali, ke selebung juga sudah, tapi ndak sembuh sembuh, &nbsp;hingga yang terakhir 5 bulan yang lalu, ia kami masukan di sini &nbsp;</em>ujar adiknya si ambu<em> sambil menunjuk kerangkeng tempat ambu di pasung. Kami sudah ndak mampu, lagi, jadi alasan kelurga kami mengurung ambu karena ibu saya sudah tua, bapak kami sudah meninggal, </em>, jadi ibu saya bisa mengawasi kakak saya kalo begini, lebih baik beginikan?? tegasnya kemudian. Lebih lanjut. berdasarkan penuturan orang tua penderita, perilaku penderita, sudah mengkhawatirkan masyarakat sebab ambu mempunyai kebiasaan suka membakar sampah dan baju atau cucian yang di&nbsp; jemur. Hal ini juga menjadikan penguat dari keputusan keluarga untuk memasung penderita. &ldquo; <em>Sudah berapa rumah yang dibakar pak ambu?</em> Tanya bu kapolda kepada keluarga. &ldquo; keluarga menjawab &ldquo; <em>selama ini , kalo rumah tempat tinggal orang belum ada, namun rumah- rumah kecil dan kadang ayam itu yang di bakarnya, di tambah &nbsp;baju baju atau jemuran dan juga saya kasian sama ibu yang sudah tua karen tidak punya kemampuan untuk bolak balik karena jarak dengan RSJ sangat jauh</em>. Ujar saudara ambu menjawab pertanyaan ibu kapolda. Selanjutnya, ibu dari penderita, ibu kandungnya ambu juga memiliki harapan yang tinggi terhadap kunjungan atau kegiatan lepas pasung ini, ia mengatakan ingin melihat anaknya bisa kembali seperti dulu. &ldquo; <em>saya kira dulu dia sudah&nbsp; membaik, setelah dari RSJ, saat di telpon untuk minta di jemput, saya kira di sudah normal, eee kenyaataannya seperti ini, &nbsp;saya berharap dia ini kembali normal seperti dulu, bisa ndak dia normal kembali supaya ia bisa kembali mengembala sapi lagi </em>ujar orang tuanya penuh harap.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">mendengar penuturan tersebut dr. Elly Rosila Wijaya, selaku direktur RSJ Mutiara Sukma menjelaskan bahwa penderita insya allah dapat sembuh asal minum obatnya teratur &ldquo; <em>kalo minum obat &nbsp;teratur insya allah, kalo ndak minum obat lagi , ya bisa kumat lagi, jadi nanti harus rajin ke puskesmas, ya</em>?&rdquo; Tutur dr elly.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Setelah berhasil bernegosiasi dengan keluarga dan membuka pintu kerangkeng yang mengurung ambu, ibu kapolda yang di temui oleh tim liputan mengatakan sangat trenyuh, sedih, sekaligus bersyukur dapat melepas dan membawa penderita untuk berobat ke RSJ. &ldquo;<em>alhamdulillah, mudah mudah kita bisa lagi melepas lagi, kita lakukan lagi ..semoga bisa kita lepas semua dan membebaskan kasus pasung di NTB</em>.&rdquo; &nbsp;Ujar ibu Anna umar Septono ketua Yayasan Kemala Bhayangkari NTB. &nbsp;Begitu juga ibu &ndash; ibu bahyangkari lainnya, di temui oleh tim liputan ibu &ndash; ibu ini memiliki kesan yang baik terhadap kegiatan ini. &ldquo; <em>kesan kami dari bhayangkari sangat antusias melakukan kegiatan melepas pasung, karena kami tertarik dengan kegiatan yang bersifat sosial, kami trenyuh, apalagi lokasi rumahnya di dalam kampung yang jauh dengan rsj, kami bersyukur, dengan adanya kegiatan sosial seperti ini dan saya mewakili teman-teman menyampaikan ucapan terima kasih kepada pihak rsj yang sudah melibatkan kami, terutama dr elly dan staf, semoga kegiatan seperti ini bisa kita lanjutkan, dan kami berharap semoga pasien yang di lepas dan di bawa ke rsj tadi dapat cepat sembuh, dan kembali dapat beraktivitas lagi</em>.&rdquo;&nbsp; Ujar ibu ratna purnama, anggota yayasan kemala bhyangkara bidang bantuan sosial. ( Arif Rahman)</span></p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n', '2016-09-28'),
(118, 'SIARAN PERS: Martabat Dalam Kesehatan Jiwa-pertolongan pertama psikologis dan kesehatan jiwa untuk semua,', '11', '<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><img alt=\"\" src=\"/admin/images/berita/images/12%281%29.jpg\" style=\"float:left; height:145px; width:213px\" />Dalam rangka memperingati Hari Kesehatan Jiwa se dunia, Hari ini, 10 Oktober 2016, Direktur RSJ Mutiara Sukma Provinsi NTB, dr Elly Rosila Wijaya, SpKJ,. MM. berserta jajaran direksi RSJ Mutiara Sukma, mengadakan&nbsp; siaran pers di kantor media center Pemerintah Daerah Provinsi NTB. Kegiatan siaran pers ini merupakan salah satu kegiatan atau rangkaian kegiatan hari kesehatan jiwa yang dilaksanakan oleh Civitas Hospitalia RSJ Mutiara Sukma. Berdasarkan keterangan dari ketua panitia HKJS RSJ Mutiara Sukma. Dr. Danang &nbsp;Nur Adibawa, SpKJ, hari ini terdapat tiga acara yang dilakukan secara bersamaan yaitu, aksi kemanusiaan donoh darah dan aksi gelar simpatik yang masing masing di laksanakan di gedung RSJ Mutiara Sukma serta siaran pers yang dilaksanakan di kantor media center. &nbsp;&ldquo; <em>Untuk hari ini ada 3 kegiatan yang kami laksanakan yaitu, aksi kemanusiaan donoh darah dan aksi gelar simpatik serta siaran pers, namun, rangkaian&nbsp; kegiatan HKJS ini sebenarnya sudah kami mulai sejak tanggal 27 september yang lalu dengan melakukan pelayanan langsung kesehatan jiwa ke masyarakat, ujar dr danang. tim kami sudah melakukan pelayanan kesehatan jiwa&nbsp; ke pulau Sumbawa dan besok hingga nanti sampai tanggal 30 oktober, akan banyak lagi kegiatan lainnya di antaranya pelayanan kesehatan jiwa langsung untuk masyarakat pulau Lombok, bakti sosial, seminar ilmiah, talk show, lomba &ndash; lomba antar karyawan RSJ, serta pada puncaknya kegiatan akan di pusatkan di Lombok Epicentrum Mall </em>ujar psikiater muda alumnus Unair ini.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Di Media Center Kantor Gubernur Provinsi NTB, Selain Direktur RSJ Mutiara Sukma hadir di tempat ini adalah pejabat Kepala Dinas Kesehatan Provinsi NTB, kepala bidang pemberitaan Humas Pemda NTB serta para wartawan baik dari media cetak maupun dari media elektronik yang tersebar di pulau Lombok.&nbsp; Dalam pernyataan persnya direktur RSJ Mutiara Sukma Provinsi NTB mengatakan sengaja melakukan jumpa pers hari ini, dengan tujuan untuk memperingati hari kesehatan jiwa sedunia atau Word Mental Health Day, yang diperingati secara bersamaan setiap tanggal 10 Oktober.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">&ldquo; <em>Hari ini, kami dari RSJ Mutiara Sukma, beserta Dinas Kesehatan Provinsi NTB akan menyampaikan pernyataan pers terkait hari kesehatan jiwa sedunia, ujar dr elly membuka pernyataan persnya. Tahun ini peringatan HKJS mengambil tema yaitu Martabat Dalam Kesehatan Jiwa-pertolongan pertama psikologis dan kesehatan jiwa untuk semua, tujuan nya adalah untuk membangun awarnes atau </em>memberikan pendidikan dan penyadaran kepada masyarakat <em>dunia, atau masyarakat umum,kepada para pemangku kepentingan bahkan juga masyarakat yang bergerak di bidang kesehatan agar kembali bangkit dan peduli terhadap masalah kesehatan jiwa ujar direktur RSJ. &ldquo;</em></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">lebih lanjut, ibu direktur menyampaikan bahwa kesehatan merupakan &nbsp;satu hal yang utuh, baik itu kesehatan fisik&nbsp; maupun kesehatan mental, namun &nbsp;selama ini masyarakat hanya melihat dari segi kesehatan fisik saja dan mengabaikan kesehatan mentalnya.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">&ldquo;<em>apabila terjadi bencana, terjadi krisis, atau kecelakaan ,bahkan masalah- masalah yang menyebabkan strees, distress, yang diutamakan untuk pertolongan pertamanya musti fisik dan lupa terhadap mental atau kejadian traumanya iyakan, ujar dr. elly. Jadi, hampir tidak ada kita bicarakan kesehatan mental, misalnya pertolongan pertama pada orang menjadi korban pemasungan, pada orang yang menjadi korban pelecehan seksual atau kepada orang yang menjai korban kekerasan dalam rumah tangga, itu jarang sekali kita lakukan pertolongan pertamanya pasti pada sisi fisiknya saja.</em> Ujar beliau lebih lanjut.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Menurut dr elly. pertolongan pertama terhadap kesehatan mental itu tidak harus pada profesional , tidak harus datang ke psikiater, atau datang ke psikolog maupun datang ke rsj, tapi siapapun bisa melakukan pertolongan pertama ini, asal tenaga-tenaga tersebut harus yang terlatih atau yang sudah dilatih dan punya kompetensi. Pemahaman dan keterampilan dalam pertolongan pertama Psikologis <em>(Psychological First Aid)</em> akan membekali mereka untuk bersikap alami dan suportif , mampu mendengarkan tanpa memaksa orang untuk berbicara , melakukan penilaian kebutuhan dan kekhawatiran dan memastikan terpenuhinya kebutuhan fisik dasar , menyediakan atau memobilisasi dukungan sosial dan menyediakan informasi yang esesensial bagi mereka yang membutuhkan pertolongan khususnya kesehatan jiwa.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">&ldquo; <em>selama ini masyarakat bertanya apa sih gangguan jiwa itu, maka saya sering mengatakan bahwa tanda gangguan jiwa biasanya atau awalnya dapat terlihat pada&nbsp; gangguan fisik, misalnya pada kondisi cemas, kondisi depresi seperti munculnya keluhan nyeri lambung, dada penuh atau seperti sesak napas ujar dr elly menjelaskan gejala gangguan jiwa, ia mengatakan apabila seseorang sampai berkali kali mengunjungi dokter, di nyatakan tidak terjadi apa apa pada fisiknya maka kemungkinan orang itu mengalami masalah psikologis .</em> masalah- masalahtersebut kadang terlupakan dan di diamin aja, hal inilah yang harus menjadi focus perhatian kita, jangan sampai sudah mengalami gangguan iwa berat, baru di tangani. karena itulah, &nbsp;sebelum mereka mengalami gangguan jiwa berat, maka dari awal deteksi dini sangat penting sekali, ujar dr. elly lebih lanjut.&nbsp;&nbsp;</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Sementara itu, Dinas Kesehatan Provinsi NTB yang dalam hal ini di wakili oleh kepala bidang pelayanan kesehatan Bapak Lalu Budiarja menekankan untuk perlunya melakukan pertolongan kepada penderita gangguan jiwa dengan cara mengurangi stigma kepada penderita, seperti tidak lagi &nbsp;menyebut &nbsp;jogang tau kata &ndash; kata yang kurang manusiawi terhadap mereka. Kata &ndash; kata jogang dan sejenisnya akan menyakiti perasaan mereka saudara saudara sekalian, hal inilah yang di angkat oleh dunia bahwa orang dengan gangguan jiwa adalah manusia yang punya harkat dan martabat dan itu harus kita angkat harus kita jaga, ujar beliau. Lebih lanjut pak budiarja mengungkapkan pertolongan pertama psikologis haruslah menjadi bagian dari kesiapsiagaan bencana . pertolongan tersebut harus di sediakan secara rutin bagi mereka yang mengalami distrees berat setelah terpapar kejadian traumatic. ( arif rahman)</span></p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n', '2016-10-11'),
(119, 'ADA PELAYANAN KESEHATAN JIWA DI MALL', '11', '<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><img alt=\"\" src=\"/admin/images/berita/images/mall.jpg\" style=\"float:left; height:213px; width:319px\" />Masih dalam rangkaian memperingati hari kesehatan jiwa nasional (HKJS),&nbsp; hari ini sabtu 29 Oktober 2016, Pelayanan kesehatan jiwa antara lain, konseling, tes IQ dan bakat minat, test perilaku dan emosi anak, test penyalahgunaan zat dan narkoba,&nbsp; serta aktivitas lain yang biasa dilaksanakan di RSJ Mutiara Sukma, kali ini hadir di Lombok Epicentrum Mall (LEM) Kota Mataram. Pelayanan kesehatan jiwa ini terbuka bagi masyarakat luas tanpa di pungut biaya sepersenpun. Menurut Direktur RSJ Mutiara Sukma dr Elly Rosila Wijaya &nbsp;SpKj., MM, hal tersebut merupakan inovasi pelayanan yang dilakukan oleh RSJ Mutiara Sukma untuk lebih mendekatkan pelayanan kesehatan jiwa dengan masyarakat. &ldquo; alhamdulillah kegiatan ini berjalan lancar berkat kemitraan antara RSJ Mutiara Sukma dengan manajemen Lombok Epicentrum Mall, semoga kedepan kerja sama ini akan terus berlanjut. Ujar bunda elly memberikan kesannya terhadap kegiatan ini. &nbsp;Sementara itu, hadir bersama dr Elly Rosila Wijaya, adalah dr. Eka Viora, SpKJ (K) ketua umum PDSKJI (Perhimpunan Dokter Spesialis Kesehatan Jiwa Indonesia) yang juga Direktur Mutu dan Akreditasi Pelayanan Kesehatan, di kementerian kesehatan RI. Dr Eka Viora hadir di NTB untuk melantik pengurus PDSKJI Cabang NTB, dan menyempatkan diri untuk berkunjung dan melihat langsung pelayanan kesehatan jiwa yang tengah di laksanakan di Lombok Epicentrum Mall ini. Ketika tim redaksi menyambangi beliau, beliau &nbsp;menyampaikan apreaseasi yang setinggi tinggi nya bagi seluruh civitas hospitalia RSJ Mutiara Sukma atas kegiatannya hari ini. &nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><em>Kegiatan ini merupakan salah satu inovasi peringatan hari kesehatan jiwa, ini luar biasa menurut saya karena hal ini merupakan salah satu upaya kita untuk meningkatkan kesadaran masyarakat terhadap berbagai masalah kesehatan jiwa</em> ungkap dr viora memuji pelayanan kesehatan jiwa di mall ini. &nbsp;Lebih lanjut,&nbsp; beliau mengatakan bahwa selama ini masih ada anggapan yang negatif terhadap kesehatan jiwa, dimana kesehatan jiwa masih dikaitkan dengan orang yang berperilaku aneh. &ldquo; <em>Selama ini kesehatan jiwa jiwa itu selalu dikaitkan dengan orang gangguan jiwa yang berperilaku kasar, yang berperilaku aneh, padahal pelayanan kita itu tidak hanya pada orang yang sedang sakit, akan tetapi bagaimana orang yang masih sehat, pencegahannya itu, bisa kita lakukan seperti misalnya yang di mall ini, ini kan sasaran kita, bukan cari orang yang sakit jiwa tapi cari orang yang sehat, agar tidak sakit, contohnya remaja, sebagaimana kita tahu bahwa remaja itu punya potensi untuk stress atau bahasa mereka itu mungkin galau, nah, itukan bisa kita kenali disini</em> <em>agar cepat di intervensi dan itu tidak&nbsp; berlanjut menjadi masalah masalah yang nanti akan berpotensi utuk menjadi gangguan jiwa yang lebih berat.</em> Ujar perempuan kelahiran Painan yang juga alumnus Fakultas Kedokteran Universitas Sriwijaya Palembang ini. lebih lanjut, &nbsp;diakhir pernyataannya dr eka viora berharap agar event-event seperti ini tidak berhenti sampai di sini, karena menurutnya event seperti ini merupakan upaya untuk mengurangi stigma masyarakat terhadap kesehatan jiwa &ldquo; kemitraan seperti ini akan mendukung program pemerintah, karena program pemerintah sekarang itu adalah meningkatkan akes dan mutu pelayanan, jadi dengan adanya event seperti ini akan mendekatkan akses pelayanan ke masyarakat secara langsung, karena jika mau ke RSJ biasanya mereka masih pikir pikir, ujar dr. Eka Viora, SpKJ (K).</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\">Sementara itu, General Manager Lombok Epicentrum Mall, Bapak Salim Abdad yang turut hadir melihat pelayanan kesehatan jiwa di mall ini menyatakan sangat antusias dengan kegiatan tersebut&rdquo; <em>pertama sih mall perlu ada variasi acara, jadi ndak monoton harus jualan, jadi Lombok Epicentrum Mall merasa perlu juga mengadakan acara-acara atau kegiatan yang sifatnya sosial seperti ini, seperti konseling atau kegiatan kegiatan sosial lainnya, sehingga orang ke mall itu ndak bosan</em>&rdquo; ujarnya. <em>bagi kami, kami mendapatkan hal yang baru, dan dari rumah sakit juga mendapatkan tempat untuk melaksanakan aktivitasnya, begitu juga masyarakat akan merasa lebih nyaman tanpa harus berkunjung langsung ke RSJ sehingga menurut saya aktivitas ini sama-sama menguntungkan</em> ujar Bapak Salim Abdad General Manager Lombok Epicentrum Mall, lebih lanjut. (Arif Rahman)</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n', '2016-10-29'),
