(126, 'Penerimaan Sertifikat Akreditasi Paripurna RSJ. Mutiara Sukma dari KARS', '11', '<p><span style=\"color:rgb(0, 0, 0)\"><img alt=\"\" src=\"https://scontent-sin6-1.xx.fbcdn.net/v/t1.0-9/15078996_10154191997868037_3050634081879201676_n.jpg?oh=7a37a5c55ca2a537c568b2a7f75623f6&amp;oe=58BA734F\" /></span></p>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\">Penerimaan Sertifikat Akreditasi Paripurna RSJ. Mutiara Sukma dari KARS hari Senin, tanggal 14 November 2016 di Jakarta. Sertifikat langsung diterima oleh Direktur RSJ. Mutiara Sukma dr. Elly Rosila Wijaya, SpKJ., MM yang didampingi oleh Ketua Tim Akreditasi, Sekretaris Tim dan Anggota PMKP.<br />\r\nSelamat dan sukses selalu kepada Civitas Hospitalia RSJ. Mutiara Sukma. Berikan pelayanan yang profesional dan bermutu bagi semua pelanggan.</span></p>\r\n', '2016-11-14'),
