(137, 'JADWAL LANJUTAN TES PENERIMAAN PEGAWAI NON PNS BLUD RSJ MS 2017', '20', '<p><img alt=\"\" src=\"/admin/images/berita/images/JADWAL%20PELAKSANAAN%20TES%20LANJUTAN1.jpg\" style=\"height:1052px; width:890px\" /></p>\r\n', '2017-04-10'),
(138, 'JADWAL LANJUTAN TES PENERIMAAN PEGAWAI NON PNS BLUD RSJ MS 2017', '20', '<p><img alt=\"\" src=\"/admin/images/berita/images/JADWAL%20PELAKSANAAN%20TES%20LANJUTAN1.jpg\" style=\"height:1052px; width:890px\" /></p>\r\n', '2017-04-10'),
(139, 'Daftar peserta yang lulus tes kemampuan teknis dan pembagian kelompok tes MMPI', '20', '<p><span style=\"color:#000000\">Daftar peserta yang lulus tes kemampuan teknis dan pembagian kelompok tes MMPI penerimaan pegawai non PNS BLUD RSJ Mutiara Sukma Tahun 2017 dapat di download</span> <span style=\"font-size:28px\"><a href=\"http://rsjmutiarasukma.ntbprov.go.id/file/TES%20KEMAMPUAN%20TEKNIS.rar\">DISNI</a></span></p>\r\n', '2017-04-10'),
(140, 'PENGUMUMAN HASIL TES MMPI', '20', '<p><span style=\"color:#000000\">Daftar peserta yang mengulang tes MMPI dan yang mengikuti tes wawancara pada hari kamis tgl 13 April 2017 dapat di download</span> <a href=\"http://rsjmutiarasukma.ntbprov.go.id/file/TES%20MMPI%20dan%20TES%20WAWANCARA.rar\"><span style=\"font-size:20px\">DISINI</span></a></p>\r\n', '2017-04-12'),
(141, 'PENGUMUMAN JADWAL WAWANCARA LANJUTAN', '20', '<p style=\"text-align:center\"><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>PENGUMUMAN</strong></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#000000\">JADWAL WAWANCARA LANJUTAN DAN HASIL TES MMPI YANG MENGULANG AKAN DIUMUMKAN PADA HARI SENIN, TGL 17 APRIL 2017 PUKUL 09.00 WITA, MELALUI WEBSITE DAN PAPAN PENGUMUMAN RSJ MUTIARA SUKMA.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:right\"><span style=\"color:#000000\">TTD</span></p>\r\n\r\n<p style=\"text-align:right\"><span style=\"color:#000000\">PANITIA SELEKSI</span></p>\r\n', '2017-04-13'),
(142, 'Daftar peserta dan jadwal wawancara lanjutan, Senin 17 April 2017', '20', '<p><span style=\"color:#000000\">Daftar dan jadwal wawancara lanjutan yang akan dilaksanakan pada hari senin tgl 17 April 2017 pukul 13.00 WITA dapat di download <span style=\"font-size:26px\"><a href=\"http://rsjmutiarasukma.ntbprov.go.id/file/DAFTAR%20PESERTA%20WAWANCARA%20LANJUTAN,%20SENIN%2017%20APRIL%202017.pdf\">DISINI</a></span></span></p>\r\n', '2017-04-17'),
(143, 'Daftar peserta lulus seleksi penerimaan pegawain Non PNS BLUD RSJ Mutiara Sukma Tahun 2017', '21', '<p><span style=\"color:#000000\">Daftar Peserta lulus seleksi penerimaan pegawai Non PNS BLUD RSJ Mutiara Sukma tahun 2017 dapat didownload <a href=\"http://rsjmutiarasukma.ntbprov.go.id/file/DAFTAR%20PESERTA%20LULUS%20SELEKSI%20PENERIMAAN%20PEGAWAI%20NON%20PNS%20BLUD%20RSJ%20MUTIARA%20SUKMA%20TAHUN%202017.pdf\"><span style=\"font-size:20px\">DISINI</span></a></span></p>\r\n', '2017-04-19'),
(144, 'Pengumuman Penandatanganan Surat Perjanjian Kerja', '21', '<p style=\"text-align:center\"><span style=\"color:#000000\"><strong>PENGUMUMAN</strong></span></p>\r\n\r\n<p><span style=\"color:#000000\">BAGI PESERTA LULUS SELEKSI PENERIMAAN PEGAWAI NON PNS BLUD RSJ MUTIARA SUKMA TAHUN 2017, UNTUK MENANDATANGANI SURAT PERJANJIAN KERJA PADA HARI JUM&rsquo;AT DAN SABTU TANGGAL 28 &ndash; 29 APRIL 2017 JAM 09.00 &ndash; 11.00 WITA DI URUSAN KEPEGAWAIAN RSJ MUTIARA SUKMA DENGAN MEMBAWA 2 (DUA) BUAH MATERAI</span></p>\r\n\r\n<p><span style=\"color:#000000\"><strong>TTD</strong></span></p>\r\n\r\n<p><span style=\"color:#000000\"><strong>PANITIA SELEKSI</strong></span></p>\r\n', '2017-04-26'),
(145, 'MENTERI KESEHATAN BERKUNJUNG KE RUANG AUTIS RSJMS', '13', '<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><strong>&nbsp;</strong></span><span style=\"color:rgb(0, 0, 0)\"><strong><img alt=\"\" src=\"/admin/images/berita/images/1(1).jpg\" style=\"float:left; height:139px; width:200px\" /></strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><strong>Rabu, 29 Maret 2017 Menteri kesehatan RI dr Nila Moloek berkunjung ke RSJ Mutiara Sukma. tepatnya&nbsp; di ruang autis rsj mutiara sukma. dalam kunjungannya bu menteri mengapresiasi pelayanan yang diberikan oleh petugas rsj. Menurutnya, pelayanan yang diberikan sangat manusiawi dan rumah sakitnya bersih.&nbsp; <em>Pertama sih kesan saya rumah sakitnya bagus sekali ya? Sangat manusiawi kalau menurut saya, tempat tidur, kamar mandi nya bersih sekali &nbsp;bagus!! ,</em> ujar bu menteri kesehtan saat kami wawancarai kemarin. &nbsp;Tentang penyakit yg dialami oleh penderita, bu menteri mengatakan tidak bisa berbuat banyak, akan tetapi pelayanan harus tetap diberikan. &ldquo;<em>Saya&nbsp; sedih ya,&nbsp; itu sih&nbsp; lihat anak anak yang berkebutuhan khusus tadi, mereka mendapakan apa, ada kelainanan., nah, yang seperti itukan cukup berat terapinya, ndak ringan gitu dan itu memerlukan ahli khusus spesialis anak, artinya cukup mahal, untuk biaya yang dikeluarkan</em>,&rdquo;&nbsp; ujar bu meteri kesehatan RI. &nbsp;Lebih lanjut, bu menteri berpesan&nbsp; agar pelayanan lebih menekankan kepada upaya pecegahan dan penyuluhan kesehatan jiwa yg lebih intensif, melalui gerakan masyarakat sehat. Sebab, kata beliau sehat itu bukan hanya fisik saja melainkan jiwanya juga. Oleh karenanya, melalui kunjungannya tadi bu menteri mengusulkan untuk lebih banyak melakukan kegiatan penelitian dan mencari akar permasalahan kesehatan jiwa sehingga dapat di carikan solusinya.</strong></span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><strong>Sementara itu, direktur RSJ Mutiara sukma, dr. Elly Rosila Wijaya, SpKJ, MM. dalam sambutannya&nbsp; menyampaikan ucapan selamat datang kepada ibu menteri kesehatan beserta rombongannya.&nbsp; Beliau merasa terharu sekaligus tersanjung karena bu menteri kesehatan berkesempatan hadir meninjau RSJMS. Selanjutnya bu elly melaporkan tentang profil dan kegiatan yang sudah dillakukan oleh&nbsp; RSJMS,</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><strong><em>Rsjms ini&nbsp; merupakan rsj tipe B dan berdiri diatas lahan seluas 6 hektar</em> ujar dr. elly memulai laporannya <em>Pada sat ini sdm kami terdiri dari 6 psikiater&nbsp; dan 1 orang psikiater konsultan anak. Sementara tenaga lain ada 2 psikolog, 97 pns yang totalnya 283 pegawai,</em> ujar dr elly. selanjutnya, bu dokter elly melaporkan&nbsp; bahwa rsjms sejak oktober tahun 2016 sudah meraih akreditasi paripurna. Dan saat ini, sedang bergerak untuk mengembangkan pelayanan kesehatan jiwa anak dan remaja. Awal tahun 2017 ini kami sudah melaunching pelayanan psikiatri anak dan remaja, sekaligus sebagai hajat kami untuk mengembangkan klinik autis di NTB, melalui program RSJ Goes to School ujar bu elly. Pusat autis ini merupakan hajat pemda NTB untuk memberika pelayana yang komprehensif, kepada anaka anak erkebutuhan khhusus di NTB. Sehingga untuk mensinkronkan kegiatan tersebut gedung autis dibangun di area RSMS agar efektif dan tersambung dengan pelayanan psikiatri anak MSC ( mental sehat ceria)&nbsp; yang sudah kami gagas sejak tahun 2010 ujar bu dokter elly lebih lanjut.</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0)\"><strong>Setelah acara penyambutan , rombongan memteri kesehatan kemudian berkesempatan langsung&nbsp; untuk meninjau pelayanan&nbsp; di gedung autis rsjms, seperti melihat langsung&nbsp; pelayanan okupasi terapi, terapi wicara, skrining tes, snoozelen, dsb. Dalam kesempatan kali ini, meteri kesehatan merasa terharu dan&nbsp; merasa senang, karena tidak menyangka mendapatkan kenang- kenangan dari Pandu&nbsp; seorang anak yang berkebutuhan khusus.&nbsp; Di akhir kegiatan rombongan bu menteri kesehatan selanjutnya berkesempatan berkeliling &ndash; keliling area RSJMS dan menyapa pasien- pasien yang sedang di rawat di RSJMS.&nbsp; Menurut salah satu karyawan RSJMS yang enggan di sebutkan namanya, ini&nbsp; adalah kunjungan bu menteri yang&nbsp; terlama di RSJMS yaitu hampir 2 jam berkeliling RSJMS , setelah sebelumnya tahun 2012 , RSJMS&nbsp; sempat juga di kunjung oleh menteri kesehatan&nbsp; era sebelumnya. Yaitu Dr Nafsiah Mboy. ( Arif Rahman )</strong></span></p>\r\n', '2017-05-09'),
(146, 'MENTERI KESEHATAN BERKUNJUNG KE RUANG AUTIS RSJMS', 'Tes', '<p style=\"text-align:justify\"><strong>&nbsp;<img alt=\"\" src=\"/admin/images/berita/images/1(1).jpg\" style=\"float:left; height:223px; width:343px\" />Rabu, 29 Maret 2017 Menteri kesehatan RI dr Nila Moloek berkunjung ke RSJ Mutiara Sukma. tepatnya&nbsp; di ruang autis rsj mutiara sukma. dalam kunjungannya bu menteri mengapresiasi pelayanan yang diberikan oleh petugas rsj. Menurutnya, pelayanan yang diberikan sangat manusiawi dan rumah sakitnya bersih.&nbsp; <em>Pertama sih kesan saya rumah sakitnya bagus sekali ya? Sangat manusiawi kalau menurut saya, tempat tidur, kamar mandi nya bersih sekali &nbsp;bagus!! ,</em> ujar bu menteri kesehtan saat kami wawancarai kemarin. &nbsp;Tentang penyakit yg dialami oleh penderita, bu menteri mengatakan tidak bisa berbuat banyak, akan tetapi pelayanan harus tetap diberikan. &ldquo;<em>Saya&nbsp; sedih ya,&nbsp; itu sih&nbsp; lihat anak anak yang berkebutuhan khusus tadi, mereka mendapakan apa, ada kelainanan., nah, yang seperti itukan cukup berat terapinya, ndak ringan gitu dan itu memerlukan ahli khusus spesialis anak, artinya cukup mahal, untuk biaya yang dikeluarkan</em>,&rdquo;&nbsp; ujar bu meteri kesehatan RI. &nbsp;Lebih lanjut, bu menteri berpesan&nbsp; agar pelayanan lebih menekankan kepada upaya pecegahan dan penyuluhan kesehatan jiwa yg lebih intensif, melalui gerakan masyarakat sehat. Sebab, kata beliau sehat itu bukan hanya fisik saja melainkan jiwanya juga. Oleh karenanya, melalui kunjungannya tadi bu menteri mengusulkan untuk lebih banyak melakukan kegiatan penelitian dan mencari akar permasalahan kesehatan jiwa sehingga dapat di carikan solusinya.</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Sementara itu, direktur RSJ Mutiara sukma, dr. Elly Rosila Wijaya, SpKJ, MM. dalam sambutannya&nbsp; menyampaikan ucapan selamat datang kepada ibu menteri kesehatan beserta rombongannya.&nbsp; Beliau merasa terharu sekaligus tersanjung karena bu menteri kesehatan berkesempatan hadir meninjau RSJMS. Selanjutnya bu elly melaporkan tentang profil dan kegiatan yang sudah dillakukan oleh&nbsp; RSJMS,</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><em>Rsjms ini&nbsp; merupakan rsj tipe B dan berdiri diatas lahan seluas 6 hektar</em> ujar dr. elly memulai laporannya <em>Pada sat ini sdm kami terdiri dari 6 psikiater&nbsp; dan 1 orang psikiater konsultan anak. Sementara tenaga lain ada 2 psikolog, 97 pns yang totalnya 283 pegawai,</em> ujar dr elly. selanjutnya, bu dokter elly melaporkan&nbsp; bahwa rsjms sejak oktober tahun 2016 sudah meraih akreditasi paripurna. Dan saat ini, sedang bergerak untuk mengembangkan pelayanan kesehatan jiwa anak dan remaja. Awal tahun 2017 ini kami sudah melaunching pelayanan psikiatri anak dan remaja, sekaligus sebagai hajat kami untuk mengembangkan klinik autis di NTB, melalui program RSJ Goes to School ujar bu elly. Pusat autis ini merupakan hajat pemda NTB untuk memberika pelayana yang komprehensif, kepada anaka anak erkebutuhan khhusus di NTB. Sehingga untuk mensinkronkan kegiatan tersebut gedung autis dibangun di area RSMS agar efektif dan tersambung dengan pelayanan psikiatri anak MSC ( mental sehat ceria)&nbsp; yang sudah kami gagas sejak tahun 2010 ujar bu dokter elly lebih lanjut.</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Setelah acara penyambutan , rombongan memteri kesehatan kemudian berkesempatan langsung&nbsp; untuk meninjau pelayanan&nbsp; di gedung autis rsjms, seperti melihat langsung&nbsp; pelayanan okupasi terapi, terapi wicara, skrining tes, snoozelen, dsb. Dalam kesempatan kali ini, meteri kesehatan merasa terharu dan&nbsp; merasa senang, karena tidak menyangka mendapatkan kenang- kenangan dari Pandu&nbsp; seorang anak yang berkebutuhan khusus.&nbsp; Di akhir kegiatan rombongan bu menteri kesehatan selanjutnya berkesempatan berkeliling &ndash; keliling area RSJMS dan menyapa pasien- pasien yang sedang di rawat di RSJMS.&nbsp; Menurut salah satu karyawan RSJMS yang enggan di sebutkan namanya, ini&nbsp; adalah kunjungan bu menteri yang&nbsp; terlama di RSJMS yaitu hampir 2 jam berkeliling RSJMS , setelah sebelumnya tahun 2012 , RSJMS&nbsp; sempat juga di kunjung oleh menteri kesehatan&nbsp; era sebelumnya. Yaitu Dr Nafsiah Mboy. ( Arif Rahman )</strong></p>\r\n', '2017-05-09'),
(147, 'pengumuman penerimaan pegawai non pns', '21', '<p><span style=\"color:rgb(0, 0, 0)\">Penerimaan pegawai Non PNS BLUD RSJ Mutiara Sukma Tahun 2017 tahap kedua telah dibuka. </span></p>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\">Untuk Informasi Formasi dan Syarat-syarat pendaftaran dapat di <a href=\"http://rsjmutiarasukma.ntbprov.go.id/file/Pengumuman%20Penerimaan%20Pegawai%20Non%20PNS%20BLUD%20RSJ%20Mutiara%20Sukma%20Juli%202017.pdf\">download DISINI</a></span></p>\r\n', '2017-07-10'),
(148, 'MENGENAL AUTISME', 'Tes', '<p><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\"><img alt=\"faiz bersama terapis fika khaira\" src=\"/admin/images/berita/images/faiz%281%29.jpg\" style=\"float:left; height:150px; width:268px\" /></span></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Faiz, adalah seorang anak autis yang sedang menjAlani terapi di poli MSC RSJ Mutiara Sukma. menurut sang ibu,&nbsp;perkembangan faiz sekarang sudah banyak kemajuan, hal ini di tandai dengan perilaku faiz yang sudah mulai bisa di kontrol, hafal ayat - ayat pendek, dan sudah bisa sholat. Suara faiz bagus pak, bisa menirukan suara azan seperti yang di kaset itu, ujar sang ibu dengan sumringah kepada saya saat di wawancarai. &nbsp;&nbsp;Awalnya perilaku faiz&nbsp;sangat hiperaktif dan suasah di kontrol, ia sulit berkomunikasi dan susah bersosilisasi dengan lingkungannya. &nbsp;ibunda faiz, mengatakan, &nbsp;sejak lahir ia tidak menemukan kelainan aapun&nbsp;pada diri faiz, ia terlihat normal. Namun, menginjak usia 3 tahun orang tua mulai melihat keanehan dalam diri faiz, dimana ia tidak mau berinter-aksi dengan teman2nya serta &nbsp;melihat adanya keterlambatan berbicara.</span></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Autisme &nbsp;sendiri berdasarkan literature yang&nbsp; saya baca merupakan suatu &nbsp;fenomena yang masih menyimpan banyak rahasia walaupun telah diteliti oleh banyak ahli. &nbsp;Hingga &nbsp;saat ini, para ahli belum dapat menemukan apa penyebab pasti dari gangguan autisme ini, sehingga belum dapat dikembangkan bagai mana &nbsp;cara pencegahan maupun penanganan yang tepat.</span></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Waterhouse, (dalam Huebner dan Lane, 2001; Frith, 2003) menyatakan bahwa pada awalnya autism dipandang sebagai gangguan yang disebabkan oleh faktor psikologis, yaitu pola pengasuhan orangtua yang tidak hangat secara emosional. Dan Pada &nbsp;tahun 1960 dimulai penelitian neurologis yang membuktikan bahwa autisme disebabkan oleh adanya abnormalitas pada otak . &nbsp;lebih lanjut, Pada awal tahun 1970, penelitian tentang ciri-ciri anak autistik berhasil menentukan kriteria diagnosis yang selanjutnya digunakan dalam DSM-III. Gangguan autistik didefinisikan sebagai gangguan perkembangan dengan tiga ciri utama, yaitu gangguan pada interaksi sosial, gangguan pada komunikasi, dan keterbatasan minat serta kemampuan imajinasi.</span></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Jika di &nbsp;dilihat sepintas, anak penyandang autis itu tidak berbeda dengan anak-anak lain, tapi kala dia ber-interaksi dengan teman2 nya, baru akan terlihat &quot;keunikan&quot; anak itu. Dari cara berbicara maupun cara berkomunikasi sangat berbeda dengan anak-anak lain seusianya. Secara sekilas, mereka &nbsp;terlihat seperti anak dengan keterbelakangan mental. Tapi sebenarnya sangat berbeda. Dan yang pasti autisme itu bukan penyakit, tapi berupa &quot;gangguan perkembangan&quot;.</span></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Berdasarkan literature yang saya baca, Ada beberapa kelainan yang paling menonjol dari anak autis :</span></span></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Komunikasi: Kemampuan berbahasa anak autis umumnya mengalami keterlambatan atau sama sekali tidak bisa berbicara. Kalau pun bisa berbicara, seringkali tidak bisa menggunakan kata-kata dengan benar atau dengan arti yang lazim digunakan.</span></span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Bersosialisai (berteman): &nbsp;anak autis sulit berteman, dalam arti tidak bisa melakukan inter-aksi seperti layaknya anak-anak dengan teman sebaya. Lebih suka sendiri.</span></span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Indra: Sangat sensitif terhadap cahaya, pendengaran, sentuhan, penciuman, dan rasa (lidah) mulai dari yang ringan sampai yang berat.</span></span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Bermain: Tidak spontan/reflek dan tidak dapat berimajinasi dalam bermain.</span></span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">Perilaku: Ada yang sangat pasif (pendiam) tapi ada juga yang sangat aktif (hyperaktif). Kadang2 marah tanpa alasan yang masuk akal (tantrum). Sangat menaruh perhatian pada satu benda yang disukai (obsesi). Dapat sangat agresif pada orang lain atau dirinya sendiri. Sangat suka rutinitas dan akan sulit untuk merubah kegiatan rutin anak-anak autis.</span></span></span></li>\r\n</ol>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">&nbsp;Tiap individu autis adalah unik dan berbeda (tidak ada yang persis sama antara satu dengan lainnya). Oleh karena itu terapi pada anak autis &nbsp;juga harus bersifat individual dan disesuaikan dengan umur, fase perkembangan dan gejala yang ditemukan. Contoh terapi-terapi yang biasa diberikan misalnya adalah Terapi ABA (Applied Behaviour Analysis), SI/OT (Sensory Integration/Occupational Therapy), BT (Biomedical Treatment), Floortime-DIR Treatment, RDI, dan masih banyak lagi. Hingga saat ini di RSJ Mutiara Sukma memiliki tenaga psikiater spesialis perkembangan anak dan remaja serta terapis terapis yang berkompeten dibidangnya. Namun, yang perlu di pahami adalah khusus dalam penanganan autis ini, kerja sama antara dokter, terapis, dan orang tua sangat penting demi kemajuan anak.. Diagnosa dini dan peran aktif orang tua dapat mempermudah penanganan anak penyandang autisme. ( Arif )</span></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\"><u>Sumber :</u></span></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><em><strong><span style=\"color:#000000\">1.&nbsp;</span><a href=\"http://www.puterakembara.org/\"><span style=\"color:#000000\">www.puterakembara.org</span></a></strong></em><span style=\"color:#000000\">&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:14px\"><span style=\"font-family:times new roman,times,serif\"><span style=\"color:#000000\">2. Ginanjar, A. S. (2007) &lsquo;<strong><em>Memahami spektrum autistik secara holistik&rsquo;</em></strong>, <em>Makara Sosial Humaniora</em>, 11(2), pp. 87&ndash;99.&nbsp;</span></span></span></p>\r\n', '2017-07-12'),
