(156, 'KUNJUNGAN PRAMUKA TUNA RUNGU', 'Tes', '<p style=\"text-align:justify\"><span style=\"color:#000000\"><em><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-08-02%20at%2013.31.32.jpeg\" style=\"float:left; height:139px; width:90px\" />&quot;cacat fisik maupun cacat mental tidak bisa menjadi penghalang seseorang untuk sukses, karna sukses itu sendiri bukan tentang kekuatan fisik maupun modal uang yang kita miliki, melainkan kemauan, tekad, dan tidak takut gagal&quot;&nbsp;</em></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">kata motivasi ini pantas untuk di semakan kepada RUSLIN seorang anak pramuka tuna rungu berasal dari Makassar yang melakukan ekspedisi keliling Indonesia dengan menggunakan sepeda motor. Hari ini 2 Agustus 2017 Ruslin singgah di kator RSJ Mutiara Sukma Provinsi NTB. Dan dengan membawa secarik kertas yang bertuliskan &ldquo; kami pramuka tuna rungu mau bertemu dan foto salam dengan kepala...dst..&rdquo; selanjutnya, ruslin berkesempatan bertemu langsung dengan ibu direktur RSJ Mutiara Sukma Dr. Elly Rosila Wiajaya, SpKj MM. di ruang kerjanya dr elly menyambut dan memberikan ucapan selamat sebagai tanda pengghargaan dan rasa bangganya kepada ruslin, &quot; meski mempunyai keterbatasan fisik. Namun anak ini, memiliki semangat dan kepercayaan diri yang tinggi. ia memiliki tekad yang luar biasa untuk menggapai cita citanya. ini luar biasa untuk di jadikan inspirasi bagi kita, ujar dr elly. (arif )</span></p>\r\n', '2017-08-02'),
(157, 'KUNJUNGAN PRAMUKA TUNA RUNGU', '13', '<p style=\"text-align:justify\"><span style=\"color:#000000\"><em><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-08-02%20at%2013.31.32.jpeg\" style=\"float:left; height:139px; width:90px\" />&quot;cacat fisik maupun cacat mental tidak bisa menjadi penghalang seseorang untuk sukses, karna sukses itu sendiri bukan tentang kekuatan fisik maupun modal uang yang kita miliki, melainkan kemauan, tekad, dan tidak takut gagal&quot;&nbsp;</em></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">kata motivasi ini pantas untuk di semakan kepada RUSLIN seorang anak pramuka tuna rungu berasal dari Makassar yang melakukan ekspedisi keliling Indonesia dengan menggunakan sepeda motor. Hari ini 2 Agustus 2017 Ruslin singgah di kator RSJ Mutiara Sukma Provinsi NTB. Dan dengan membawa secarik kertas yang bertuliskan &ldquo; kami pramuka tuna rungu mau bertemu dan foto salam dengan kepala...dst..&rdquo; selanjutnya, ruslin berkesempatan bertemu langsung dengan ibu direktur RSJ Mutiara Sukma Dr. Elly Rosila Wiajaya, SpKj MM. di ruang kerjanya dr elly menyambut dan memberikan ucapan selamat sebagai tanda pengghargaan dan rasa bangganya kepada ruslin, &quot; meski mempunyai keterbatasan fisik. Namun anak ini, memiliki semangat dan kepercayaan diri yang tinggi. ia memiliki tekad yang luar biasa untuk menggapai cita citanya. ini luar biasa untuk di jadikan inspirasi bagi kita, ujar dr elly. (arif )</span></p>\r\n', '2017-08-02'),
(158, 'Pelatihan Komunikasi Efektif', '13', '<p><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170825-WA0015.jpg\" style=\"height:206px; width:316px\" /> Selama dua hari secara bertahap dimulai hari ini Tanggal 25 dan 26 Agustus 2017 seluruh Civitas Hospitalia RSJ Mutiara Sukma mengikuti pelatihan komunikasi efektif di Aula RSJ Mutiara Sukma.</span></p>\r\n\r\n<div style=\"text-align: justify;\"><span style=\"color:#000000\">Kegiatan ini dibuka langsung oleh Direktur RSJ Mutiara Sukma (Ibu Dr. Elly Rosila Wijaya, &nbsp;Sp. KJ., MM) dengan Narasumber Ibu Komang Ayu Mustriwati, SKp. &nbsp;MPH Kepala Bagian Umum RSUP Sanglah Denpasar, Bali.&nbsp;</span></div>\r\n\r\n<div id=\"m_-4088352875887560463yMail_cursorElementTracker_1503710657980\" style=\"text-align: justify;\"><span style=\"color:#000000\">Dalam sambutan beliau, &nbsp;ibu Direktur menekankan bahwa komunikasi efektif sangat diperlukan bagi kepentingan pelayanan dan kepuasan pelanggan/pasien. Pelatihan ini ditujukan khususnya pada pegawai first-line yang berhadapan langsung dengan pasien dan keluarga. Diharapkan kepada seluruh Civitas Hospitalia RSJ Mutiara Sukma dapat terus berproses menjadi lebih baik sesuai dengan visi RSJ Mutiara Sukma yaitu &quot;Runah Sakit Jiwa dambaan Masyarakat dengan mutu terkini&quot;. Sehingga dapat memberikan pelayanan terbaik bagi masyarakat Nusa Tenggara Barat. (Dian)</span></div>\r\n', '2017-08-26'),
(159, 'PELATIHAN SIMULASI DAN EVAKUASI PENANGGULANGAN BENCANA KEBAKARAN', '13', '<p><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170829-WA0003.jpg\" style=\"float:left; height:225px; margin-left:10px; margin-right:10px; width:400px\" /> Selasa, 29 Agustus 2017 RSJMS bekerjasama dengan Dinas Pemadam Kebakaran Kota Mataram mengadakan kegiatan Pelatihan&nbsp; Simulasi Dan Evakuasi Penanggulangan Bencana Kebakaran. Hai ini merupakan upaya untuk melatih serta menyiapkan SDM yang memiliki kemampuan dasar dalam penanggulangan bencana khususnya kebakaran.<br />\r\nKegiatan ini diikuti oleh civitas hospitalia sejumlah 100 orang yang melibatkan semua unit yang ada di RSJMS mulai dari cleaning servis, security, dokter, perawat, tenaga kesehatan lain, penyewa lahan, sampai jajaran direksi.<br />\r\nPelatihan dibuka oleh Direktur RSJMS Dr. Elly Rosila Wijaya, Sp. K.J yang dalam sambutannya menyatakan bahwa RS merupakan salah satu area yang memiliki potensi bencana kebakaran yang cukup tinggi maka seluruh karyawan harus memiliki kemampuan dalam penanggulangan bencana kebakaran.<br />\r\nPelatihan dengan narasumber Inspektur Dinas Pemadam Kebakaran Kota Mataram memaparkan tentang pemadam kebakaran dan evakuasi serta dilakukan simulasi pemadaman api menggunakan alat pemadam konvensional (karung) dan alat pemadam api ringan (APAR). Hasil pelatihan ini akan menjadi bahan acuan untuk pelatihan berikutnya yang bertujuan meningkatkan program manajemen resiko kebakaran di RSJMS (Dewi/Dian)</span></p>\r\n', '2017-08-31'),
