(163, 'Survei Verifikasi Akreditasi Rumah Sakit Versi 2012', '13', '<p><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170906-WA0004.jpg\" style=\"float:left; height:133px; margin:10px; width:200px\" /><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170906-WA0003.jpg\" style=\"float:left; height:133px; margin:10px; width:200px\" /><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170906-WA0005.jpg\" style=\"float:left; height:133px; margin:10px; width:200px\" /><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170906-WA0007.jpg\" style=\"float:left; height:133px; margin:10px; width:200px\" /></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\">Satu tahun sudah RSJ Mutiara Sukma Provinsi Nusa Tenggara Barat menyandang predikat &quot;Terakreditasi Paripurna&quot;. Hari ini, Rabu, 6 September 2017 sedang dilaksanakan Survei Verifikasi Akreditasi RS Versi 2012 oleh Komisi Akreditasi Rumah Sakit (KARS). Surveiyor yang bertanggung jawab melakukan verifikasi adalah dr. Dyah Wiryastini, MARS.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pelaksanaan survei verifikasi ini dibuka oleh direktur Rumah Sakit Jiwa Mutiara Sukma (dr. Elly Rosila Wijaya SpKJ.,MM) dengan dilanjutkan menyampaikan paparan kegiatan di RSJ Mutiara Sukma kemudian dilakukan proses telusur ke unit-unit pelayanan. (Dian)</span></p>\r\n', '2017-09-06'),
(164, 'RSJ Mutiara Sukma dalam Kompetisi Prof. DR. Dr. Kusumanto Award, Sp.K.J (K)', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170913-WA0000.jpg\" style=\"float:left; height:169px; margin:10px; width:300px\" /><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170913-WA0001.jpg\" style=\"float:left; height:169px; margin:10px; width:300px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:#000000\">Prestasi yang membanggakan bagi seluruh Civitas Hospitalia RSJ Mutiara Sukma, khususnya Ibu dr. Elly Rosila Wijaya SpKJ.,MM. dan tim Keswamas RSJ Mutiara Sukma Provinsi NTB sebagai pemenang I Kompetisi Prof.DR.Dr. Kusumanto, Sp.K.J.(K) 2017 dan Dr. Azhari C. Nurdin Sp.K.J. (Psikiater RSJ Mutiara Sukma) sebagai pemenang I Young Psychiatrist Award 2017. Pada konferensi Nasional Psikiatri Komunitas dan Psikiatri Militer 2017 di Banjarmasin. (Dian)</span></p>\r\n', '2017-09-13'),
(165, 'DAFTAR PENGADAAN BARANG DAN JASA RUMAH SAKIT JIWA MUTIARA SUKMA TAHUN 2017', '11', '<p><img alt=\"\" src=\"/admin/images/berita/images/1(3).jpg\" style=\"height:1232px; width:800px\" /><img alt=\"\" src=\"/admin/images/berita/images/2.jpg\" style=\"height:511px; width:800px\" /><img alt=\"\" src=\"/admin/images/berita/images/3.jpg\" style=\"height:507px; width:800px\" /><img alt=\"\" src=\"/admin/images/berita/images/4.jpg\" style=\"height:511px; width:800px\" /><img alt=\"\" src=\"/admin/images/berita/images/5.jpg\" style=\"height:513px; width:800px\" /><img alt=\"\" src=\"/admin/images/berita/images/6.jpg\" style=\"height:508px; width:800px\" /></p>\r\n', '2017-09-26'),
(166, 'PERUBAHAN WAKTU PELAYANAN RSJMS MULAI OKTOBER 2017', '11', '<p style=\"text-align:center\"><span style=\"color:#000000\">PENGUMUMAN PELAKSANAAN UJI COBA 5 (LIMA) HARI KERJA</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sehubungan dengan akan dilaksanakan uji coba 5 (lima) hari kerja pada RSJ Mutiara Sukma terhitung mulai tanggal 02 Oktober 2017. Perubahan jam kerja adalah sebagai berikut:</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170929-WA0001.jpg\" style=\"float:left; height:731px; width:280px\" /><img alt=\"\" src=\"/admin/images/berita/images/IMG-20170929-WA0002.jpg\" style=\"float:left; height:728px; width:279px\" /></span></p>\r\n', '2017-09-30'),
(171, 'Hari Kesehatan Jiwa Sedunia', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-10%20at%2021.10.15.jpeg\" style=\"height:169px; width:300px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-11%20at%2007.16.09.jpeg\" style=\"height:169px; width:300px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-11%20at%2007.16.10%20%281%29.jpeg\" style=\"height:169px; width:300px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-11%20at%2007.16.10.jpeg\" style=\"height:169px; width:300px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Dalam rangka Hari Kesehatan Jiwa Sedunia 10 Oktober 2017 dengan tema&nbsp;&quot;Mental Health In The Workplace/ Kesehatan Jiwa di Tempat Kerja&quot;. Direktur RSJ Mutiara Sukma bersama Ketua Dewas Pengawas RSJ Mutiara Sukma,&nbsp; Kepala Dinas Kesehatan Provinsi NTB, Kabag Pemberitaan Humas Provinsi NTB dan Ibu Pejabat Fungsional Dinas Ketenagakerjaan dan Transmigrasi Provinsi NTB mengadakan press conference dia Aula RSJ Mutiara Sukma, yang dihadiri oleh para wartawan media cetak maupun elektronik. Acara ini diawali dengan dilakukan skrening depresi kepada seluruh wartawan yang hadir,<br />\r\nSelanjutnya ibu Direktur memaparkan tentang pentingnya kesehatan jiwa ditempat kerja dan diakhiri sesi tanya jawab dengan moderator kabag pemberitaan humas pemprov. NTB membahas tentang Kesehatan Jiwa yang Prima Mewujudkan Produktifitas Kerja dan Kesejahteraan Keluarga.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Setiap tahun&nbsp;RSJ Mutiara Sukma&nbsp; memperingati&nbsp;HKJS yang jatuh pada tanggal 10 Oktober 2017, pada&nbsp;peringatan&nbsp;HKJS&nbsp;tahun ini RSJ Mutiara Sukma melakukan rangkaian kegiatan baik di dalam rumah sakit sampai dengan diluar rumah sakit, beberapa pelayanan terintegrasi juga dilaksanakan diluar pulau lombok. Acara puncak rencana akan digelar di Taman Udayana, 15 Oktober mendatang, beberapa hiburan dan hadiah cantik akan disediakan panitia pada acara puncak tersebut.&nbsp;(Dian G)</span></p>\r\n', '2017-10-11');
INSERT INTO `sekilas_mataram` (`id`, `judul`, `kategori`, `konten`, `tanggal`) VALUES
(174, 'RSJ Mutiara Sukma Gandeng PDSKJI melaksanakan Seminar untuk mempringati HKJS tahun ini', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-11%20at%2007.54.25%20%281%29.jpeg\" style=\"height:233px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-11%20at%2007.54.25.jpeg\" style=\"height:233px; width:350px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Mataram, Peringatan Hari Kesehatan Jiwa Sedunia (HKJS) sudah mulai ditabuh, sabtu 07 Oktober kemarin Rumah Sakit Jiwa Mutiara Sukma membuka Gawai tahunan itu dengan acara seminar yang bekaitan dengan kesehatan jiwa yang dilakukan di hotel Astoria, Mataram.&nbsp;</span></p>\r\n\r\n<p><span style=\"color:#000000\">Tahun ini, tema yang diangkat oleh World Health Organitation (WHO) adalah Mental Health in The Workplace. Peningkatan kualitas sumber daya ditempat kerja sangat dipengaruhi oleh kesehatan mental dari member ditempat itu, dalam hal ini WHO sangat percaya akan pentingnya menjaga kesehatan mental di lingkungan kerja perlu diperhatikan dengan baik.</span></p>\r\n\r\n<p><span style=\"color:#000000\">RSJ Mutiara Sukma menyambut itu dengan baik, langkah awal yang dilakukan dalam peringatan tahun ini adalah dengan membekali para penggiat kesehatan jiwa dalam bentuk seminar yang bertemakan &quot;Improving Phsycian Capacity in depression Managenement&quot;, salah satu indikator yang sangat penting dalam kejiwaan adalah pengelolaan depresi. Yang diharapakan nantinya peserta yang terdiri dari dokter spesialis, dokter umum, perawat, apoteker,&nbsp; dosen, mahasiswa dan para penggiat kesehatan jiwa ini mampu mengetahui, memberikan pengarahan sekaligus menerapakan bagaiamana memanajemen depresi ditempat kerja masing-masing.&nbsp;</span></p>\r\n\r\n<p><span style=\"color:#000000\">Acara tersebut terselenggara atas kerjasama RSJ Mutiara Sukma dan Persatuan Dokter Spesialis Jiwa Indonesia (PDSKJI) cabang NTB, itu merupakan Forum pertama dari organisasi kedokteran tersebut setelah dilantik pada peringatan HKJS tahun lalu. Acara ini terbilang sukses karena peserta yang ditargetkan hanya untuk 100 seat, tetapi pada Hari H membludak sampai dengan 150 orang, ini tentu hasil kerja sama yang baik dari pihak rumah sakit dan organisasi profesi sehingga bisa berjalan dengan lancar.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Dalam sambutannya Direktur RSJ Mutiara Sukma,&nbsp; Ibu dr. Elly Rosilla Wijaya, SpKJ.,MM, yang sekaligus sebagai ketua PDSKJI cabang NTB, menyebutkan bahwa keberhasilan melaksanakan forum ini menunjukkan bahwa organisasi kedokteran tersebut sudah mampu menunjukkan existensinya dalam memberikan pelayanan kesehatan jiwa di nusa tenggara barat. Organisasi yang beranggotakan 10 orang itu masih terbilang cukup kecil namun mampu memberikan pencerahan terhadap penggiat kejiwaan di nusa tenggara barat. &quot;Berharap event selanjutnya lebih besar dan bermanfaat lagi&quot; kata beliau mengahiri sambutannya.&nbsp;</span></p>\r\n\r\n<p><span style=\"color:#000000\">Event tersebut menghadirkan Narasumber yang handal di bidangnya, Sebut saja dr. Herpan Syafi&#39;i Harahap, M. Biomed., Sp.S, beliau adalah dokter sepsialis saraf yang masih muda energic namun mempunyai jam terbang yang&nbsp; tinggi, selain aktif di beberapa rumah sakit, beliau juga merupakan salah satu dosen Fak. Kedokteran Univ. Mataram. Pembicara yang kedua adalah dr. Elly Rosila Wijaya, Sp.KJ, M.M. Bunda Jiwa NTB beliau dikenal, kiprah beliau dalam membangun kesehatan jiwa di Nusa Tenggara Barat tidak bisa diragukan, Predikat Paripurna yang diraih RSJ Mutiara Sukma juga didapatkan ditangan kepemimpinnanya. Selanjutnya adalah Konsultan Psiakitri Anak, dr. Dian Widiastuti Vietara, Sp.KJ (K), selain aktif di Rumah Sakit Jiwa beliau juga aktif dibeberapa kegiatan kesehatan jiwa, saat ini beliau menjabat kepala seksi Pelayanan Medik di RSJ Mutiara Sukma dan sebagai konsultan Psikiatri Anak di Nusa Tenggara Barat.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pada prosesnya, seminar tersebut berjalan sangat khidmat, satu persatu para pembicara menyampaikan materi dan ditanggapi oleh peserta dengan beberapa sesi pertanyaan diahir acara. Ada yang membuat berbeda pada acara tersebut, ketika salah satu peserta bertanya tentang bagaimana mengenal dan mengatur depresi pada anak, Ibu Reni namanya, ibu reni menangis sambil menceritakan bagaimana ia mengasuh anaknya dirumah dan menanyakan apakah cara yang sudah dilakukannya benar untuk pertumbuhan kejiwaan anaknya, kemudian dr. Dian selaku konsultan Anak memaparkan jawaban atas apa yang ditanyakan dan memastikan bahwa kesehatan jiwa pada anak wajib di jaga untuk mendapatkan generasi yang gemilang dimasa akan datang.</span></p>\r\n', '2017-10-11'),
