(177, 'Acara puncak peringatan Hari Kesehatan Jiwa Sedunia (HKJS) RSJ Mutiara Sukma Provinsi Nusa Tenggara Barat', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.23.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.24.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.24%20%281%29.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.28.jpeg\" style=\"height:267px; width:400px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Acara puncak peringatan Hari Kesehatan Jiwa Sedunia (HKJS) RSJ Mutiara Sukma Provinsi Nusa Tenggara Barat berlangsung hari ini Minggu tanggal 15 Oktober 2017, bertempat di Halaman Kantor Dinas Kominfotik Prov. NTB Jl. Udayana yang merupakan area &quot;Car Free Day.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Kegiatan diawali dengan senam bersama keluarga besar RSJ MS,&nbsp; RSUP NTB, PAFI NTB, IPKJI NTB, YKI NTB, Institusi Pendidikan Kesehatan, SMA 7 Mataram dan masyarakat umum.<br />\r\nBeberapa peserta CFD yang melewati area Inspiratif Expo Diskominfotik NTB ikut meramaikan acara.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Kemudian dilanjutkan dengan penyampaian sambutan dan kampanye Sadar Kesehatan Jiwa di Tempat Kerja sesuai dengan tema HKJS Tahun 2017 adalah Mental Health In The Work Place oleh Direktur RSJ Mutiara Sukma. Beliau menekankan pentingnya memperhatikan kesehatan jiwa di tempat kerja agar produktifitas meningkat, sesuai dengan lagu Kebangsaan kita Indonesia Raya &quot;Bangunlah Jiwanya, Bangunlah Badannya&quot; sehingga sehat jiwa kita sehat&nbsp; raga kita.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Puncak peringatan HKJS 2017 juga dimeriahkan dengan pentas seni oleh Civitas Hospitalia RSJ MS dengan menampilkan WARAS BAND dan pentas seni tradisional Sasak oleh Siswa Siswi SMAN 7 Mataram.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sebagi bentuk menyadarkan masyarakat terkait kesehatan jiwa, dibagikan kuesioner Pemeriksaan Kesehatan Jiwa secara Mandiri dan konseling kesehatan jiwa secara gratis oleh Dokter, Perawat dan Psikolog RSJ. Mutiara Sukma.&nbsp;<br />\r\nPembagian doorprise yang menyelingi sampai acara berakhir, oleh panitia HKJS RSJ Mutiara Sukma semakin menambah meriahnya acara puncak HKJS Tahun ini.&nbsp;<br />\r\n&nbsp;&nbsp;<br />\r\nUcapan Terimakasih yang tak terhingga kepada Kepala Dinas Kominfotik sekaligus Ketua Dewan Pengawas RSJ MS bapak &quot;Drs. Tribudi Prayitno, M.Si&quot; yang sudah memfasilitasi kegiatan puncak HKJS Tahun ini, seluruh panitia dan pendukung acara dan masyarakt umum.<br />\r\nSukses Kesehatan Jiwa. Sukses RSJ. Mutiara Sukma dibawah kepemimpinan dr. Elly Rosila Wijaya, SpKJ., MM. (M.Sunarto/Dian G)</span></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.25.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.25%20%281%29.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.26.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.27.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.27%20%281%29.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2012.21.29.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-15%20at%2018.28.18.jpeg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/i