(182, 'Mobile klinik VCT', '13', '<p><span style=\"color:#000000\">Klinik VCT &quot;Balai Matahari&quot; RSJ Mutiara Sukma melakukan kegiatan mobile klinik ke lapas bima dan lapas dompu pada tanggal 15 s.d 20 Oktober 2017. Kegiatan mobile klinik ini bertujuan untuk melakukan screening HIV/AIDS dan penyuluhan.&nbsp;Selain di lapas bima dan lapas dompu, konselor&nbsp;RSJ Mutiara Sukma juga menyempatkan waktu untuk melakukan penyuluhan dan screening&nbsp;di Simpasae Dompu pada komunitas Gay dan Waria.</span></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-19%20at%2011.48.57.jpeg\" style=\"height:263px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-19%20at%2011.49.57.jpeg\" style=\"height:467px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-19%20at%2011.49.58.jpeg\" style=\"height:467px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-19%20at%2011.49.58%20%281%29.jpeg\" style=\"height:263px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-19%20at%2011.57.50.jpeg\" style=\"height:263px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-21%20at%2019.19.25.jpeg\" style=\"height:263px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-21%20at%2019.41.09.jpeg\" style=\"height:263px; width:350px\" /></p>\r\n', '2017-10-23'),
