(188, 'Penilaian Pembangunan Zona Integritas (PZI) TANGGAL 24 OKTOBER 2017', '13', '<p><span style=\"color:#000000\">&quot;RSJ Mutiara Sukma Berani Jujur..!!!Hebat...!!! Gratifikasi, Pungli, Korupsi NO...!!! Mempertahankan Akreditasi Paripurna&nbsp; Pasti Bisa... Pasti Bisa... Pasti Bisa...!!!!&quot;. Yel... Yel yang digaungkan oleh seluruh Civitas Hospitalia RSJ Mutiara Sukma Hari ini.&nbsp;<br />\r\nSelasa, 24 Oktober 2017 pada saat TIM PENILAI NASIONAL KEMENPAN RB datang melakukan Penilaian Pembangunan Zona Integritas (PZI)&nbsp; menuju WBK &amp; WBBM. Tinggal menunggu hasil keputusan pada 9 Desember 2017 nanti.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><br />\r\n<span style=\"color:#000000\">Pembangunan Zona Integritas yang merupakan amanah dalam reformasi birokrasi yang salah satu area perubahannya adalah perubahan pola pikir dan budaya kerja yang bertujuan untuk mewujudkan peningkatan integritas dan kinerja birokrasi yang tinggi. Integritas itu sendiri mempunyai makna bahwa individu suatu organisasi harus mengutamakan perilaku terpuji, tidak koruptif, disiplin dan penuh pengabdian sehingga dapat mendorong terwujudnya penyelenggaraan pemerintahan yang b</span><span style=\"color:rgb(0, 0, 0)\">ersih dan bebas dari praktek Korupsi, Kolusi dan Nepotisme. (Dian/Asih)</span></p>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0)\"><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-24%20at%2016.12.12.jpeg\" style=\"height:197px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-24%20at%2016.12.11.jpeg\" style=\"height:233px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-24%20at%2016.12.13.jpeg\" style=\"height:233px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-10-24%20at%2016.15.37.jpeg\" style=\"height:233px; width:350px\" /></span></p>\r\n', '2017-10-24'),
(189, 'Upacara Hari Pahlawan 10 November 2017', '11', '<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-11-10%20at%2012.02.46.jpeg\" style=\"height:600px; width:800px\" /></p>\r\n', '2017-11-10'),
(191, 'Hak dan Kewajiban Pasien dan Keluarga', '9', '<p style=\"text-align: center;\"><strong>HAK DAN KEWAJIBAN PASIEN</strong></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\"><strong>HAK PASIEN</strong></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Hak pasien dan keluarga berdasarkan UU No. 44 Tahun 2009 tentang Rumah Sakit:</span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">memperoleh informasi mengenai tata tertib dan peraturan yang berlaku di Rumah Sakit;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">memperoleh informasi tentang hak dan kewajiban pasien;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">memperoleh layanan yang manusiawi, adil, jujur, dan tanpa diskriminasi;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">memperoleh layanan kesehatan yang bermutu sesuai dengan standar profesi dan standar prosedur operasional;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">memperoleh layanan yang efektif dan efisien sehingga pasien terhindar dari kerugian fisik dan materi;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">mengajukan pengaduan atas kualitas pelayanan yang didapatkan;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">memilih dokter dan kelas perawatan sesuai dengan keinginannya dan peraturan yang berlaku di Rumah Sakit;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">meminta konsultasi tentang penyakit yang dideritanya kepada dokter lain yang mempunyai Surat Izin Praktik (SIP) baik di dalam maupun di luar Rumah Sakit;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">mendapatkan privasi dan kerahasiaan penyakit yang diderita termasuk data-data medisnya;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">mendapat informasi yang meliputi diagnosis dan tata cara tindakan medis, tujuan tindakan medis, alternatif tindakan, risiko dan komplikasi yang</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">mungkin terjadi, dan prognosis terhadap tindakan yang dilakukan serta perkiraan biaya pengobatan;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">memberikan persetujuan atau menolak atas tindakan yang akan dilakukan oleh tenaga kesehatan terhadap penyakit yang dideritanya;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">didampingi keluarganya dalam keadaan kritis;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">menjalankan ibadah sesuai agama atau kepercayaan yang dianutnya selama hal itu tidak mengganggu pasien lainnya;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">memperoleh keamanan dan keselamatan dirinya selama dalam perawatan di Rumah Sakit;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">mengajukan usul, saran, perbaikan atas perlakuan Rumah Sakit terhadap dirinya;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">menolak pelayanan bimbingan rohani yang tidak sesuai dengan agama dan kepercayaan yang dianutnya;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">menggugat dan/atau menuntut Rumah Sakit apabila Rumah Sakit diduga memberikan pelayanan yang tidak sesuai dengan standar baik secara perdata ataupun pidana; dan</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">mengeluhkan pelayanan Rumah Sakit yang tidak sesuai dengan standar pelayanan melalui media cetak dan elektronik sesuai dengan ketentuan peraturan perundang-undangan.</span></li>\r\n</ol>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\"><strong>KEWAJIBAN PASIEN:</strong></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">Mematuhi peraturan yang berlaku di Rumah Sakit;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">Menggunakan fasilitas rumah sakit secara bertanggungjawab;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">Menghormati hak-hak pasien lain, pengunjung dan hak Tenaga Kesehatan serta petugas lainnya yang bekerja di rumah sakit;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">Memberikan informasi yang jujur, lengkap dan akurat sesuai kemampuan dan pengetahuannya tentang masalah kesehatannya;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">Memberikan informasi mengenai kemampuan finansial dan jaminan kesehatan yang dimilikinya;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">Mematuhi rencana terapi yang direkomendasikan oleh Tenaga Kesehatan di rumah sakit dan disetujui oleh Pasien yang bersangkutan setelah mendapatkan penjelasan sesuai ketentuan peraturan perundang-undangan;</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">Menerima segala konsekuensi atas keputusan pribadinya untuk menolak rencana terapi yang direkomendasikan oleh Tenaga Kesehatan dan/atau tidak mematuhi petunjuk yang diberikan oleh Tenaga Kesehatan dalam rangka penyembuhan penyakit atau masalah kesehatannya; dan</span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"color:#000000\">Memberikan imbalan jasa atas pelayanan yang diterima.</span></li>\r\n</ol>\r\n', '2017-11-28'),
(192, 'Penilaian Pelayanan Publik Berprestasi Lingkup Pemerintah Provinsi Nusa Tenggara Barat', '13', '<p><span style=\"color:#000000\">Rabu, 29 November 2017. RSJ Mutiara Sukma Provinsi NTB sesuai jadwal akan dikunjungi oleh Tim Penilaian Pelayanan Publik Berprestasi Lingkup Pemerintah Provinsi Nusa Tenggara Barat yang diketuai oleh Dr. Nurhandini Eka Dewi, Sp.A.<br />\r\nTahun 2016 kemarin RSJ Mutiara Sukma meraih peringkat Pertama pada Kategori Badan Publik SKPD Pemprov. NTB pada peringkat Informasi Badan Publik.&nbsp;</span><br />\r\n&nbsp;</p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-11-29%20at%2021.42.06.jpeg\" style=\"height:233px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-11-29%20at%2021.42.06%20%281%29.jpeg\" style=\"height:233px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-11-29%20at%2021.42.07.jpeg\" style=\"height:233px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-11-29%20at%2021.42.07%20%281%29.jpeg\" style=\"height:233px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-11-29%20at%2021.42.08.jpeg\" style=\"height:233px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-11-29%20at%2021.42.09%20%281%29.jpeg\" style=\"height:233px; width:350px\" /></p>\r\n', '2017-11-30'),
(193, 'Agenda Direktur 2017', '11', '<p><img alt=\"\" src=\"/admin/images/berita/images/Untitled.png\" style=\"height:4085px; width:800px\" /></p>\r\n', '2017-12-08'),
(194, 'Rsj Mutiara Sukma Provinsi NTB Berhasil Meraih Penghargaan Pembangunan Zona Integritas (ZI)  Menuju Wilayah Bebas dari Korupsi (WBK)  dan Wilayah Birokrasi Bersih dan Melayani (WBBM)', '13', '<p><span style=\"color:#000000\">Alhamdulillah...Bersyukur...&nbsp;<br />\r\n.<br />\r\nDi penghujung tahun Rsj Mutiara Sukma Provinsi NTB Berhasil Meraih Penghargaan Pembangunan Zona Integritas (ZI)&nbsp; Menuju Wilayah Bebas dari Korupsi (WBK)&nbsp; dan Wilayah Birokrasi Bersih dan Melayani (WBBM).</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">Hari ini, Selasa 12 Desember 2017. Bertempat di Hotel Bidakara-Jakarta, Direktur RSJ Mutiara Sukma&nbsp; Provinsi NTB ibu dr. Elly Rosila Wijaya, Sp. KJ., MM( Elly Wijaya )bersama Ka. Sub. Bag.&nbsp; TU (Julastri Rondonuwu), Ketua TIM PZI menuju WBK dan WBBM (Muji Asih) serta Kaur Perencanaan (Kasmini Yakin) mewakili seluruh Civitas Hospitalia RSJ Mutiara Sukma.&nbsp;<br />\r\nMenerima Penghargaan Pembangunan Zona Integritas (ZI)&nbsp; menuju Wilayah Bebas dari Korupsi (WBK) dan Wilayah Birokrasi Bersih dan Melayani (WBBM) dari Menteri Pendayagunaan Aparatur Negara dan Reformasi Birokrasi dan Wakil Ketua KPK.<br />\r\nHasil ini dapat dicapai berkat kerja sama, ikhtiar dan doa seluruh citivitas hospital RSJ Mutiara Sukma Provinsi NTB serta dukungan semua pihak terkait. (<strong>dian</strong>)</span></p>\r\n\r\n<p><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-12-12%20at%206.44.14%20PM.jpeg\" style=\"height:197px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-12-12%20at%207.42.12%20PM.jpeg\" style=\"height:263px; width:350px\" /></span><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-12-12%20at%206.44.51%20PM.jpeg\" style=\"height:175px; width:350px\" /><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-12-12%20at%208.26.51%20PM.jpeg\" style=\"height:197px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-12-12%20at%208.26.51%20PM%20%281%29.jpeg\" style=\"height:197px; width:350px\" /></span></p>\r\n', '2017-12-13'),
(195, 'Upacara Peringatan Hari Ulang Tahun Provinsi Nusa Tenggara Barat', '13', '<p><span style=\"color:#000000\">NTB BERTASYAKUR</span></p>\r\n\r\n<p><span style=\"color:#000000\">Upacara Peringatan Hari Ulang Tahun Provinsi Nusa Tenggara Barat yang jatuh pada tanggal 17 Desember 2017 ke 59 diperingati dengan upacara bendera yang dipimpin langsung oleh Gubernur Nusa Tenggara Barat Dr. Zainul Majdi di Pelataran Bandara Udara Selaparang Mataram. Selain kegiatan upacara, kegiatan lainnya yakni kegiatan pameran dan NTB Expo sepanjang jalan Udayana hingga di Pelataran Masjid Hubbul Wathan Islamic Center Mataram.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">Warga Masyarakat wajib ber<span style=\"font-family:inherit\">syukur atas segala pencapaian dari tahun ke tahun. Pencapaian mengejar bahkan mendahului beberapa wilayah di Indonesia dengan prestasinya. Perubahan terjadi di segala lini yang terus berkembang menuju perbaikan atas inovasi yang kreatif tiada henti dari Pemerintahan dan masyarakat.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Pada penghujung tahun ini yang juga merupakan bagian akhir dalam penghidmatan Gubernur Dr. Zainul Majdi dalam mengemban amanah dalam 2 periode pemerintahannya. Selama periode tersebut menorehkan sangat banyak prestasi baik di kancah nasional maupun internasional, seperti:<br />\r\nPenurunan angka pengangguran, angka kemiskinan, indeks ketimpangan, meningkatnya IPM, pencapaian yang sangat progresif karena ikhtiar bersama hasil keterpaduan antara pemerintah &amp; masyarakat. Prestasi-prestasi tersebut mendapat ratusan penghargaan baik nasional maupun internasional pada hampir semua sektor.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pada kesempatan tersebut Gubernur selaku pimpinan daerah mengajak seluruh lapisan masyarakat mengapresiasi gelar pahlawan nasional untuk TGKH M. Zainuddin Abdul Madjid, dengan kerja dan kerja.&nbsp;<br />\r\nGubernur juga mengingatkan kita semua untuk fokus dalam mencapai indikator RPJMD dan mengajak masyarakat berpartisipasi dalam pilkada tahun 2018.</span></p>\r\n\r\n<p><span style=\"color:#000000\">RSJ. Mutiara Sukma yang merupakan salah satu SKPD di Lingkup Provinsi Nusa Tenggara Barat juga berpartisipasi pada acara puncak acara hari ulang tahun tersebut :<br />\r\n1. Pejabat struktural dan pegawai RSJMS mengikuti upacara dan defile sepanjang jalur bandara, jalan udayana berakhir di IC.<br />\r\n2. Mengisi stand rumpun kesehatan bersama Dinas Kesehatan dan RSUD Prov. NTB<br />\r\n3. Mengisi stand Setda Provinsi sebagai pemenang ke 2 Entebenovik tahun 2015 dengan website Makpasol.</span><br />\r\n<a href=\"https://www.facebook.com/hashtag/dirgahayuntb?source=feed_text&amp;story_id=201310043771499\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">dirgahayuntb</span></span></span></a><span style=\"color:#000000\">&nbsp;@ Islamic Center Mataram-NTB</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/25396176_201309793771524_4050416730325090236_n.jpg\" style=\"height:350px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/25446460_201309807104856_6999283051578326889_n.jpg\" style=\"height:351px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/25354019_201309880438182_8278430976805991290_n.jpg\" style=\"height:234px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/25399140_201309907104846_266320725055996218_n.jpg\" style=\"height:303px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/25395818_201309980438172_1869238988681201233_n.jpg\" style=\"height:197px; width:350px\" /><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202017-12-18%20at%202.07.38%20AM.jpeg\" style=\"height:233px; width:350px\" /></p>\r\n</div>\r\n', '2017-12-18'),
(196, 'RSJ. Mutiara Sukma kembali meraih penghargaan Anugerah Badan Publik Informatif Provinsi NTB Tahun 2017 Sebagai peringkat Kedua Kategori Badan Publik OPD Provinsi NTB', '13', '<p><span style=\"color:#000000\">RSJ. Mutiara Sukma kembali meraih penghargaan Anugerah Badan Publik Informatif Provinsi NTB Tahun 2017 Sebagai peringkat Kedua Kategori Badan Publik OPD Provinsi NTB pada Pemeringkatan Keterbukaan Informasi Badan Publik Provinsi NTB Tahun 2017. Penganugerahan tersebut digelar oleh Komisi Informasi Provinsi Nusa Tenggara Barat (KI NTB) pada Hari Rabu, tanggal 27 Desember 2017 bertempat di Hotel Lombok Raya Mataram.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">Keterbukaan publik merupakan hal penting agar partisipasi publik terwadahi dan dapat menumbuhkan kepercayaan publik kepada pemerintah. Saat ini masyarakat yg membutuhkan informasi tentang RSJ. Mutiara Sukma dapat mengakses melalui website&nbsp;</span><a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2Fwww.rsjmutiarasukma.ntbprov.go.id%2F&amp;h=ATP2WQHbhBFNExKhkARKrOO5R_FpJ70-DHnAKBGXTqHEthyOt9xqP5Uyt4oRuhsTvBGFthezUL3TiHLl14CoqY-VY7nV7GainsszN2u_2VjEZsyL3TGyxmX95QoFQSmPi5PSONXiigN_i8W922a7b1zAxx6HHRGBR1AtYGCHemTcrevJGnKGfC4FHGsOnhrgxBveZgj55s5RJJ46hvNf73c-Kmj1XcUd-EikGbLD6GKyevSwibqEXJuoea1MjokW49KD-y2WkleoiSFaAS4Ft2WKzju7qd-cnmfz7ox-aLD1\" target=\"_blank\"><span style=\"color:#000000\">www.rsjmutiarasukma.ntbprov.go.id</span></a><span style=\"color:#000000\">,&nbsp;</span><a href=\"http://www.makpasol.ntbprov.go.id/\" target=\"_blank\"><span style=\"color:#000000\">www.makpasol.ntbprov.go.id</span></a><span style=\"color:#000000\">, Facebook&nbsp;</span><a href=\"https://www.facebook.com/rsj.mutiarasukma.1\"><span style=\"color:#000000\">https://www.facebook.com/rsj.mutiarasukma.1</span></a><span style=\"color:#000000\">, Facebook Fanspage&nbsp;</span><a href=\"https://www.facebook.com/RSJ.Mutiara.SukmaNTB/\"><span style=\"color:#000000\">https://www.facebook.com/RSJ.Mutiara.SukmaNTB/</span></a><span style=\"color:#000000\">, Instagram&nbsp;</span><a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fwww.instagram.com%2Frsj_mutiara_sukma%2F&amp;h=ATMDXgfPHhjNOjOz-uYC82cXqftIGEMehc2sj2bm9FpuysECmhDR-GkMXonkcKoxaBNCmqgQWtwnngDHMX-SvFyBdkr3_4FTSpjR1KzyMt-f1SRBijDq5H0bPD7aueM4xTyBYdvgcgJlCW4IAquekjJ4n-g27ssHjWfh4ilf3zokNvsoGSIEKE0u403Zc341DXr44An9lveIXWFq281J8H4eDzwduGmdJVxy3wsnoW483_CPIBDPehp-2ymRg-gmEqpfXLUO6laRVfBPFJx1CbieitmQctA4Uy57m1AO4l0K\" target=\"_blank\"><span style=\"color:#000000\">https://www.instagram.com/rsj_mutiara_sukma/</span></a><span style=\"color:#000000\">, twitter&nbsp;</span><a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Ftwitter.com%2Fhotlinersjms&amp;h=ATPmfK9_QST2asu2pw9DmJ_0JhiZrhBIaUen6ywOGnUemH5uRj6qmVVCLTBuEAmiIv81_RzQOTPvR2QZNpZ4p9Bqa1ATwn7SFYaelo5QHvbe-IvvC8DnMBbN7KGdtr6BGKcd7ZKhUI2IZhCLoHsznOfB7NqXPr7SFVGyoPy2MjzEMW58K41sE08pp4PtIcCNKQbv8HBR-J_bDZKb95LsHKwz2MqSCwWGSi0oWbsdxYoFGFLcnKetws5_HyzM0qXyQ-HMIp2kZ_BYvvGBTJrsoC3CM0ISkWuG6cIBWxVCUy9x\" target=\"_blank\"><span style=\"color:#000000\">https://twitter.com/hotlinersjms</span></a><span style=\"color:#000000\">, HP/WA 0878-6517-8666 atau datang langsung ke Sekretariat PPID yang ada di kantor RSJ Mutiara Sukma.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pada kesempatan sebelumnya, juga diserahkan penghargaan dari Gubernur Nusa Tenggara berupa Penghargaan Pelayanan Publik Berprestasi Lingkup Provinsi Nusa Tenggara Barat Tahun 2017 Sebagai Juara 2 Kategori Pelayanan Langsung.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Penghargaan-penghargaan tersebut merupakan bukti keseriusan Civitas Hospitalia RSJ. Mutiara Sukma dalam memberikan pelayanan terbaik kepada masyarakat secara umum dan NTB secara khusus.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/semangattimppid?source=feed_text&amp;story_id=204306976805139\"><span style=\"color:#000000\">