(205, 'Jumpa Pers Organisasi Perangkat Daerah (RSJ Mutiara Sukma)', 'Tes', '<p><a href=\"https://www.facebook.com/photo.php?fbid=256040654965104&amp;set=pcb.256040968298406&amp;type=3&amp;theater\"><img alt=\"\" src=\"https://www.facebook.com/photo.php?fbid=256040654965104&amp;set=pcb.256040968298406&amp;type=3&amp;theater\" /></a><img alt=\"\" src=\"/admin/images/berita/images/33060906_256040698298433_4051195371869700096_n.jpg\" style=\"height:640px; width:960px\" />Jumpa Pers Organisasi Perangkat Daerah (RSJ Mutiara Sukma) Direktur RSJMS didampingi Plt. Kasi. Pelayanan Medik dan Kasi. Keperawatan di Media Centre Pemerintah Provinsi NTB.</p>\r\n\r\n<p>Dalam rangka publikasi capaian program dan kegiatan pembangunan daerah Provinsi Nusa Tenggara Barat 2 (dua) periode masa jabatan 2008-2013 dan 2013-2018, kepemimpinan Bapak Gubernur Nusa Tenggara Barat : DR. TGH. M. Zainul Majdi. Difasilitasi oleh Biro Humas dan Protokol Setda Provinsi NTB di Ruangan Med<span style=\"font-family:inherit\">ia Center Kantor Gubernur NTB dengan moderator Kabag Pemberitaan.</span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p>Hal yang disampaikan oleh Ibu Direktur sebagai berikut :</p>\r\n\r\n<p>1. Sejarah Singkat RSJ Mutiara Sukma<br />\r\n2. Laporan Kegiatan Pengentasan Pasung di NTB dengan menggunakan sistem Rujukan Komunikatif Tiga Pilar (RKTP) Rumah Sakit Jiwa Mutiara Sukma Provinsi NTB tahun 2011 sampai dengan 2017.<br />\r\n3. Langkah-langkah kecil yang dimulai oleh Tim Kesehatan Jiwa Masyarakat RSJMS yang dipimpin langsung oleh Direktur RSJ MS atas persetujuan Bapak Gubernur dengan dikeluarkannya Peraturan Guberur Nusa Tenggara barat, berawal dari :<br />\r\n&bull; 2010 pencanangan Indonesia Bebas Pasung<br />\r\n&bull; 2011 : Mengembangkan Sistem Rujukan Komunikatif Tiga Pilar (RSJ-Puskesmas-Keluarga)<br />\r\n&bull; 2011 &ndash; 2013 : melaksanakan pilot project&nbsp;<br />\r\n&bull; 2013 : Pencanangan NTB Bebas Pasung<br />\r\n&bull; 2016 : Launching MAKPasOL :&nbsp;<a href=\"https://l.facebook.com/l.php?u=http%3A%2F%2Fwww.makpasol.ntbprov.go.id%2F&amp;h=ATPaRFBCSHpb1WT4zsca0v7jsTpa-vVgMihNJY2RZV2ZOufgFtBfxmmgMNqXfBk-PGEqm-8aLQvUaAHFnpDUqUJAoaYKEdllXk-YsnLGyjJW8S-JkrxsxRrNariXRb3U6BH0y-0\" target=\"_blank\">www.makpasol.ntbprov.go.id</a>&nbsp;<br />\r\n&bull; 2018 : Launching aplikasi android MAKPasOL.</p>\r\n\r\n<p>4. Peningkatan Kualitas pelayanan dan sarana prasarana RSJ Mutiara Sukma yang sudah terakreditasi paripurna.</p>\r\n\r\n<p>Prestasi RSJ. Mutiara Sukma, sejak tahun2014 s.d 2017.</p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/salamsehatjiwa?source=feed_text\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">SalamSehatJiwa</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ayopeduliodgj?source=feed_text\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">AyoPeduliODGJ</span></span></a></p>\r\n</div>\r\n', '2018-05-25'),
(206, 'Pelatihan SIMRS Khanza di RSJ Mutiara Sukma', '13', '<p style=\"text-align: justify;\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/img_2825.jpg\" style=\"border-style:solid; border-width:1px; float:left; height:267px; margin:10px; width:400px\" /> Bahwa sesuai amanat Undang-Undang Nomor 44 Tahun 2009 tentang Rumah Sakit, Pasal 52 ayat (1), setiap rumah sakit wajib melakukan pencatatan dan pelaporan semua kegiatan penyelenggaraan rumah sakit dalam bentuk sistem informasi manajemen rumah sakit, dan Peraturan Menteri Kesehatan nomor 82 Tahun 2013 tentang Sistem Informasi Manajemen Rumah Sakit, pasal 3 ayat (1) setiap rumah sakit wajib menyelenggarakan Sistem Informasi Manajemen Rumah Sakit (SIMRS).</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<span style=\"color:#000000\">Untuk melaksanakan amanat undang-undang tersebut, Selama 3 hari, sejak tanggal 9 &ndash; 11 Juli tahun 2018 RSJ Mutiara Sukma mengadakan pelatihan Sistem Informasi Manajemen Rumah Sakit (SIMRS). Bahwa sesuai pasal 3 ayat (1) Peraturan Menteri Kesehatan nomor 82 Tahun 2013 tentang Sistem Informasi Manajemen Rumah Sakit, setiap rumah sakit wajib menyelenggarakan Sistem Informasi Manajemen Rumah Sakit (SIMRS)Bahwa sesuai ketentuan Pasal 52 ayat (1) UndangUndang Nomor 44 Tahun 2009 tentang Rumah Sakit,&nbsp; setiap rumah sakit wajib melakukan pencatatan dan pelaporan semua kegiatan penyelenggaraan rumah sakit dalam bentuk sistem informasi manajemen rumah sakit;<br />\r\nBahwa sesuai pasal 3 ayat (1) Peraturan Menteri Kesehatan nomor 82 Tahun 2013 tentang Sistem Informasi Manajemen Rumah Sakit, setiap rumah sakit wajib menyelenggarakan Sistem Informasi Manajemen Rumah Sakit (SIMRS).<br />\r\nPelatihan ini diperuntukkan bagi pegawai yang nantinya akan menjadi operator SIMRS. Pemateri dalam acara ini adalah pemilik dan pengembang langsung dari SIMRS yang akan digunakan di RSJ MS yaitu bapak Windiarto Nugroho S.Kom dari Jogjakarta. SIMRS yang dikembangkan adalah SIMRS yang bisa didapatkan secara gratis dan pengembangannya bersifat terbuka (open source). SIMRS ini diberi nama SIMRS Khanza.<br />\r\nAcara ini dihadiri oleh perwakilan dari setiap unit pelayanan, mulai dari pendaftaran, Instalasi Rawat Jalan, Instalasi Rawat Inap, Instalasi Penunjang serta dari IGD. Masing-masing unit mengirimkan 2 orang peserta untuk mengikuti pelatihan ini, sehingga total peserta lebih kurang 48 orang.<br />\r\nAdapun tujuan diadakannya pelatihan SIMRS ini antara lain:<br />\r\n&nbsp;&nbsp;&nbsp; 1. Untuk mengetahui SIMRS Khanza dan meningkatkan pemahaman tentang penggunaan SIMRS di Rumah Sakit.<br />\r\n&nbsp;&nbsp;&nbsp; 2. Untuk meningkatkan kompetensi SDM operator SIMRS.<br />\r\n&nbsp;&nbsp;&nbsp; 3. Untuk mendapatkan tenaga trampil, terlatih dan siap pakai dalam mengoperasikan SIMRS Khanza<br />\r\nPelaksanaan pelatihan ini dibagi menjadi 2 (dua) sesi, sesi pertama adalah pengenalan dan pembahasan tentang SIMRS Khanza. Kemudian dilanjutkan Sesi kedua, yaitu Praktek penggunaan SIMRS Khanza oleh operator yang dibimbing langsung oleh bapak Windiarto Nugroho, S.Kom. Acara ini ditutup pada tanggal 11 Juli 2018 oleh Kepala Sub Bagian TU.</span></p>\r\n', '2018-07-19'),
(207, 'Pelayanan Paripurna Tanpa Uang Muka/Jaminan  Pada Semua Unit Di Rumah Sakit Jiwa Mutiara Sukma', '20', '<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-07-26%20at%2015.36.22.jpeg\" style=\"height:1280px; width:927px\" /></p>\r\n', '2018-07-26');
