(209, 'Kegiatan Pelatihan Lima Kemampuan Dasar Pegawai  RSJ Mutiara Sukma', '13', '<p style=\"text-align: justify;\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-07-25%20at%2006.11.36.jpeg\" style=\"border-style:solid; border-width:1px; float:left; height:267px; margin-left:10px; margin-right:10px; width:390px\" />Rumah Sakit Jiwa Mutiara Sukma dalam upayanya mempertahankan mutu pelayanan serta akreditasi paripurna versi 2012, terus berusaha meningkatkan berbagai aspek penting yang dapat mendukung dan meningkatkan mutu pelayanan rumah sakit baik dalam hal persiapan dokumen-dokumen terkait, implementasinya dilapangan maupun kualitas sumber daya manusianya, oleh karena itu untuk mematangkan seluruh aspek yang berada di RS Jiwa Mutiara Sukma dalam menghadapi <em>resurvey</em> akreditasi pada bulan September 2018</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">yang akan datang maka diadakan kegiatan pelatihan lima kemampuan dasar pegawai di RSJ Mutiara Sukma yang meliputi Bantuan Hidup Dasar (BHD), pengetahuan tentang Penanganan Pencegahan dan Pengendalian Infeksi (PPI) (<em>hand hygiene,</em> etika batuk, membuang dan memilah sampah yang benar), Pengetahuan tentang Kesehatan dan Keselamatan Kerja Rumah Sakit (K3RS) (manajemen kebakaran/bencana), <em>Service excellent</em> serta profil RS Jiwa Mutiara Sukma. Dimana kegiatan tersebut akan melibatkan seluruh civitas hospitalia di lingkungan RSJ Mutiara SukmaJumlah Peserta 392 orang yamg terdiri dari 223 orang PNS, 95 orang pegawai (BLUD) non PNS, 71 orang pegawai pihak ketiga meliputi <em>cleaning service </em>dan<em> security</em><em> </em>dan 3 orang petugas kantin. Pelatihan ini dijadwalkan 3 (tiga) gelombang agar tidak mengganggu pelayanan yaitu untuk gelombang 1: Hari Kamis - Jum&rsquo;at , Tanggal 19 - 20 Juli 2018, Pukul 08.00 &ndash; 16.00 Wita, gelombang 2 : Hari Senin - Selasa, Tanggal 23 - 24 Juli 2018, Pukul 08.00 &ndash; 16.00 Wita dan gelombang 3 : Hari Rabu - Kamis, Tanggal 25 - 26 Juli 2018, Pukul 08.00 &ndash; 16.00 Wita.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">#RSJMutiaraSukma :Yes..Yes..Yes.. </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\">#PertahankanAkreditasiParipurna : Pasti Bisa!!! </span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', '2018-07-27'),
