(212, 'Dirgahayu Indonesia Ke 73 Th', '13', '<p>Direktur&nbsp;<a href=\"https://www.facebook.com/rsj.mutiarasukma.1?fref=mentions&amp;__xts__%5B0%5D=68.ARCXPN3esAkyE6WPRI9_BySLe62pBDERfmedoHfh8Px_QUDKArOaMOma-hBl4FMaYOyASOG9yW0ugOzDVtFDgW7FG2sfuEVmtNhVF6nMNf4USk1pGyHuJ0iRFEVusCLLZDzCaqw&amp;__tn__=K-R\">Rsj Mutiara Sukma</a>&nbsp;dan Segenap Civitas Hospitalia Mengucapkan<br />\r\nDirgahayu Indonesia Ke 73 Th</p>\r\n\r\n<p>Aku Cinta Indonesia.<br />\r\nNegeri ini adalah negeri yang elok.<br />\r\n<span style=\"font-family:inherit\">Penuh warna dan keindahan.<br />\r\nNegeri ini adalah negeri yang makmur.<br />\r\nTanah tumpah darahku yang mulia.<br />\r\nJayalah Negeriku... INDONESIA....!!!!!</span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p>Insyaallah NTB Akan Selalu Maju dalam Keberkahan&nbsp;<br />\r\nAmin</p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/pkrs?source=feed_text&amp;__xts__%5B0%5D=68.ARCXPN3esAkyE6WPRI9_BySLe62pBDERfmedoHfh8Px_QUDKArOaMOma-hBl4FMaYOyASOG9yW0ugOzDVtFDgW7FG2sfuEVmtNhVF6nMNf4USk1pGyHuJ0iRFEVusCLLZDzCaqw&amp;__tn__=K-R\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">pkrs</span></span></a></p>\r\n</div>\r\n', '2018-08-17'),
(213, 'Memberikan Dukungan Kesehatan Jiwa dan Psikososial', '13', '<p>Selamat Siang<br />\r\nKegiatan Tim Rsj Mutiara Sukma pagi ini turun ke kampung Bangsal Kelurahan Tanjung Karang Kecamatan Sekarbela Kota Mataram.<br />\r\nUntuk Memberikan Dukungan Kesehatan Jiwa dan Psikososial.<br />\r\nIkut Turun hari ini Tim IPKJI NTB RSJMS, Dokter dan Perawat RSJ Soeharto Werdjan Grogol Jakarta.<br />\r\nSerta Duta Pariwisata Kota Mataram Arul Zain Lombok.</p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p>Acara dimulai dengan<br />\r\nSambutan Lurah Tanjung Karang<br />\r\nIce Breaking Spirit oleh Ns Arul Zain<br />\r\nTerapi Relaksasi oleh Ns Nengah Dartha Yasa Ketut Budiasa<br />\r\nDilanjutkan dengan Terapi Dan Konseling untuk Anak anak dan Remaja<br />\r\nOrangtua<br />\r\nLansia.</p>\r\n\r\n<p>Acara berlangsung meriah diikuti dengan antusias oleh warga bangsal.</p>\r\n\r\n<p>STOP TAKUT<br />\r\nJANGAN PANIK<br />\r\nTETAP WASPADA</p>\r\n\r\n<p>Salam Sehat Jiwa<br />\r\n<a href=\"https://www.facebook.com/hashtag/pkrs?source=feed_text&amp;__xts__%5B0%5D=68.ARBOqoz8-vnWOPvCr_hN8-McVVh70v6lbSjKRVNJZC3GN339KA42X5pM087gNQpWreKsCAB-FVfP1w8WuMDnuM2U-JAbC5tZ_qCl6OymLwuj6pWh4YUBpeYg0zGQlhXzDhrhxi4&amp;__tn__=K-R\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">PKRS</span></span></a></p>\r\n</div>\r\n', '2018-08-27'),
(214, 'Pelayanan kepada pengunjung tetap dilakukan melalui Tenda Tenda', '13', '<p>Selamat Pagi<br />\r\nSelamat datang di&nbsp;<a href=\"https://www.facebook.com/rsj.mutiarasukma.1?fref=mentions&amp;__xts__%5B0%5D=68.ARDpgyEWJqBKHowzhnXfCP2O_SGubQVjY-BJQgCynjgCr49dxRhGq0aVaqgbedQW_-XKW_n2NEAhon2IC2hwvtUyOqjCJ2RoewHqPISMY0jDLj2g_Zv0q1pqlr7FK-M5xeEeRjs&amp;__tn__=K-R\">Rsj Mutiara Sukma</a><br />\r\nPelayanan kepada pengunjung tetap dilakukan melalui Tenda Tenda.<br />\r\nLoket Pendaftaran Poliklinik 07.30 - 11.00 Senin sd Jumat<br />\r\nSabtu Libur</p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p>Tenda 1 Tenda TNI :<br />\r\nKasir Penerima<br />\r\nApotik<br />\r\nLaboratorium khusus Tes Urine narkoba</p>\r\n\r\n<p>Terop Parkir :<br />\r\nRekam Medik<br />\r\nVerifikasi<br />\r\nPoliklinik</p>\r\n\r\n<p>Tenda 3 Terpal Biru dilapangan :<br />\r\nPoli Anak&nbsp;<br />\r\nRuang Anggrek khusus konsultasi Rehabilitasi Ketergantungan Narkoba</p>\r\n\r\n<p>Tenda 4 Warna Orange diBelakang&nbsp;<br />\r\nDireksi dan Manajemen<br />\r\nKantor<br />\r\nStaff&nbsp;<br />\r\nKaInstlasi</p>\r\n\r\n<p>Tenda 5 Warna Biru dan TNI :<br />\r\nIGD&nbsp;<br />\r\nRuang Rawat Inap</p>\r\n\r\n<p>Tidak ada Kesehatan Tanpa Sehat Jiwa<br />\r\n<a href=\"https://www.facebook.com/hashtag/pkrs?source=feed_text&amp;__xts__%5B0%5D=68.ARDpgyEWJqBKHowzhnXfCP2O_SGubQVjY-BJQgCynjgCr49dxRhGq0aVaqgbedQW_-XKW_n2NEAhon2IC2hwvtUyOqjCJ2RoewHqPISMY0jDLj2g_Zv0q1pqlr7FK-M5xeEeRjs&amp;__tn__=K-R\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">PKRS</span></span></a></p>\r\n</div>\r\n', '2018-08-27'),
(215, 'Pelayanan Dukungan Kesehatan Jiwa dan Psikososial kepada Karyawan Diskominfotik NTB', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/40564476_331449924090843_3210651460085743616_n.jpg\" style=\"height:300px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/40589427_331450040757498_1175816021051703296_n.jpg\" style=\"height:300px; width:400px\" /></p>\r\n\r\n<p>Pagi ini<br />\r\nKegiatan Tim&nbsp;<a href=\"https://www.facebook.com/rsj.mutiarasukma.1?fref=mentions&amp;__xts__%5B0%5D=68.ARBJy1Jf8wdT6fSZSxIXWw7Y_oVsFzOh2zSQtx_AWJehiM5ozjYaNRQhfnYb7_yXcBDMRGzvXw740v-XWr3IuiFuwMj5q4ddPFBjUzIjma0WgSP4rARpBPuH_YXh_tU7dRQpVGsjOP7VEbn4lSdtRFzFEw0TxcpqDG4RXMLA1yLSmTrjvHlk&amp;__tn__=K-R\">Rsj Mutiara Sukma</a>&nbsp;memberikan Pelayanan Dukungan Kesehatan Jiwa dan Psikososial kepada Karyawan Diskominfotik NTB</p>\r\n\r\n<p>Kegiatan dihadiri oleh Kepala Diskominfotik NTB Bapak&nbsp;<a href=\"https://www.facebook.com/tri.budiprayitno?fref=mentions&amp;__xts__%5B0%5D=68.ARBJy1Jf8wdT6fSZSxIXWw7Y_oVsFzOh2zSQtx_AWJehiM5ozjYaNRQhfnYb7_yXcBDMRGzvXw740v-XWr3IuiFuwMj5q4ddPFBjUzIjma0WgSP4rARpBPuH_YXh_tU7dRQpVGsjOP7VEbn4lSdtRFzFEw0TxcpqDG4RXMLA1yLSmTrjvHlk&amp;__tn__=K-R\">Tri Budiprayitno</a>&nbsp;dan Sekretaris Diskominfotik NTB Bapak Fairuz</p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p>Kegiatan diikuti oleh seluruh Karyawan dengan semangat Antusias sampai kegiatan selesai.</p>\r\n\r\n<p>Salam Sehat Jiwa<br />\r\nAyo Bangkit<br />\r\nLombok Bangkit<br />\r\nBangun NTB Kembali.<br />\r\n<a href=\"https://www.facebook.com/hashtag/pkrs?source=feed_text&amp;__xts__%5B0%5D=68.ARBJy1Jf8wdT6fSZSxIXWw7Y_oVsFzOh2zSQtx_AWJehiM5ozjYaNRQhfnYb7_yXcBDMRGzvXw740v-XWr3IuiFuwMj5q4ddPFBjUzIjma0WgSP4rARpBPuH_YXh_tU7dRQpVGsjOP7VEbn4lSdtRFzFEw0TxcpqDG4RXMLA1yLSmTrjvHlk&amp;__tn__=%2ANK-R\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">pkrs</span></span></a></p>\r\n</div>\r\n', '2018-09-03'),
(216, 'bantuan dari Badan Penanggulangan Bencana Daerah (BPBD) Provinsi NTB', '13', '<p>&nbsp;<img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-09-18%20at%2013.20.58.jpeg\" style=\"width:400px\" />&nbsp;<img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-09-18%20at%2013.20.57.jpeg\" style=\"height:225px; width:400px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Hari ini telah diserah terimakan 10 unit MCK darurat bantuan dari Badan Penanggulangan Bencana Daerah (BPBD) Provinsi NTB kepada RSJ Mutiara Sukma, MCK Darurat tersebut difungsikan untuk Pasien dan Pengunjung Rawat Inap serta Rawat Jalan di RSJ Mutiara Sukma. Terimakasih Kasih sebesar-besarnya kami sampaikan kepada Badan Penganggulangan Bencana Daerah (BPBD) Provinsi NTB atas bantuannya tersebut, sehingga kami bisa memberikan pelayanan kepada pasien lebih baik lagi.</span></p>\r\n', '2018-09-18'),
(217, 'Homevisit Pelayanan Kesehatan Jiwa, DKJPS dan ACT', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/42503897_339425643293271_9116757324931792896_n.jpg\" style=\"height:300px; width:400px\" /></p>\r\n\r\n<p>Selamat Pagi<br />\r\nSalam Sehat Jiwa</p>\r\n\r\n<p>Tim Rsj Mutiara Sukma pagi ini Berada di Puskesmas Batuyang Lombok Timur.<br />\r\nKami hadir untuk memberikan Homevisit Pelayanan Kesehatan Jiwa, DKJPS dan ACT.</p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p>Anggota Tim hari ini adalah:</p>\r\n\r\n<p>Dr Qomarul Islamiyyah,Sp.Kj<br />\r\nDr Gede Mahartyke S<br />\r\nNs Lindawati<br />\r\nNs Dwi WanTi<br />\r\nNs Harti<br />\r\nNs Arul Zain Lombok.</p>\r\n\r\n<p>Tidak ada Kesehatan Tanpa Kesehatan Jiwa.</p>\r\n</div>\r\n', '2018-09-25'),
(218, 'Dukungan Kesehatan Jiwa Psikososial/ DKJPS Home Visit dan ACT', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/42465230_339642556604913_3353718396968501248_n.jpg\" style=\"height:300px; width:400px\" /></p>\r\n\r\n<p>Pagi ini<br />\r\nTim&nbsp;<a href=\"https://web.facebook.com/rsj.mutiarasukma.1?fref=mentions&amp;__xts__%5B0%5D=68.ARAQsv086ccXsi5RwF0VXX7ZNmV2ewfZq0EZZbPUpoFIyXQ9UAYYBkLuw1QvosTv-z8WOD_pnSdhD0Y7YEGKMVfMP4kkULnBIdIWDKYzdv9zaE45-2nUxzk6IJyHygVubMRfcc_uQa4kgSIrtY8WIvaqj_Wdn5Q31aBanwEumkYHFIlpDR9d&amp;__tn__=K-R\">Rsj Mutiara Sukma</a>&nbsp;meluncur ke Puskesmas Sambelia untuk kegiatan Dukungan Kesehatan Jiwa Psikososial/ DKJPS<br />\r\nHome Visit dan ACT.</p>\r\n\r\n<p>Tim yang turun hari ini&nbsp;<br />\r\n<span style=\"font-family:inherit\">Psikiater Dr&nbsp;<a href=\"https://web.facebook.com/dr.diat?fref=mentions&amp;__xts__%5B0%5D=68.ARAQsv086ccXsi5RwF0VXX7ZNmV2ewfZq0EZZbPUpoFIyXQ9UAYYBkLuw1QvosTv-z8WOD_pnSdhD0Y7YEGKMVfMP4kkULnBIdIWDKYzdv9zaE45-2nUxzk6IJyHygVubMRfcc_uQa4kgSIrtY8WIvaqj_Wdn5Q31aBanwEumkYHFIlpDR9d&amp;__tn__=K-R\">I Putu Diatmika KarDia</a>,SpKj.<br />\r\nDr Gede Mahartyke S<br />\r\nNs&nbsp;<a href=\"https://web.facebook.com/lindawati.keswa?fref=mentions&amp;__xts__%5B0%5D=68.ARAQsv086ccXsi5RwF0VXX7ZNmV2ewfZq0EZZbPUpoFIyXQ9UAYYBkLuw1QvosTv-z8WOD_pnSdhD0Y7YEGKMVfMP4kkULnBIdIWDKYzdv9zaE45-2nUxzk6IJyHygVubMRfcc_uQa4kgSIrtY8WIvaqj_Wdn5Q31aBanwEumkYHFIlpDR9d&amp;__tn__=K-R\">Lindawati Keswa</a><br />\r\nNs&nbsp;<a href=\"https://web.facebook.com/dwi.wanti.12?fref=mentions&amp;__xts__%5B0%5D=68.ARAQsv086ccXsi5RwF0VXX7ZNmV2ewfZq0EZZbPUpoFIyXQ9UAYYBkLuw1QvosTv-z8WOD_pnSdhD0Y7YEGKMVfMP4kkULnBIdIWDKYzdv9zaE45-2nUxzk6IJyHygVubMRfcc_uQa4kgSIrtY8WIvaqj_Wdn5Q31aBanwEumkYHFIlpDR9d&amp;__tn__=K-R\">Dwi WanTi</a><br />\r\nNs&nbsp;<a href=\"https://web.facebook.com/harty.hadiarwati?fref=mentions&amp;__xts__%5B0%5D=68.ARAQsv086ccXsi5RwF0VXX7ZNmV2ewfZq0EZZbPUpoFIyXQ9UAYYBkLuw1QvosTv-z8WOD_pnSdhD0Y7YEGKMVfMP4kkULnBIdIWDKYzdv9zaE45-2nUxzk6IJyHygVubMRfcc_uQa4kgSIrtY8WIvaqj_Wdn5Q31aBanwEumkYHFIlpDR9d&amp;__tn__=K-R\">Harty Hadiarwati</a><br />\r\nPKRS&nbsp;<a href=\"https://web.facebook.com/radensasaca?fref=mentions&amp;__xts__%5B0%5D=68.ARAQsv086ccXsi5RwF0VXX7ZNmV2ewfZq0EZZbPUpoFIyXQ9UAYYBkLuw1QvosTv-z8WOD_pnSdhD0Y7YEGKMVfMP4kkULnBIdIWDKYzdv9zaE45-2nUxzk6IJyHygVubMRfcc_uQa4kgSIrtY8WIvaqj_Wdn5Q31aBanwEumkYHFIlpDR9d&amp;__tn__=K-R\">Arul Zain Lombok</a></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p>Bagi bapak ibu yg berada di wilayah Puskesmas Sambelia bisa bertemu Tim RSJ untuk konsultasi kesehatan Jiwa.</p>\r\n</div>\r\n', '2018-09-25'),
(219, 'Indeks Kepuasan Masyarakat 2016', '11', '<h3>&nbsp;</h3>\r\n\r\n<div style=\"margin-left:10px;\">\r\n<div class=\"Section1\">\r\n<p style=\"margin-left:21.3pt; margin-right:0cm; text-align:center\"><strong><u><span style=\"color:black; font-family:times new roman,serif; font-size:12.0pt\">INDEKS KEPUASAN MASYARAKAT DI RSJ MUTIARA SUKMA</span></u></strong></p>\r\n\r\n<p style=\"margin-left:21.3pt; margin-right:0cm; text-align:justify\"><span style=\"color:black; font-family:times new roman,serif; font-size:12.0pt\">Nilai indeks kepuasan masyarakat kumulatif di RSJ Mutiara Sukma diperoleh melalui penggabungan nilai IKM Instalasi Rawat Jalan, Rawat Inap, dan Gawat Darurat. Berikut akan ditampilkan hasil penilaian masyarakat terhadap pelayanan di RSJ Mutiara sukma. </span></p>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/distribusi%20ikm.jpg\" style=\"height:469px; width:703px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/nilai%20ikm.jpg\" style=\"height:629px; width:700px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', '2018-09-26'),
(220, 'Penyerahan Bantuan Hunian Sementara Secara Simbolis Bagi Pegawai RSJ Mutiara Sukma yang terdampak gempa.', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/IMG_2713.JPG\" style=\"height:267px; width:350px\" />&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/IMG_2717.JPG\" style=\"height:267px; width:350px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-01%20at%2008.50.45.jpeg\" style=\"height:197px; width:350px\" />&nbsp;<img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-01%20at%2008.52.03.jpeg\" style=\"height:197px; width:350px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Jum&#39;at, 28 September 2018</span></p>\r\n\r\n<p><span style=\"color:#000000\">ibu direktur beserta jajaran manajemen menyerahkan secara simbolis bantuan hunian sementara bagi pegawai RSJ Mutiara Sukma yang terdampak gempa.</span></p>\r\n', '2018-10-01'),
(221, 'Tupoksi PPID', '22', '<p style=\"text-align: center;\"><span style=\"color:#000000\"><span style=\"font-size:18px\">TUGAS POKOK DAN FUNGSI PEJABAT PENGELOLA INFORMASI DAN INFORMASI<br />\r\nRUMAH SAKIT JIWA MUTIARA SUKMA</span></span></p>\r\n\r\n<p><br />\r\n<span style=\"color:#000000\"><span style=\"font-size:16px\">PPID mempunyai tugas dan wewenang sebagai berikut :</span><br />\r\n&nbsp;&nbsp;&nbsp; 1. Mengkoordinasikan dan mengkonsolidasikan pengumpulan bahan informasi dan dokumentasi<br />\r\n&nbsp;&nbsp;&nbsp; 2. Menyimpan, mendokumentasikan, menyediakan dan memberi pelayanan informasi kepada publik<br />\r\n&nbsp;&nbsp;&nbsp; 3. Melakukan verifikasi bahan informasi publik<br />\r\n&nbsp;&nbsp;&nbsp; 4. Melakukan uji konsekuensi atas informasi yang dikecualikan<br />\r\n&nbsp;&nbsp;&nbsp; 5. Menyediakan informasi dan dokumentasi untuk diakses oleh masyarakat</span></p>\r\n\r\n<p><br />\r\n<span style=\"color:#000000\"><span style=\"font-size:18px\">Kewenangan PPID terdiri atas :</span><br />\r\n&nbsp;&nbsp;&nbsp; 1. Menolak memberikan informasi yang dikecualikan sesuai dengan ketentuan peraturan perundang-undangan<br />\r\n&nbsp;&nbsp;&nbsp; 2. Mengkoordinasikan pemberian pelayanan informasi dengan unit terkait<br />\r\n&nbsp;&nbsp;&nbsp; 3. Menentukan atau menetapkan suatu informasi dapat/tidaknya diakses oleh publik</span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '2018-10-02'),
(222, 'Profil PPID', '22', '<p style=\"text-align: center;\"><span style=\"color:#000000\"><span style=\"font-size:18px\">PROFIL PEJABAT PENGELOLA INFORMASI DAN DOKUMENTASI<br />\r\nRUMAH SAKIT JIWA MUTIARA SUKMA</span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">&nbsp;&nbsp; &nbsp;<br />\r\nKeberadaan Undang-undang tentang keterbukaan informasi publik sangat penting sebagai landasan hukum yang berkaitan dengan (1) hak setiap orang untuk memperoleh informasi (2) kewajiban badan publik menyediakan dan melayani permintaan informasi secara cepat, tepat dan sederhana (3) pengecualikan bersifat ketat dan terbatas (4) kewajiban badan publik untuk membenahi sistem dokumentasi dan pelayanan informasi.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Hak atas informasi menjadi sangat penting karena makin terbuka penyelenggaraan negara untuk diawasi oleh publik, penyelenggara negara makin dapat dipertanggungjawabkan. Hak setiap&nbsp; orang untuk memperoleh informasi juga relevan untuk meningkatkan kualitas pelibatan masyarakat dalam proses pengambilan keputusan publik. Partisipasi dan pelibatan masayarakat tidak banyak berarti tanpa jaminan keterbukaan informasi.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Transparansi dan akuntabilitas badan publik membuka peluang partisipasi masyarakat dalam pembangunan. Bagi badan publik keterbukaan informasi dapat menciptakan tata pemerintahan yang dan menjadi alat efektif dalam pencegahan Korupsi Kolusi Nepotisme (KKN).</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Sesuai dengan amanat Undang-undang No. 14 Tahun 2008, Rumah Sakit Jiwa Mutiara Sukma sebagai salah satu Organisasi Perangkat Daerah (OPD) telah membentuk Pejabat Pengelola Informasi dan Dokuemntasi (PPID) dengan Surat Keputusan Direktur Rumah Sakit Jiwa Mutiara Sukma Nomor : 188/1089/RSJP/2014. Dengan Terbentuknya PPID pemohon informasi sesuai dengan haknya dapat memperoleh layanan informasi publik yang dihasilkan oleh Rumah Sakit Jiwa Mutiara Sikma</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Pejabat Pengelola Informasi dan Dokuementasi (PPID) Rumah Sakit Jiwa Mutiara Sukma beralamat : Jalan Ahmad Yani No. 1 Selagalas Mataram Kode Post 83237 Telp. (0370) 672140 Fax. 671515 Email : rsjmutiarasukma@gmail.com.&nbsp; Website : rsjmutiarasukma.ntbprov.go.id.</span></p>\r\n', '2018-10-02'),
(223, 'Visi-Misi PPID', '22', '<p style=\"text-align:center\"><span style=\"color:#000000\">VISI DAN MISI PPID </span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#000000\">RUMAH SAKIT JIWA MUTIARA SUKMA</span></p>\r\n\r\n<p><span style=\"color:#000000\">V I S I</span></p>\r\n\r\n<p style=\"margin-left:0.3in\"><span style=\"color:#000000\">Terwujudnya pelayanan informasi yang transparan dan akuntabel untuk memenuhi hak pemohon informasi.</span></p>\r\n\r\n<p><span style=\"color:#000000\">M I S I</span></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><span style=\"color:#000000\">Meningkatkan pengelolaan dan pelayanan informasi publik</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"color:#000000\">Membangun dan mengembangkan system penyediaan dan pelayanan informasi publik</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"color:#000000\">Meningkatkan pengelolaan dokumentasi dan informasi publik.</span></p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n', '2018-10-02'),
(224, 'Peringatan Hari Kesehatan Jiwa Sedunia Tahun 2018', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/IMG_2771.JPG\" style=\"height:233px; width:350px\" /></p>\r\n\r\n<p>&nbsp;<img alt=\"\" src=\"/admin/images/berita/images/IMG_2793.JPG\" style=\"height:233px; width:350px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Dalam rangka memeriahkan Peringatan Hari Kesehatan Jiwa Sedunia Tahun 2018, dengan tema &quot;<em>Young People and Health in a changing world</em>&quot;. Panitia penyelenggara mengadakan beberapa kegiatan. Salah satunya lomba kebugaran bagi karyawan RSJ Mutiara Sukma yang berusia di atas 45 tahun.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Yang dilaksanakan pagi tadi,&nbsp; jumat 5 Oktober&nbsp; 2018</span></p>\r\n\r\n<p><span style=\"color:#000000\">Dan di buka langsung oleh Direktur RSJ Mutiara Sukma (Dr. Elly Rosila Wijaya,&nbsp; Sp. KJ., MM)</span></p>\r\n', '2018-10-05'),
