(231, 'Rapat persiapan seleksi penerimaan pegawai non pns (BLUD RSJ Mutiara Sukma', '13', '<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-11%20at%209.01.12%20PM.jpeg\" style=\"height:774px; width:1032px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-11%20at%209.01.13%20PM.jpeg\" style=\"height:774px; width:1032px\" /></p>\r\n', '2018-10-12'),
(232, 'Kegiatan DKJPS di 6 titik sma/smk dalam rangkaian kegiatan HKJS 2018', '13', '<div class=\"_5pbx userContent _3576\" id=\"js_au\" style=\"font-size: 14px; line-height: 1.38; margin-top: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); background-color: rgb(255, 255, 255);\">\r\n<div class=\"text_exposed_root text_exposed\" id=\"id_5bc1eed0399668535072686\" style=\"display: inline; font-family: inherit;\">\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/persiapan.JPG\" style=\"height:233px; width:350px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Rangkaian Hari Kesehatan Jiwa Sedunia 10 Oktober 2018 dengan tema &quot;Young People and Mental Health in a Changing World&quot; masih berlanjut hingga hari ini. Secara serempak kegiatan dilaksanakan di 6 lokasi sekolah SMA/SMK yang terdampak langsung bencana gempa Lombok di Wilayah Kabupaten Lombok Barat. Kegiatan dilaksanakan pada pukul 08.00 wita hingga pukul 10.00 wita.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Keenam sekolah yang terpilih tersebut meliputi ;<br />\r\n1. SMA Negeri 1 Gunung Sari<br />\r\n2. SMK Negeri 1 Gunung Sari<br />\r\n<span style=\"font-family:inherit\">3. SMA Negeri 1 Batu Layar<br />\r\n4. SMA Negeri 1 Lingsar<br />\r\n5. SMA Negeri 1 Narmada<br />\r\n6. SMK Negeri 1 Narmada.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: inherit;\">\r\n<p><span style=\"color:#000000\">Kegiatan yang dilakukan di sekolah-sekolah tersebut adalah ; Penyuluhan kepada siswa-siswi dengan tema Meningkatkan Potensi Kesehatan Jiwa Anak dan Remaja dalam Menyongsong Masa Depan, Skrining Kesehatan Jiwa kepada para siswa dan juga kepada para tenaga pendidik dan kependidikan dan melatih kemampuan manajemen stres para siswa, pendidik dan tenaga kependidikan dan penyerahan cenderamata dari RSJ. Mutiara Sukma berupa Kotak P3K.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/Penyerahan%20Cinderamata.JPG\" style=\"height:233px; width:350px\" /></span></p>\r\n\r\n<p><span style=\"color:#000000\">Tim yang diterjunkan oleh RSJ. Mutiara Sukma dalam kegiatan ini adalah Psikiater, Psikolog, Perawat Spesialis Keperawatan Jiwa, Dokter Umum, Perawat dan tenaga-tenaga pendukung lainnya serta melibatkan mahasiswa keperawatan STIKes Mataram yang sedang mengikuti praktik klinik stase keperawatan jiwa.</span></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/team.JPG\" style=\"height:233px; width:350px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">Ribuan siswa dari sekolah-sekolah tersebut mengikuti kegiatan ini sehingga diharapkan setelah terpapar manajemen stres siswa dan warga sekolah mampu mengatasi masalah kesehatan jiwanya untuk menyongsong masa depan yang lebih baik.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/penutup.JPG\" style=\"height:233px; width:350px\" /></span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/wmhd2018?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">WMHD2018</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/hkjs2018?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">HKJS2018</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/youngpeople?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">YOUNGPEOPLE</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/sehatjiwa?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">SEHATJIWA</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntbbangkitkembali?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTBBangkitKembali</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/lombokbangkitkembali?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">LombokBangkitKembali</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/pemudasehatnegarakuat?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">PemudaSehatNegaraKuat</span></span></span></a></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_3x-2\" style=\"font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 12px; background-color: rgb(255, 255, 255);\">\r\n<div style=\"font-family: inherit;\">\r\n<div class=\"mtm\" style=\"margin-top: 10px; font-family: inherit;\">\r\n<div class=\"_2a2q _65sr\" style=\"overflow: hidden; position: relative; margin-left: -12px; margin-right: -12px; font-family: inherit; width: 516px; height: 516px;\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n', '2018-10-13'),
(233, 'Puncak  uncak Perayaan Hari Kesehatan Jiwa Sedunia (HKJS) atau World Mental Health Day (WMHD) 10 Oktober 2018', '13', '<div class=\"_5pbx userContent _3576\" id=\"js_6o\" style=\"font-size: 14px; line-height: 1.38; margin-top: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41);\">\r\n<div class=\"text_exposed_root text_exposed\" id=\"id_5bc34d00823d54d28779409\" style=\"display: inline; font-family: inherit;\">\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/IMG_3814.JPG\" style=\"width:350px\" /></p>\r\n\r\n<p><span style=\"color:rgb(0, 0, 0); font-family:inherit\">Puncak</span><span style=\"color:rgb(0, 0, 0); font-family:inherit\">&nbsp;&nbsp;</span><span style=\"color:#000000\">uncak Perayaan Hari Kesehatan Jiwa Sedunia (HKJS) atau World Mental Health Day (WMHD) 10 Oktober 2018 diperingati secara sederhana namun tetap meriah.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">Pelaksanaan peringatan HKJS ini sengaja dilaksanakan pada hari Minggu di area Car Free Day Udayana tepatnya di Panggung Inspiratif Expo Diskominfotik Prov. NTB sebagai upaya untuk menyebarkan informasi terkait kesehatan jiwa di kalangan masyarakat. Upaya ini dilaksanakan untuk mengkampanyekan kesadaran kesehatan jiwa masyaraka<span style=\"font-family:inherit\">t, meningkatkan peran serta masyarakat dan mengurangi angka kesakitan terutama pada kelompok umur anak dan remaja.</span></span></p>\r\n\r\n<p><span style=\"color:#000000\">Kegiatan ini dihadiri oleh Sekretaris Daerah Provinsi NTB, Staf Ahli Bidang Kesejahteraan Rakyat Setda Prov. NTB, Kepala Dinas Kominfotik, PLT. Kepala Dinas Kesehatan, Direktur RSUD Prov. NTB, Kepala Bapelkes NTB, Kepala Dinas Pendidikan dan Kebudayaan..</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: inherit;\">\r\n<p><span style=\"color:#000000\">Beberapa kegiatan yang dilaksanakan di CFD Udayana diantaranya ; Senam massal, Sambutan dari Sekda Pemprov, Sambutan dari Staf Ahli Bidang Kesra, Penyuluhan Kesehatan Jiwa Anak dan Remaja, Pengisian kuesioner SDQ bagi pelajar SMA/SMK dan SRQ bagi masyarakat umum, konseling dan pembagian door price dari beberapa sponsor kegiatan.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Peserta dengan antusias mengikuti kegiatan hingga akhir karena mereka dapat melakukan tes masalah kesehatan jiwa dan konseling secara gratis.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Selain acara yang ditampilkan dari Tim RSJ. Mutiara Sukma, acara juga mendapatkan dukungan dari STIKes Mataram dengan menampilkan tarian daerah, Pencak Silat dari Siswa PPLP, Mr. Teen dan Duta Pariwisata Kota Mataram dan juga pembagian door price dari para sponsor yakni KPN Waras RSJ. Mutiara Sukma, Minyak Kutus-Kutus dan para peserta talent show.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Puncak acara kesehatan jiwa terselenggara dengan baik sukses berkat dukungan yang sangat luar biasa dari Dinas Kominfotik Prov. NTB yang telah memfasilitasi peringatan ini.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/wmhd2018?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">WMHD2018</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/hkjs2018?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">HKJS2018</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/youngpeople?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">YoungPeople</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/anakremajapemuda?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">AnakRemajaPemuda</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntbbangkitkembali?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTBBangkitkembali</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/lombokbangkitkembali?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">LombokBangkitkembali</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/chrsjms?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">CHRSJMS</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/salamsehatjiwa?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">SalamSehatJiwa</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ayopeduliodgj?source=feed_text\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">AyoPeduliODGJ</span></span></span></a></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_3x-2\" style=\"font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 12px;\">\r\n<div style=\"font-family: inherit;\">\r\n<div class=\"mtm\" style=\"margin-top: 10px; font-family: inherit;\">\r\n<div class=\"_2a2q _65sr\" style=\"overflow: hidden; position: relative; margin-left: -12px; margin-right: -12px; font-family: inherit; width: 516px; height: 516px;\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n', '2018-10-14'),
(234, 'WORKSHOP TPKJM DALAM RANGKA DUKUNGAN KESEHATAN JIWA DAN PSIKOSOSIAL KORBAN BENCANA ALAM GEMPA BUMI TINGKAT PROVINSI NUSA TENGGARA BARAT TAHUN 2018', '13', '<p><span style=\"color:#000000\">WORKSHOP TPKJM DALAM RANGKA DUKUNGAN KESEHATAN JIWA DAN PSIKOSOSIAL KORBAN BENCANA ALAM GEMPA BUMI TINGKAT PROVINSI NUSA TENGGARA BARAT TAHUN 2018.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Workshop Tim Pengarah Kesehatan Jiwa Masyarakat (TPKJM) tingkat Provinsi Nusa Tenggara Barat telah dilaksanakan selama 2 hari mulai tanggal 16 - 17 Oktober 2018 bertempat di Hotel Grand Legi Mataram.<br />\r\nKegiatan ini diikuti oleh beberapa lintas sektor baik tingkat provinsi maupun kabupaten/kota se-Provinsi NTB antara lain Dinas Keseh<span style=\"font-family:inherit\">atan Provinsi dan Kabupaten/Kota, Dinas Sosial Provinsi dan Kabupaten/Kota, TNI/Polri, RSUD Provinsi NTB, Dinas Pendidikan dan Kebudayaan se-Prov. NTB, RRI Mataram, serta beberapa organisasi profesi diantaranya PPNI, IPKJI, HAKLI, IAKMI. Acara dibuka oleh Staf Ahli Gubernur bidang sosial kemasyarakatan dan SDM dr. Nurhandini Eka Dewi, Sp.A.</span></span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Workshop kali selain membahas penanganan masalah kesehatan jiwa yang selama ini telah ditangani di NTB juga membahas masalah kesehatan jiwa akibat bencana dan penanganan masalah kesehatan jiwa dengan Dukungan Kesehatan Jiwa dan Psikososial (DKJPS) terhadap korban bencana alam gempa bumi Tingkat Provinsi NTB. Workshop ini dianggap penting dilakukan agar pemerintah dapat bersinergi dalam mendeteksi dan menangani masalah kesehatan jiwa terutama yang ditimbulkan oleh dampak bencana gempa bumi Lombok.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Narasumber dalam kegiatan ini berasal dari Biro Kesra Setda Provinsi NTB, Dinas Kesehatan Provinsi NTB yang diwakili dr. Zaenul Arifin dan Tim DKJPS Rumah Sakit Jiwa Mutiara Sukma Provinsi NTB. Pada workshop tersebut selain pemaparan dari narasumber, peserta juga diberikan materi deteksi dini kasus masalah kesehatan jiwa pada anak remaja, dewasa dan lanjut usia dan juga melakukan praktik bersama-sama manajemen stress sehingga peserta diharapkan mampu melakukan deteksi dan penanganan di tingkat dasar yakni masyarakat.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sebelum acara ditutup peserta membuat dan menyepakati Rencana Tindak Lanjut workshop yang diharapkan menjadi acuan untuk dilaksanakan di setiap daerah masing-masing. Sesi kali ini dipimpin oleh Plt. Kepala Bagian Kesejahteraan Sosial ibu Hj. Wilya Isnaeni, SKM., MM. Selanjutnya kegiatan workshop ditutup oleh Kepala Biro Kesejahteraan Sekretariat Daerah Prov. NTB. Bapak H. Achmad Mashuri, SH.</span></p>\r\n</div>\r\n', '2018-10-22'),
(235, 'Tes Kebugaran dan Donor Darah dalam rangkaian Hari Kesehatan Jiwa Sedunia', '13', '<p><span style=\"color:#000000\">Masih dalam rangkaian Hari Kesehatan Jiwa Se-dunia (HKJS) 10 Oktober 2018. Hari ini Civitas Hospitalia menyelenggarakan kegiatan tes kebugaran bagi civitas hospitalia yang berusia 45 tahun ke bawah.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Tes kebugaran ini penting dilakukan bagi semua civitas hospitalia untuk mengetahui tingkat kebugarannya sehingga bisa memelihara dan meningkatkan kondisi kesehatan civitas hospitalia.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Selain kegiatan tes kebugaran, civitas hospitalia Juga turut berpartisipasi mendukung PMI dalam m<span style=\"font-family:inherit\">enyediakan stok darah di UTD PMI untuk kebutuhan masyarakat di wilayah Mataram dan sekitarnya.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Terlihat civitas hospitalia sangat antusias dengan penuh semangat mengikuti kegiatan ini.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Acara hari didukung oleh beberapa pihak diantaranya Pixy dan BTN Syariah.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Semoga dengan rangkaian kegiatan yang dilakukan oleh Civitas Hospitalia RSJ. Mutiara Sukma, masyarakat semakin memahami peran RSJ. Mutiara Sukma Provinsi NTB di tengah masyarakat.</span></p>\r\n</div>\r\n', '2018-10-22');
INSERT INTO `sekilas_mataram` (`id`, `judul`, `kategori`, `konten`, `tanggal`) VALUES
(238, 'Presentasi, Monitoring dan Evaluasi Keterbukaan Informasi Publik tahun 2018', '13', '<p><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-26%20at%2011.45.33%20AM.jpeg\" style=\"height:233px; width:350px\" />&nbsp;<img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-26%20at%2011.45.34%20AM.jpeg\" style=\"height:233px; width:350px\" /></span></p>\r\n\r\n<p><span style=\"color:#000000\">Jumat,&nbsp; 26 Oktober 2018. Bertempat di Ruang Sidang Komisi Informasi Provinsi NTB. RSJ Mutiara Sukma menyajikan Presentasi Monitoring dan Evaluasi Keterbukaan Informasi Publik tahun 2018, yang sudah dijadwalkan oleh Komisi Informasi Provinsi NTB. Penilaian pada tahap presentasi ini dititik beratkan terhadap Komitmen, Kolaborasi dan Inovasi Keterbukaan Informasi Badan Publik dalam pemberian Pelayanan Informasi Publik di masing-masing Organisasi Perangkat Daerah.</span></p>\r\n', '2018-10-26'),
(239, 'sosialisasi regulasi baru terkait BLUD', '13', '<p style=\"text-align:center\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-31%20at%202.16.15%20PM.jpeg\" style=\"height:197px; width:350px\" />&nbsp;<img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-31%20at%202.16.16%20PM.jpeg\" style=\"height:197px; width:350px\" /></span></p>\r\n\r\n<p><span style=\"color:#000000\">Hari ini, Rabu 31 Oktober 2018. Dalam rangka peningkatan mutu dan kemampuan Badan Layanan Umum Daerahdi RSJ Mutiara Sukma. diselenggarakan sosialisasi regulasi baru terkait BLUD (Permendagri 79 Tahun 2018 yang merupakan perubahan peraturan Kemendagri 61 Tahun 2007. kegiatan ini diprakarsai oleh Dewan Pengawas RSJ Mutiara Sukma, sebagai salah satu bentuk komitmen&nbsp; Dewan Pengawas RSJ Mutiara Sukma untuk mencapai paripurna dalam segala aspek pelayanan termasuk pengelolaan BLUD. Narasumber pada kegiatan ini adalah Bapak Drs. H. Azhar.,MM, beliau saat ini menjabat sebagai Kepala Bidang Akuntansi dan Pelaporan pada BPKAD Provinsi NTB sekaligus sebagai anggota Dewan Pengawas RSJ Mutiara Sukma.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-31%20at%202.16.16%20PM%20%281%29.jpeg\" style=\"height:197px; width:350px\" />&nbsp;<img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-31%20at%202.16.17%20PM.jpeg\" style=\"height:197px; width:350px\" /></span></p>\r\n\r\n<p><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202018-10-31%20at%202.17.00%20PM.jpeg\" style=\"float:left; height:473px; width:350px\" /></span></p>\r\n', '2018-10-31'),
(240, 'Pengumuman formasi Rekrutmen Pegawai Non PNS RSJMS 2019', '21', '<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><u><span style=\"font-size:18px\"><strong><span style=\"color:#000000\">PENGUMUMAN FORMASI REKRUTMEN PEGAWAI NON PNS RSJMS 2019</span></strong></span></u></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"color:#000000\">Pengumuman penerimaan pegawai Non PNS BLUD RSJ Mutiara Sukma untuk tahun 2019 dapat didownload <span style=\"font-size:18px\"><a href=\"http://rsjmutiarasukma.ntbprov.go.id/file/Pengumuman%20Penerimaan%20Pegawai%20Non%20PNS%20RSJMS%20TAHUN%202019.pdf\">DISINI</a></span></span></span></p>\r\n', '2018-11-01'),
