(255, 'Kunjungan Tim International Mental Health Training Center Taiwan (IMHTCT)', '13', '<p><span style=\"color:#000000\">Kunjungan Tim International Mental Health Training Center Taiwan (IMHTCT) yang dipimpin oleh Cheng-Chung Chen, MD., Ph.D bersama dengan 5 orang rombongan pada hari ini Senin, 10 Desember 2018. Kunjungan Tim dari IMHTCT ini merupakan salah bentuk evaluasi dari peserta pelatihan dari Psikiater dan perawat yang RSJ. Mutiara Sukma yang telah dikirim untuk mengikuti pelatihan Rehabilitasi Psikososial selama sebulan pada tanggal 23 Oktober hingga 23 November 2018.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Selain hal tersebut, tujuan kunjungan Tim IMHTCT untuk menjajaki dan melihat langsung RSJ. Mutiara Sukma yang kelak akan menjalin kerjasama dalam pengiriman stafnya untuk mengikuti pelatihan-pelatihan yang diselenggarakan di Taiwan.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pada kesempatan ini, Tim IMHTCT juga diterima oleh Gubernur Provinsi Nusa Tenggara Barat Bapak Dr. Zulkieflimansyah yang juga didampingi oleh Dewan Pengawas RSJ. Mutiara Sukma Bapak Drs. H.&nbsp;</span><a href=\"https://www.facebook.com/profile.php?id=100024197057564&amp;__tn__=%2CdK-R-R&amp;eid=ARAoROfGJ1YpGutlLIhH0ByLUvnMnTUrSXkSHHLHmC2BZeFI01rwhtMnGzxLf_MjSMb4MM61w8J7NeDm&amp;fref=mentions\"><span style=\"color:#000000\">Azhar</span></a><span style=\"color:#000000\">, MM., Direktur RSJ. Mutiara Sukma Ibu dr. Elly Rosila Wijaya, Sp.KJ., MM beserta pejabat struktural dan Pejabat Fungsional. Pada kunjungan ramah-tamah tersebut, Gubernur dengan Tim IMHTCT membahas bentuk kerjasama dan dukungan yang dapat dilakukan oleh Pemerintah Provinsi Nusa Tenggara Barat dalam mensukseskan dan meningkatkan kerjasama di bidang kesehatan jiwa untuk meningkatkan kompetensi tenaga kesehatan jiwa khususnya di RSJ. Mutiara Sukma. Kelak, tenaga-tenaga yang dapat dikirimkan untuk mengikuti pelatihan tersebut bukan hanya terbatas pada tenaga psikiater dan perawat. Namun juga dapat lebih luas meliputi tenaga-tenaga yang berkecimpung dalam pelayanan pasien seperti psikolog, pekerja sosial, case manager dan tenaga-tenaga pendukung lainnya. Bahkan pada kesempatan ini, Gubernur menawarkan bila memungkinkan pasien-pasien yang telah stabil pun dapat dikirim untuk belajar sehingga mereka dapat meningkatkan kemampuannya dalam upaya pemberdayaan dan hak asasi manusia.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Setelah acara ramah-tamah dengan Bapak Gubernur NTB, Tim IMHTCT, Kepala Dinas Kesehatan Provinsi Nusa Tenggara Barat yang diwakili oleh Bapak Lalu Budarja, SKM., M.Kes. dan Civitas Hospitalia RSJ. Mutiara Sukma melanjutkan kegiatan di Roemah Langko untuk makan siang dan presentasi profil RSJ. Mutiara Sukma dan program-program yang telah dilakukan oleh RSJ. Mutiara Sukma dan program-program yang ditawarkan oleh IMHTCT.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Kegiatan kunjungan ini, bukan hanya dilaksanakan pertemuan dalam ruangan, namun juga Tim IMHTCT juga berkesempatan melakukan kunjungan langsung di RSJ. Mutiara Sukma. Di RSJ. Mutiara Sukma, Tim IMHTCT disambut dengan musik tradisional Gendang Beleq dengan Tarian Perisaian yang ditampilkan oleh Pasien-pasien yang telah stabil dan menjalani rehabilitasi dan juga tim rehabilitasi psikososial RSJ. Mutiara Sukma. Tim, sangat menikmati tampilan musik dan tarian tradisional yang ditampilkan oleh pasien dan staf tersebut. Selain mendapatkan suguhan tarian, tim juga diberikan souvernir yang merupakan karya-karya para rehabilitan selama mereka menjalani proses rehabilitasi.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Acara terakhir, adalah tim bersama civitas hospitali melakukan kunjungan ke ruangan-ruangan perawatan dan melakukan diskusi lanjutan untuk mendapatkan masukan-masukan yang konstruktif dalam meningkatkan pelayanan kepada masyarakat. Kunjungan tim ini sangat konstruktif dalam membangun peningkatan pelayanan kesehatan jiwa di Nusa Tenggara Barat, sehingga para pengguan layanan dapat merasa puas dan produktif setelah mereka dirawat di RSJ. Mutiara Sukma.<br />\r\n<span style=\"font-family:inherit\"><span style=\"font-family:inherit; font-size:16px\">ðŸ“¸</span></span></span><a href=\"https://www.facebook.com/Rizuki.YL?__tn__=%2CdK-R-R&amp;eid=ARCQ0FpQgQr5_4c-OONGUuLzR2R8FhjEooQCIGY4C8B4YLVNTW39CArvMCBC_PLWCl6NMrzRswHmfmTT&amp;fref=mentions\"><span style=\"color:#000000\">Muhammad Rizki Awansyah</span></a><span style=\"color:#000000\">,&nbsp;</span><a href=\"https://www.facebook.com/muji.asih.144?__tn__=%2CdK-R-R&amp;eid=ARBNjUNyXXLqCD9vR7w5ShnfnC_x_LlcvAFJ96E0ngaNzHIlLbQ9aR8kBsXnHQPI2qM9vvvQg9FuV1Ei&amp;fref=mentions\"><span style=\"color:#000000\">Muji Asih</span></a><br />\r\n<span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit; font-size:16px\">ðŸ“</span></span></span><a href=\"https://www.facebook.com/MuhammadSunartoS.Pataroi?__tn__=%2CdK-R-R&amp;eid=ARArQrEA_9xP1fxv3qipXRF5QRTlQ_sQag-QbAbAgNvSJCiEAqpL4XLZ5YBcYu--qbBPgyIxJgE77Jh0&amp;fref=mentions\"><span style=\"color:#000000\">Muhammad Sunarto S. Pataroi</span></a></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/rehabilitasi_psikososial?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">Rehabilitasi_Psikososial</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/kerjasama_internasional?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">Kerjasama_Internasional</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntb_hebat?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTB_Hebat</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntb_bangkit?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTB_Bangkit</span></span></span></a></p>\r\n', '2018-12-10'),
(256, 'rangkaian kegiatan HUT NTB ke-60 tahun, Baksos Kesehatan', '13', '<p><span style=\"color:#000000\">Dalam rangkaian kegiatan HUT NTB ke-60 tahun, spesial hari Jumat kemarin, 14 Desember 2018, bertempat di Lapangan Kantor Gubernur NTB, bersamaan dengan kegiatan Jumpa Bang Zul dan Umi Rohmi, diadakan kegiatan Baksos Kesehatan, yaitu :</span></p>\r\n\r\n<p><span style=\"color:#000000\">1. Sunatan massal gratis<br />\r\n2. Donor darah<br />\r\n3. Pemeriksaan Kesehatan gratis<br />\r\n<span style=\"font-family:inherit\">4. Psikososial support<br />\r\n5. Posbindu</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Kegiatan ini diikuti oleh seluruh Kepala OPD/Biro dan ASN Lingkup Pemprov NTB. Kegiatan Psikososial support hari ini yaitu screening / deteksi dini gangguan jiwa pada dewasa, dengan pengisian SRQ &amp; dilanjutkan dengan konsultasi kepada Psikiater.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Peserta pengisian SRQ total 51 orang dengan perincian, 41 orang laki-laki dan 10 orang perempuan. Dimana total 14 orang (11 orang laki-laki dan 3 orang perempuan), yang melakukan konsultasi langsung ke Psikiater dari RSJ Mutiara Sukma yang memiliki nilai di atas kerentanan mengalami masalah kesehatan jiwa.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Berdasarkan dengan jumlah pengunjung yang melakukan tes dengan jumlah pengunjung di atas nilai kerentanan, maka dapat disimpulkan bahwa sejumlah 27,45% kemungkinan mengalami masalah mental emosional yang membutuhkan bantuan dukungan kesehatan jiwa dan psikososial. Angka tersebut masih lebih tinggi persentasinya bila dibandingkan dengan angka Riskesdas 2018 untuk NTB sejumlah 13% untuk masalah mental emosional dan 8% untuk masalah depresi.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Mereka yang memiliki nilai di atas nilai kerentanan tersebut perlu berkonsultasi agar mereka dapat lebih kuat terhadap masalah kesehatan jiwa. Sehingga mereka akan tetap sehat dan produktif.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Yuk, masyarakat NTB agar tetap bisa sehat dan produktif lakukan tes mandiri seperti Bapak Gubernur, Ibu Wakil Gubernur dan Bapak Setda Provinsi NTB dan pengunjung lainnya. Beliau-beliau saja bersedia melakukan tes mandiri untuk mengetahui kondisi kesehatan jiwanya.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Nah, kita semua kapan tesnya yah? Jangan tunggu, unduh saja Aplikasi Makpasol di sini</span></p>\r\n\r\n<p><a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fplay.google.com%2Fstore%2Fapps%2Fdetails%3Fid%3Dcom.makpasol.rsj%26fbclid%3DIwAR0D3saQ0O40Sm_dXmIrC2WWHPk71DuHh7v-zGX3lW7x-Ac8g9P2FwV-X20&amp;h=AT1RCDWVXvVxUS6JFOsa35PUmVkkqhf2NEiJI5wpIrCxHqBXNqioY9iXNhNejeLMiQbW24ObrHjmncAUEdm0vL6hVIXrOHxQXGScAE-HRyqzEjHdXJl6fJS-31gLQ4_8f2cenTrVuoAMLVpSdzS4Qtuj3_xxe8Nl\" target=\"_blank\"><span style=\"color:#000000\">https://play.google.com/store/apps/details&hellip;</span></a></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit; font-size:16px\">ðŸ“</span></span></span><a href=\"https://www.facebook.com/dwi.wanti.12?__tn__=%2CdK-R-R&amp;eid=ARAa4O_IvHERPmDDbsF9aOsU81i6qiOW54kBbwj7vfmbyn3FTmgqdE_Xzye3x1xbrrADlXpglk2uLPfg&amp;fref=mentions\"><span style=\"color:#000000\">Dwi WanTi</span></a><span style=\"color:#000000\">,&nbsp;</span><a href=\"https://www.facebook.com/MuhammadSunartoS.Pataroi?__tn__=%2CdK-R-R&amp;eid=ARCNHyNufuuLL0_LyFqMdLzA_xOsrH08J2KX1twbq8ATTqxecpfLkv41FAgMoeEhb71iaMgEvvfwekds&amp;fref=mentions\"><span style=\"color:#000000\">Muhammad Sunarto S. Pataroi</span></a><br />\r\n<span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit; font-size:16px\">ðŸ“¸</span></span></span><a href=\"https://www.facebook.com/Rizuki.YL?__tn__=%2CdK-R-R&amp;eid=ARCiDEb3BiFZ0daAqRnE1OzxZn2Ia9lQBcmZ03YqOMRM1bhBXr_Un9ytEAUhZ51qCG71zHlp45FTccNn&amp;fref=mentions\"><span style=\"color:#000000\">Muhammad Rizki Awansyah</span></a></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/srq?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">SRQ</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/skriningmentalemosional?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">SkriningMentalEmosional</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/makpasol?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">Makpasol</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntbsehatjiwa?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTBSehatJiwa</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntbkuattangguh?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTBKuatTangguh</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntb60tahun?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTB60Tahun</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntbgemilang?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTBGemilang</span></span></span></a></p>\r\n</div>\r\n', '2018-12-14'),
(257, 'AKSI BERSIH KALI JANGKUK', '13', '<p><span style=\"color:#000000\">AKSI BERSIH KALI JANGKUK</span></p>\r\n\r\n<p><span style=\"color:#000000\">Senin,17 Desember 2018, yang diperingati sebagai Puncak acara HUT NTB ke 60 dengan tema &ldquo;Bersama Bangkit Menuju NTB Gemilang&rdquo; diawali dengan Aksi Bersih Sungai Jangkok 2018 yang diikuti oleh seluruh OPD lingkup Provinsi NTB tidak terkecuali RSJ Mutiara Sukma. Tepat Pukul 07.00 wita Tim RSJ Mutiara Sukma yang dikomandani langsung oleh Direktur (Dr.Elly Rosila Wijaya, Sp.KJ.,MM) dan jajaran pejabat struktural sudah berada di lokasi yang sudah di tentuka<span style=\"font-family:inherit\">n panitia.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Tim begitu antusias dan penuh keceriaan. Semangat gotong royong nampak lekat dalam kegiatan aksi bersih sungai ini, hal ini karena komitmen dari semua Civitas Hospitalia RSJ Mutiara Sukma dalam mendukung target pemerintah menuju Indonesia bersih 2025 dan itu tertuang dalam satu kalimat dari kami &ldquo; DENGAN KOTA YANG BERSIH DAN JIWA YANG SEHAT KITA MENUJU NTB GEMILANG&rdquo;.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Dalam kegiatan ini Gubernur beserta rombongan naik perahu dan menyisiri sepanjang sungai jangkok dengan tujuan akhir di muara Ampenan. Pada pukul 09.30 wita seluruh peserta aksi bersih sungai menuju pantai Ampenan untuk mengikuti acara Launching NTB Gemilang (Gerakan Bersih Lingkungan, Pendidikan dan Kesehatan yang Cemerlang).</span></p>\r\n\r\n<p><span style=\"color:#000000\">Acara perayaan ini dilanjutkan dengan kegiatan Zikir dan Doa Bersama yang dihadiri oleh seluruh jajaran pemerintah Provinsi NTB yang beragam islam di Halaman Kantor Gubernur NTB pada pukul 15.30 wita.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pada pukul 19.30 wita peringatan HUT NTB Ke 60 ini diakhiri dengan PESTA RAKYAT bertempat di Halaman Kantor Gubernur NTB yang dihadiri oleh seluruh OPD Lingkup Provinsi NTB dan Kota Mataram serta masyarakat sekitar sebagai Malam Perayaan dan Tasyakuran, dalam acara ini disediakan kuliner khas NTB di sepanjang jalan depan kantor Gubernur NTB yang bisa dinikmati oleh masyarakat yang hadir secara gratis serta hiburan dari WALI BAND.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/dirgahayuntbke60?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">DIRGAHAYUNTBKE60</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntbkubangkit?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTBKUBANGKIT</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntbkugemilang?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTBKUGEMILANG</span></span></span></a></p>\r\n</div>\r\n', '2018-12-18'),
(258, 'penandatanganan surat perjanjian kerja pegawai Non-PNS BLUD untuk tahun 2019', '13', '<p><span style=\"color:#000000\">Pada hari ini (Senin, 31 Desember 2018), di RSJ Mutiara Sukma Provinsi NTB. Dilaksanakan tahapan terakhir proses rekrutmen pegawai Non-PNS BLUD lingkup RSJ Mutiara Sukma yaitu penandatanganan surat perjanjian kerja pegawai Non-PNS BLUD untuk tahun 2019.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Diikuti oleh 95 (sembilan puluh lima) orang dari berbagai profesi yang dinyatakan lulus administrasi dan tes kompetensi oleh tim seleksi RSJ Mutiara Sukma diantaranya : perawat, Apoteker, Asisten Apoteker, Tenaga Teknis Elektr<span style=\"font-family:inherit\">omedis, Perkerja Sosial, Perekam Medis, Pengadministrasian Psikometri, Tenaga Laundri, Petugas Keamanan dan Petugas Kebersihan.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Sebelum penandatanganan, diawali dengan arahan dari Direktur RSJ Mutiara Sukma Provinsi NTB Ibu Dr. ELLY ROSILLA WIJAYA, Sp.KJ., MM yang didampingi oleh seluruh pejabat struktural, terkait hak dan kewajiban serta tata tertib pegawai Non PNS BLUD lingkup RSJ Mutiara Sukma Provinsi NTB.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pegawai Non PNS BLUD diharapkan dapat menguatkan dan melengkapi ketenagaan yang ada di RSJ. Mutiara Sukma.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/chrsjms?source=feed_text&amp;epa=HASHTAG&amp;__xts__%5B0%5D=68.ARAZv32CjiPKjnZuf4wya3DjIQhl4jloTSWY_DGLx8tLl5eXiUbePzEeLx8MC7GJY0e22zz3Z415zlNcLHqjkeWL6Do4MbfqEYDkg9F7QR1DEQaXXtvzzWiLPSVj6qBvM1QG4CmovaLqcovnGPo1GfpdOJx8H3Yp3oQP5Fu27sHMRZiPHKh3ge2cGGjSvf5Ij3LV0tuzfDvZrWfh873RGo9ygv5KXsJUneJ9I31eKPc8CI7b0Ron0Uu7uRF8BrkmmuKdeNHlL21ykHwHS5cUTvHLe0J1Tg&amp;__tn__=%2ANK-R\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:in