k.com/MuhammadSunartoS.Pataroi?__tn__=K-R&amp;eid=ARBDiM1XL-cp1Ip2y23OjbFrN2h7JyYDW5ZpdyJnH3dS2aKjRzSB2tFnUd8pYpcxn_R4mDMwj1SDYDqh&amp;fref=mentions&amp;__xts__%5B0%5D=68.ARAZv32CjiPKjnZuf4wya3DjIQhl4jloTSWY_DGLx8tLl5eXiUbePzEeLx8MC7GJY0e22zz3Z415zlNcLHqjkeWL6Do4MbfqEYDkg9F7QR1DEQaXXtvzzWiLPSVj6qBvM1QG4CmovaLqcovnGPo1GfpdOJx8H3Yp3oQP5Fu27sHMRZiPHKh3ge2cGGjSvf5Ij3LV0tuzfDvZrWfh873RGo9ygv5KXsJUneJ9I31eKPc8CI7b0Ron0Uu7uRF8BrkmmuKdeNHlL21ykHwHS5cUTvHLe0J1Tg\"><span style=\"color:#000000\">Muhammad Sunarto S. Pataroi</span></a></p>\r\n</div>\r\n', '2019-01-04'),
(259, 'Pembubaran Panitia Hari Besar Tahun 2018 dan Rapat Evaluasi Pelaksanaan Kegiatan Dukungan Kesehatan Jiwa dan PsikoSosial (DKJPS)', '13', '<p><span style=\"color:#000000\">Pada hari ini Rabu, 2 Januari 2019 bertempat di Lesehan Dapur Selaparang Lombok dilaksanakan dua acara khusus yaitu; Pembubaran Panitia Hari Besar Tahun 2018 dan Rapat Evaluasi Pelaksanaan Kegiatan Dukungan Kesehatan Jiwa dan PsikoSosial (DKJPS) Pasca Bencana Gempa.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pada kesempatan ini pula dibentuk panitia khusus yang akan bekerja selama satu tahun untuk mempersiapkan acara-acara spesial yang digelar oleh RSJ Mutiara Sukma antara lain HUT RSJ Mutiara Sukma, Hari Kesehatan Jiwa Sedunia (HKJS) dan perayan hari-hari besar lainnya.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Kegiatan pembubaran panitia ini diawali dengan laporan ketua panitia yaitu Ns. I Nengah Darthayasa, M.Kep, bahwa kegiatan-kegiatan yang diselenggarakan tahun 2018 kemarin telah mampu menggali bakat-bakat terpendam Civitas Hospitali RSJ Mutiara Sukma serta menambah keakraban antar karyawan.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Acara kemudian dilanjutkan dengan sambutan Direktur RSJ Mutiara Sukma, Dr. Elly Rosila Wijaya, Sp.,KJ., MM. Ibu direktur menyampaikan terima kasih kepada semua panitia atas kerjasama dan keterlibatannya di semua event. Beliau merasa bangga atas kerja keras, kerjasama dan kekompakan seluruh panitia.</span></p>\r\n\r\n<p><span style=\"color:#000000\">PANITIA HEBAT!!!<br />\r\nSaran beliau, untuk panitia tahun 2019, agar mengecek kalender kegiatan nasional, seperti Hari Kesehatan Nasional, Hari Anak Nasional, Hari Pencegahan Bunuh Diri Se-Dunia dan perayaan hari-hari besar lainnya sehingga Civitas Hospitalia RSJ Mutiara Sukma juga berpartisipasi dalam memeriahkan acara-acara tersebut.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sementara pemilihan Panitia inti Hari Besar Tahun 2019 yang terpilih adalah sebagai berikut :<br />\r\nPenanggung Jawab : Kepala Sub Bagian Tata Usaha (Julastri Rondonuwu, SKM., MPH);<br />\r\nKetua Panitia : Mujiasih, SKM;&nbsp;<br />\r\nWakil Ketua Panitia : Mukhtardi, S.Kep., Ns., MARS;&nbsp;<br />\r\nSekretaris I : Dian Gusmiyanti S, SKM; Sekretaris II : Triana Winiastuti, SE;<br />\r\nBendahara : Kasmini, SKM.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sedangkan seksi-seksi pada kepanitiaan tersebut akan dipilih oleh tim formatur yang telah dibentuk.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pada evaluasi pelaksanaan Dukungan Kesehatan Jiwa Psikososial (DKJPS) Pasca Bencana, Tim melaporkan bahwa kegiatan telah dilaksanakan pada 7 Kabupaten/Kota di Provinsi NTB yang terdampak gempa secara langsung yang dilaksanakan secara simultan sejak bulan Oktober hingga Desember 2018.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Target sasaran yang telah dicapai pada kegiatan tersebut sejumlah 7.532 orang meliputi Guru dan staf kependidikan, siswa-siswi SD, SMP dan SMA/SMK pada 7 Kab./Kota tersebut dan masyarakat umum. Sebagian dari jumlah tersebut yakni sejumlah 49 orang dilakukan tindakan khusus yakni psikoterapi lanjut terkait keluhan yang dirasakan akibat pasca gempa.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sejalan dengan kegiatan DKJPS, untuk menguatkan pelayanan DKJPS di layanan kesehatan primer Tim Inti DKJPS&nbsp;</span><a href=\"https://www.facebook.com/rsj.mutiarasukma.1?__tn__=K-R&amp;eid=ARAhFvraxvDC7EU8dlK0HRzFDueRXRufgZ6TiwtG-lXrWsFZKgPKkKb90jsPyYNm8VE5dwpzEqXR1nAV&amp;fref=mentions&amp;__xts__%5B0%5D=68.ARCgxZWOhNzzR7dHbT5CwMLTe_wU8rESYLDXUpnwFAtx1HwSczpTbTlIjsgcVBWqPMI4-I5ANieuplTGK2H4eO-VAbkOSuid43O2NaJS14yCzKNlZSHMm2kn-tGedZRtYClPX4_SeB6LfcOGl3F66ay5pHJONVgy2g_vp2JPaARVw6EfpURdB2jQu_Q0yph8LHLyGEsujSVFurP673hv7NbaFOU6hTN6XLPz9rQjfOyBeWbNdcmo23YuDOQJ64hyx6_Af3gDSvRuf2qQ0ie-FR9HjZO5xQ\"><span style=\"color:#000000\">Rsj Mutiara Sukma</span></a><span style=\"color:#000000\">&nbsp;bekerjasama dengan Dinas Kesehatan Provinsi NTB dan Dinas Kesehatan Kab/Kota melakukan pelatihan tenaga kesehatan dalam melaksanakan Dukungan Kesehatan Jiwa dan Psikososial bagi seluruh Puskesmas se-NTB dengan jumlah peserta 566 orang yang telah terlatih.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Jumlah ini telah tergandakan yang awalnya hanya berjumlah 5 tim, kemudian direplikasi menjadi 15 dan hingga saat ini telah mencapai 566 orang yang telah terlatih. Harapannya bahwa tenaga-tenaga terlatih tersebut mampu melanjutkan kegiatan-kegiatan yang telah dilaksanakan selama ini.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsbangkit?source=feed_text&amp;epa=HASHTAG&amp;__xts__%5B0%5D=68.ARCgxZWOhNzzR7dHbT5CwMLTe_wU8rESYLDXUpnwFAtx1HwSczpTbTlIjsgcVBWqPMI4-I5ANieuplTGK2H4eO-VAbkOSuid43O2NaJS14yCzKNlZSHMm2kn-tGedZRtYClPX4_SeB6LfcOGl3F66ay5pHJONVgy2g_vp2JPaARVw6EfpURdB2jQu_Q0yph8LHLyGEsujSVFurP673hv7NbaFOU6hTN6XLPz9rQjfOyBeWbNdcmo23YuDOQJ64hyx6_Af3gDSvRuf2qQ0ie-FR9HjZO5xQ&amp;__tn__=%2ANK-R\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSBangkit</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/ntbbangkit?source=feed_text&amp;epa=HASHTAG&amp;__xts__%5B0%5D=68.ARCgxZWOhNzzR7dHbT5CwMLTe_wU8rESYLDXUpnwFAtx1HwSczpTbTlIjsgcVBWqPMI4-I5ANieuplTGK2H4eO-VAbkOSuid43O2NaJS14yCzKNlZSHMm2kn-tGedZRtYClPX4_SeB6LfcOGl3F66ay5pHJONVgy2g_vp2JPaARVw6EfpURdB2jQu_Q0yph8LHLyGEsujSVFurP673hv7NbaFOU6hTN6XLPz9rQjfOyBeWbNdcmo23YuDOQJ64hyx6_Af3gDSvRuf2qQ0ie-FR9HjZO5xQ&amp;__tn__=%2ANK-R\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">NTBBangkit</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/dkjps?source=feed_text&amp;epa=HASHTAG&amp;__xts__%5B0%5D=68.ARCgxZWOhNzzR7dHbT5CwMLTe_wU8rESYLDXUpnwFAtx1HwSczpTbTlIjsgcVBWqPMI4-I5ANieuplTGK2H4eO-VAbkOSuid43O2NaJS14yCzKN