(260, 'KUNJUNGAN RSJ MUTIARA SUKMA KE DINAS`KESEHATAN KABUPATEN LOMBOK TENGAH', '13', '<p style=\"text-align: justify;\"><span style=\"color:#000000\">KUNJUNGAN RSJ MUTIARA SUKMA KE DINAS`KESEHATAN KABUPATEN LOMBOK TENGAH DALAM RANGKA EVALUASI KERJASAMA PELAYANAN KESEHATAN JIWA BAGI MASYARAKAT KURANG MAMPU NON PESERTA JKN, YANG BERSUMBER DARI DANA BANTUAN SOSIAL (BANSOS) BIDANG KESEHATAN KABUPATEN LOMBOK TENGAH</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Beberapa tahun ini RSJ Mutiara Sukma membuka peluang kerjasama dengan Seluruh Kota/Kabupaten di wilayah Provinsi NTB dalam pelayanan Kesehatan Jiwa bagi Masyarakat yang Kurang Mampu yang belum menjadi peserta Jaminan Kesehatan Nasional (JKN), hal ini bertujuan untuk memberikan pelayanan kesehatan Jiwa kepada seluruh masyarakat di kota/kabupaten yang ada di NTB tanpa terkecuali.&nbsp;</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<span style=\"color:#000000\">Salah satu Kabupaten yang sudah bekerjasama dengan RSJ Mutiara Sukma adalah Pemerintah Kabupaten Lombok Tengah, kerjasama ini telah berjalan cukup lama dan dalam rangka mewujudkan komitmen bersama kedua belah pihak untuk selalu menjaga kerjasama dengan baik serta meningkatkan pelayanan kesehatan jiwa bagi masyarakat Lombok Tengah yang kurang mampu yang belum menjadi peserta JKN maka setiap tahun selalu dilakukan evaluasi terkait pelaksanaan kerjasama tersebut. Tim RSJ Mutiara Sukma yang dipimpin langsung oleh Ka Subbag Tata Usaha, ibu Julastri Rondonuwu, SKM., MPH bersama Ka. Urusan Umum, Mujiasih, SKM dan koordinator verifikasi BPJS, Mizanti Agustiany, SKM serta Triana Winiastuti, SE berkunjung ke Dinas Kesehatan Kabupaten Lombok Tengah (Kamis, 3/1/2019), yang pada kesempatan ini bertemu langsung dengan Kepala Dinas Kesehatan Kabupaten Lombok Tengah, Bpk. H. Omdah, SKM didampingi Kepala Bidang Pelayanan Kesehatan, Bpk. Johan Efendy, S.Si., MPH. Evaluasi Kerjasama ini membahas beberapa hal yang perlu dilakukan perbaikan dalam kerjasama yang bertujuan untuk peningkatan pelayanan kesehatan jiwa kedepannya.&nbsp;</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<span style=\"color:#000000\">Kepada masyarakat Lombok Tengah yang kurang mampu dan membutuhkan pelayanan kesehatan jiwa di RSJ Mutiara Sukma baik pelayanan Rawat Jalan, Rawat Inap ataupun Pelayanan Kegawat Daruratan Psikiatri tetapi belum memiliki Kartu JKN maka kami persilahkan untuk berkonsultasi ke Dinas Kesehatan Kabupaten Lombok Tengah untuk mendapatkan Surat Keterangan Bansos (Bantuan Sosial) agar bisa mendapatkan pelayanan Kesehatan Jiwa di RSJ Mutiara Sukma gratis karena biaya akan dibayarkan melalui Dana Bantuan Sosial Bidang Kesehatan Kabupaten Lombok Tengah.<br />\r\nSALAM SEHAT JIWA</span></p>\r\n', '2019-01-04');
