(262, 'Indek Kepuasan Masyarakat 2017', '10', '<h3>&nbsp;</h3>\r\n\r\n<div style=\"margin-left:10px;\">\r\n<div class=\"Section1\">\r\n<p style=\"margin-left:21.3pt; margin-right:0cm; text-align:center\"><strong><u><span style=\"color:black; font-family:times new roman,serif; font-size:12.0pt\">INDEKS KEPUASAN MASYARAKAT DI RSJ MUTIARA SUKMA</span></u></strong></p>\r\n\r\n<p style=\"margin-left:21.3pt; margin-right:0cm; text-align:justify\"><span style=\"color:black; font-family:times new roman,serif; font-size:12.0pt\">Nilai indeks kepuasan masyarakat kumulatif di RSJ Mutiara Sukma diperoleh melalui penggabungan nilai IKM Instalasi Rawat Jalan, Rawat Inap, dan Gawat Darurat. Berikut akan ditampilkan hasil penilaian masyarakat terhadap pelayanan di RSJ Mutiara sukma. </span></p>\r\n</div>\r\n</div>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/admin/images/berita/images/Screenshot_1.jpg\" style=\"height:588px; width:539px\" /></p>\r\n', '2019-05-27'),
(263, 'INDEKS KEPUASAN MASYARAKAT DI RSJ MUTIARA SUKMA TAHUN 2018', '10', '<p style=\"margin-left:21.3pt; margin-right:0cm; text-align:center\"><strong><u><span style=\"color:black; font-family:times new roman,serif; font-size:12pt\">INDEKS KEPUASAN MASYARAKAT DI RSJ MUTIARA SUKMA</span></u></strong></p>\r\n\r\n<p style=\"margin-left:21.3pt; margin-right:0cm; text-align:justify\"><span style=\"color:black; font-family:times new roman,serif; font-size:12pt\">Nilai indeks kepuasan masyarakat kumulatif di RSJ Mutiara Sukma diperoleh melalui penggabungan nilai IKM Instalasi Rawat Jalan, Rawat Inap, dan Gawat Darurat. Berikut akan ditampilkan hasil penilaian masyarakat terhadap pelayanan di RSJ Mutiara sukma.</span></p>\r\n\r\n<p style=\"margin-left: 21.3pt; margin-right: 0cm; text-align: center;\"><span style=\"color:black; font-family:times new roman,serif; font-size:12pt\"><img alt=\"\" src=\"/admin/images/berita/images/Screenshot_2.jpg\" style=\"height:521px; width:605px\" /></span></p>\r\n', '2019-06-17'),
(264, 'IKHTIAR RSJMS MENUJU WBBM', '13', '<p style=\"text-align: justify;\"><span style=\"color:#000000\">IKHTIAR RSJMS MENUJU WBBM<br />\r\nMataram 17 Juni 2019</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">RSJ Mutiara Sukma, Berani jujur......HEBAT !!!, Gratifikasi, Korupsi, Pungli....NO !!!, Pertahankan Akreditasi Paripurna....PASTI BISA...PASTI BISA...PASTI BISA...PASTI BISA...PASTI BISA !!!</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0); font-family:helvetica,arial,sans-serif; font-size:14px\">Yel Yel RSJ Mutiara Sukma mengawali kegiatan Penilaian Pembangunan Zona Integritas menuju Wilayah Birokrasi Bersih dan Melayani (WBBM) oleh Tim Penilai Internal Inspektorat Provinsi NTB.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0); font-family:helvetica,arial,sans-serif; font-size:14px\">Ditengah kesibukan dengan berbagai penilaian dan persiapan survei akreditasi SNARS Edisi 1 seluruh jajaran pimpinan dan Civitas Hospitalia RSJMS tetap berkomitmen tinggi menjalankan amanah Gubernur NTB yaitu sebagai pilot project Pembangunan Zona Integritas dengan kategori predikat WBBM.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:rgb(0, 0, 0); font-family:helvetica,arial,sans-serif; font-size:14px\">Semoga apa yg sudah diikhtiarkan diatas bisa terwujud.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:inherit; font-size:14px\"><a href=\"https://www.facebook.com/hashtag/rsjmsbeintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSbeintegritas</span></a></span><br />\r\n<span style=\"font-family:inherit; font-size:14px\"><a href=\"https://www.facebook.com/hashtag/rsjmsmenujuwbbm?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSmenujuWBBM</span></a></span><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSParipurna</span></span></a></p>\r\n', '2019-06-18'),
(265, 'Start Awal Ikhtiar RSJMS menuju RS Pendidikan.', '13', '<p style=\"text-align: justify;\"><span style=\"color:#000000\">Start Awal Ikhtiar RSJMS menuju RS Pendidikan.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Mataram, Selasa tgl 18 Juni 2019, RSJMS mengundang seluruh institusi pendidikan yang menjalin kerjasama pendidikan dan penelitian untuk mereview perjanjian kerjasama.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Beberapa point penting kesepakatan yang dibicarakan adalah tentang jumlah peserta didik yang akan menjalankan praktik pada satu periode perinstitusi dengan mempertimbangkan ratio peserta didik dan pendidik klinis/non klinis serta keterlibatan peserta didik dalam p<span style=\"font-family:inherit\">rogram peningkatan mutu dan keselamatan pasien di RSJMS</span></span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Dengan diselenggarakannya pertemuan ini diharapkan mutu pendidikan yang diberikan RSJMS kepada peserta didik lebih terjamin serta kehadiran peserta didik dapat meningkatkan kepuasan pasien.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Di akhir kesempatan Direktur RSJMS, Dr. Evi Kustini Somawijaya, MM menyampaikan terimakasih kepada seluruh institusi pendidikan yang telah hadir dan berharap kerjasama tetap terjalin dengan baik.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></span></span></a><span style=\"color:#000000\">.</span><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSparipurna</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsmelayanisemuapihak?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSmelayanisemuapihak</span></span></span></a><span style=\"color:#000000\">.</span></p>\r\n</div>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">&nbsp;</span></p>\r\n', '2019-06-19'),
(266, 'pertemuan penggalangan komitmen dan penyusunan pelayanan prognas', '13', '<p style=\"text-align: justify;\"><span style=\"color:#000000\">Serba-Serbi Persiapan Akreditasi SNARS.<br />\r\n-------------------------<br />\r\nDalam rangka tindak lanjut hasil bimtek akreditasi SNARS EDISI 1 yang lalu. Rabu 19 Juni 2019, bertempat di ruang rapat manajemen. Kasi Pelayanan Medik bersama Pokja prognas menyelenggarakan pertemuan penggalangan komitmen dan penyusunan pelayanan prognas, yang dibuka oleh Kasi Keperawatan selaku Plt. Direktur H. Yahya Ulumuddin, S.Kep.,Ns.</span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">Pertemuan ini bertujuan untuk koordinasi dan sekaligus sosialisasi pada<span style=\"font-family:inherit\">seluruh unsur pimpinan RSJMS tentang standar Pokja program nasional sesuai standarisasi Akreditasi SNARS Edisi 1.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p style=\"text-align: justify;\"><a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSparipurna</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsmelayanisemuapihak?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSmelayanisemuapihak</span></span></span></a><span style=\"color:#000000\">.</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">#RSJMSberintegritas<br />\r\n#RSJMSparipurna<br />\r\n#RSJMSmelayanisemuapihak.</span></p>\r\n</div>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000\">&nbsp;</span></p>\r\n', '2019-06-20'),
