(272, 'PELATIHAN MANAJEMEN NYERI', '13', '<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/64531255_465128170723017_1832541822262444032_n%281%29.jpg\" style=\"height:299px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">KARENA NYERI ITU BERAT, CIVITAS HOSPITALIA RSJMS LAKUKAN INI UNTUK PASIEN.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Dalam rangka peningkatan kemampuan secara berkesinambungan bagi Profesional Pemberi Asuhan (PPA), Kamis 20 juni 2019 diselenggarakan PELATIHAN MANAJEMEN NYERI yang bertempat di aula rehabilitasi.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Kegiatan dibuka oleh Plt. Direktur H. Yahya Ulumuddin, S.Kep.Ns. Pelatihan ini bertujuan untuk meningkatkan kemampuan manajemen nyeri bagi PPA di lingkungan RSJ Mutiara Sukma sesuai dengan kewenangannya sehingga pelayanan asuhan pasien dalam manajemen nyeri dapat sesuai standar yang sudah ditetapkan.</span></p>\r\n\r\n<p><span style=\"color:#000000\">#RSJMSParipurna<br />\r\n#RSJMSberintergritas</span></p>\r\n\r\n<p><span style=\"color:#000000\">#RSJMSmelayanisemua</span></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/65028776_465128204056347_7249436442349273088_n%281%29.jpg\" style=\"height:533px; width:800px\" /></p>\r\n', '2019-07-17'),
(273, 'Sosialisasi Screening Pasien', '13', '<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/65041387_465831430652691_8129983211376738304_n.jpg\" style=\"height:300px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">LAKUKAN SCREENING, WUJUD SECURITY TINGKATKAN KESELAMATAN PASIEN.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Jum&#39;at, 21/6/2019 Kemarin, TIM POKJA Akreditasi Didampingi Plt. Kasi Pelayanan Medik, Dr. Hj. Wiwin Nuhasida, dan Ka. Urusan Umum Mujiasih, SKM. Melakukan Sosoalisasi terhadap seluruh sejawat security tentang Skrining/Penapisan Pasien yang masuk ke RSJ Mutiara Sukma,&nbsp;</span></p>\r\n\r\n<p><span style=\"color:#000000\">baik pasien Rawat Jalan Maupun IGD.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Kegiatan ini bertujuan untuk menambah pengetahuan security tentang cara skrining pasien, diharapkan Security mampu memahami kebutuhan pasien saat masuk dan meningkatkan keselamatan pasien RSJ Mutiara Sukma.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Bravo Security RSJ Mutiara Sukma!!!</span></p>\r\n\r\n<p><span style=\"color:#000000\">#RSJMSberintegritas</span><br />\r\n<span style=\"color:rgb(0, 0, 0)\">#RSJMSparipurna</span></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/64674776_465831457319355_2388779875671474176_n.jpg\" style=\"height:600px; width:800px\" /></p>\r\n', '2019-07-17'),
(274, 'Kredensial Komite Medik RSJMS', '13', '<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/64913393_465961950639639_9172785821848174592_o.jpg\" style=\"height:185px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">Sisi Lain Suksesnya Pelayanan di RSJ Mutiara Sukma.&nbsp;<br />\r\nSelain Sinergitas Pelayanan antara medis, perawat dan tenaga kesehatan lainnya, yang membuat suksesnya pelayanan di RSJ Mutiara Sukma adalah adanya kredensial yg berjenjang disetiap profesi pemberi pelayanan dan tenaga kesehatan lainnya.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Yuk intip keseruan dokumentasi kredensial yg dilakukan oleh Komite Medik RSJ Mutiara Sukma di ahir pekan ini.</span></p>\r\n\r\n<p><a href=\"https://web.facebook.com/hashtag/rsjmsparipurna?source=feed_text&amp;epa=HASHTAG\">#RSJMSparipurna</a><br />\r\n<a href=\"https://web.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\">#RSJMSberintegritas</a></p>\r\n\r\n<p><img alt=\"\" src=\"/admin/images/berita/images/64714750_465962153972952_5853027739879079936_n.jpg\" style=\"height:600px; width:800px\" /></p>\r\n', '2019-07-17'),
(276, 'BENCHMARKING KE RSJ DAERAH SURAKARTA', '13', '<p style=\"text-align: center;\"><img alt=\"\" src=\"/admin/images/berita/images/65203083_469330663636101_1031217576140603392_o.jpg\" style=\"height:369px; opacity:0.9; text-align:center; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">RSJ MUTIARA SUKMA MANTAPKAN PERSIAPAN SURVEI AKREDITASI SNARS EDISI I MELALUI BENCHMARKING</span></p>\r\n\r\n<p><span style=\"color:#000000\">Untuk lebih memantapkan persiapan survei akreditasi versi SNARS Edisi 1, Kamis (27/6/019) Tim Akreditasi RSJ Mutiara Sukma yang diwakili oleh koordinator masing-masing pokja melakukan benchmarking ke RSJ Daerah Surakarta.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Kegiatan ini dipimpin langsung oleh Direktur RSJ Mutiara Sukma Dr. Evi Kustini Somawijaya, MM yang didampingi oleh Ketua Akreditasi yang sekaligus Kepala Seksi Keperawatan Yahya Ulumuddin, S.Kep., Ns. Tim diterima di aula pertemuan langsung oleh Plt. Direktur RSJ Daerah Surakarta Dr. Agustini Christiawati, MM beserta seluruh jajaran pimpinan di RSJD Surakarta, ketua akreditasi dan seluruh koordinator pokja dibawahnya.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Sebelum kegiatan dimulai Direktur RSJ Mutiara Sukma diminta untuk memberikan sambutan, dalam sambuatannya beliau mengawali dengan sebuah pantun &rdquo; Bunga mawar bunga melati selalu berkembang setiap hari, Sungguh terhormat kami bisa hadir disini untuk menimba ilmu akreditasi, beliau menyampaikan apresiasi yang sebesar-besarnya atas penerimaan yang hangat dari Civitas Hospitalia RSJD Surakarta dan berharap bisa menimba banyak ilmu dalam implementasi akreditasi..</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pada kegiatan benchmarking ini Tim RSJ Mutiara Sukma memanfaatkan waktu dan kesempatan yang sudah ada dengan sebaik-baiknya, tim langsung berbagi menuju ke penanggung jawab masing-masing pokja RSJD Surakarta untuk melihat implementasi langsung serta dokumen yang ada dilanjutkan dengan sharing pengalaman dengan tanya jawab terkait hal-hal yang mungkin masih harus diperbaiki di RSJ Mutiara Sukma, banyak hal dan ilmu bermanfaat yang diterima dan patut diimplementasikan di RSJ Mutiara Suka.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Dengan kegiatan ini kami harapkan bisa menambah ritme percepatan tim dalam persiapan survei akreditasi versi SNARS Edisi 1 pada 31 Juli 2019 mendatang, dan semangat dari Civitas Hospitalia RSJD Surakarta bisa menular kepada Tim Akrediatasi RSJ Mutiara Sukma.</span></p>\r\n\r\n<p style=\"text-align:center\"><a href=\"https://web.facebook.com/hashtag/rsjmsterakreditasiparipurna?source=feed_text&amp;epa=HASHTAG\">#RSJMSterakreditasiparipurna</a><br />\r\n<a href=\"https://web.facebook.com/hashtag/rsjmsberintegrasi?source=feed_text&amp;epa=HASHTAG\">#RSJMSberintegrasi</a></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/65248821_469330686969432_3629247846156337152_n.jpg\" style=\"height:225px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/65193144_469330713636096_1414844093674029056_n.jpg\" style=\"height:225px; width:400px\" /></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/65690116_469331663636001_4813899937785839616_o.jpg\" style=\"height:600px; width:800px\" /></p>\r\n', '2019-07-17'),
(277, 'GRAFIK CAPAIAN MUTU TW I TAHUN 2019', '10', '<p><img alt=\"\" src=\"/admin/images/berita/images/VISUALISASI%20WEB%20INDIKATOR%20RS%202018-12%281%29.jpg\" style=\"height:1283px; width:800px\" /></p>\r\n', '2019-07-26'),
(278, 'GRAFIK CAPAIAN MUTU TW II TAHUN 2019', '4', '<p><img alt=\"\" src=\"/admin/images/berita/images/LAMPIRAN%20surat%20PPID%20TW%201-2%202019%20%281%29-2.jpg\" style=\"height:1227px; width:800px\" /></p>\r\n', '2019-07-26'),
(279, 'SURVEI AKREDITASI VERSI SNARS EDISI 1 DI RSJ MUTIARA SUKMA', '13', '<p style=\"text-align: center;\"><img alt=\"\" src=\"/admin/images/berita/images/67637293_489650958270738_8942041461239578624_o.jpg\" style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:14px; height:267px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p>SEMOGA PARIPURNA &ldquo;SURVEI AKREDITASI VERSI SNARS EDISI 1 DI RSJ MUTIARA SUKMA&rdquo;</p>\r\n\r\n<p>Alhamdulillah seluruh rangkaian kegiatan survei akreditasi versi SNARS Edisi I di RSJ Mutiara Sukma telah berakhir. Kegiatan panjang yang berlangsung selama 4 hari dari tanggal 31 Juli 2019 sampai dengan 3 Agustus 2019 diawali dengan pertemuan ramah tamah Tim Surveior KARS yang dipimpin oleh Dr. Asianto Supargo, Sp.KJ bersama Dewan Pengawas, seluruh jajaran manajemen RSJ Mutiara Sukma serta koordina<span style=\"font-family:inherit\">tor POKJA Akreditasi. Pertemuan ini dihadiri langsung oleh Sekretaris Daerah Provinsi NTB, Bpk. Ir. H. Iswandi., M.Si, dalam kesempatan tersebut beliau menyampaikan bahwa Pemeintah Provinsi memberikan apresiasi dan dukungan penuh atas terakreditasinya Rumah Sakit Jiwa Mutiara Sukma.</span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p>Pada Rabu, 31 Juli 2019 Pembukaan Survei Akreditasi Versi SNARS Edisi I dihadiri dan dibuka langsung oleh Gubernur Provinsi NTB, Bpk. Dr. Zulkieflimansyah, S.E., M.Sc, dalam sambutannya beliau menyampaikan Rumah Sakit Jiwa Mutara Sukma harus mempersiapkan diri dan mendukung dengan kegiatan-kegiatan bertaraf internasional di Provinsi NTB, jadi dengan terakreditasinya Rumah Sakit Jiwa Mutiara Sukma bisa menjadi salah satu dukungan persiapan event tersebut.<br />\r\nPada hari pertama, setelah pembukaan kegiatan dilanjutkan dengan presentasi Direktur tentang Peningkatan Mutu dan keselamatan Pasien dan Program MDGs dan dilanjutkan dengan telusur dokumen baik dari pokja dibawah manajemen, medis ataupun keperawatan, pada hari kedua kegiatan diawali dengan klarifikasi oleh ketua Tim Survei dan masukan kepada Direktur, dilanjutkan dengan wawancara pemlik yang dihadiri langsung oleh sekda Provinsi NTB, Dewan Pengawas RSJ Mutiara Sukma dan Direktur, setelah ishoma kegiatan dilanjutkan dengan telusur manajemen, medis dan keperawatan, pada hari ketiga kegiatan diawali dengan klarifikasi oleh ketua Tim Survei dan masukan kepada Direktur, dilanjutkan wawancara dengan Pimpinan Institusi Pendidikan yang bekerjasama dengan RSJ Mutiara Sukma kemudian kegiatan dilanjutkan dengan telusur manajemen, medis dan keperawatan, pada hari terakhir adalah kegiatan telusur KKS diambil dari 10 orang tenaga medis, 5 orang tenaga keperawatn dan 5 orang tenaga kesehatan lain, selain kelengkapan dojumen kepegawaian ditelusur juga proses kredensialing, kemampuan cuci tangan, BHD serta kepiawaian penggunaan APAR, dan kegiatan ditutup dengan exit conference dan penampilan Paduan Suara Grup Gita Sukma RSJMS.</p>\r\n\r\n<p>Dengan saling bekerjasama semua usaha sudah diberikan maksimal oleh seluruh civitas Hospitalia RSJMS, dan hasilnya kita serahkan kepada Yang Maha Kuasa, tinggal doa yang kuat dari semua civitas Hospitalia RSJMS dan biarkan doa kita yang bekerja untuk menentukan hasilnya dari MAHA PENGABUL SEGALA DOA. InsaaAllah Paripurna.</p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsterakreditasiparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSterakreditasiparipurna</span></span></a><br />\r\n<span style=\"font-family:inherit\"><a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></a></span></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/67932117_489650521604115_1302377351371292672_o.jpg\" style=\"height:267px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/67899519_489650558270778_6235867969159692288_o.jpg\" style=\"height:267px; width:400px\" /></p>\r\n</div>\r\n', '2019-08-06'),
(280, 'RSJ MUTIARA SUKMA BERBAGI DALAM MEMPERINGATI IDUL ADHA 1440 H', '13', '<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/68720912_492791407956693_5469483234746171392_n.jpg\" style=\"height:266px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p>Senin, 12 Agustus 2019 semarak Idul Adha 1440 H nampak di Musholla Attaqwa Rumah Sakit Jiwa Mutiara Sukma, kegiatan rutin tahunan Civitas Hospitalia Rumah Sakit Jiwa Mutiara Sukma (CHRSJMS) dalam memperingati Hari Raya Idhul Adha yang diinisiasi oleh pengurus</p>\r\n\r\n<p>mushalla At Taqwa RSJ Mutiara Sukma yaitu pelaksanakan penyembelihan hewan qurban, dimana tahun ini terkumpul sebanyak 1 ekor sapi dan 6 ekor kambing dari b<span style=\"font-family:inherit\">eberapa pegawai yang berqurban.<br />\r\nPenyembelihan hewan qurban dilaksanakan di halaman mushalla dengan disaksikan oleh Direktur RSJ Mutiara Sukma, Dr. Evi Kustini Somawijaya, MM bersama panitia dan segenap CHRSJMS.&nbsp;<br />\r\nDaging hewan qurban dibagikan kepada masyarakat di lingkungan sekitar RSJ Mutiara Sukma yaitu Dasan Taman, Dasan Jangkrik, Dasan Jangkuk, Selagalas Baru, Tegal dan Bukbuk. Selain itu daging hewan qurban ini juga dibagikan kepada para cleaning service, security, driver dan CHRSJMS lainnya yang berhak mendapatkan.<br />\r\nManajemen dan panitia mengucapkan terimakasih kepada segenap CHRSJMS yang telah bahu membahu melaksanakan kegiatan ini. Semoga menjadi amal ibadah dan membawa keberkahan bagi kita semua. Aamiin...<br />\r\nSELAMAT HARI RAYA IDHUL ADHA 1440 H, Semoga kita semua bisa memaknai dan meneladani ketaatan, ketaqwaan serta keikhlasan Nabi Ibrahim AS dan Nabi Ismail AS.</span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsterakreditasiparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSterakreditasiparipurna</span></span></a>#<br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></span></a>#<br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsberbagi?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberbagi</span></span></a>#</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/68246293_492791351290032_3905133777629741056_n.jpg\" style=\"height:350px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/67874994_492791667956667_6210002641016061952_n.jpg\" style=\"height:267px; width:400px\" /></p>\r\n</div>\r\n', '2019-08-12'),
(281, 'Sosialisasi Elektronik Klaim (E-Claim) 2019', '13', '<p style=\"text-align: center;\"><img alt=\"\" src=\"/admin/images/berita/images/67960155_493303351238832_2433447114643079168_n.jpg\" style=\"height:225px; opacity:0.9; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p>Pagi ini, 13 Agustus 2019 BPJS Kesehatan melakukan kunjungan ke RSJ Mutiara Sukma sekaligus memberikan sosialisasi terkait elektronik klaim (e-claim) 2019. Sosialisasi ini dihadiri oleh direktur, unsur manajemen RSJ Mutiara Sukma, Tim IT, Coder, Tim Verifikasi serta Tim Rekam</p>\r\n\r\n<p>Medis RSJ Mutiara Sukma. E-claim ini merupakan simplifikasi dari metode pengklaiman sebelumnya dan ke depannya diharapkan dapat memudahkan pihak RS dalam mengajukan klaim pelayanan.</p>\r\n\r\n<p>Jika bisa dibuat mudah, kenapa dipersulit.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/68687327_493303531238814_7942406596397629440_n.jpg\" style=\"height:225px; width:400px\" /><img alt=\"\" src=\"/admin/images/berita/images/68359001_493303584572142_3280219197157670912_n.jpg\" style=\"height:225px; width:400px\" /></p>\r\n', '2019-08-13'),
