(283, 'Indek Kepuasan Masyarakat 2018', '22', '<p style=\"text-align:center\"><strong><u><span style=\"color:black; font-family:times new roman,serif; font-size:12pt\">INDEKS KEPUASAN MASYARAKAT DI RSJ MUTIARA SUKMA</span></u></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:black; font-family:times new roman,serif; font-size:12pt\">Nilai indeks kepuasan masyarakat kumulatif di RSJ Mutiara Sukma diperoleh melalui penggabungan nilai IKM Instalasi Rawat Jalan, Rawat Inap, dan Gawat Darurat. Berikut akan ditampilkan hasil penilaian masyarakat terhadap pelayanan di RSJ Mutiara sukma.</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"color:black; font-family:times new roman,serif; font-size:12pt\"><img alt=\"\" src=\"/admin/images/berita/images/Laporan%20Survey.pdf_page_1%281%29.jpg\" style=\"height:522px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Laporan%20Survey.pdf_page_2.jpg\" style=\"height:602px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Laporan%20Survey.pdf_page_3.jpg\" style=\"height:426px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Laporan%20Survey.pdf_page_4.jpg\" style=\"height:532px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Laporan%20Survey.pdf_page_5.jpg\" style=\"height:452px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Laporan%20Survey.pdf_page_6.jpg\" style=\"height:573px; width:816px\" /></span></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><font color=\"#000000\" face=\"times new roman, serif\"><span style=\"font-size:16px\">Bagi yang ingin melihat secara lengkap dapat mendownloadnya di <a href=\"https://rsjmutiarasukma.ntbprov.go.id/file/Laporan%20Survey.pdf\">SINI</a></span></font></p>\r\n', '2019-09-10'),
(284, 'Kalender Kegiatan Direktur 2019', 'Tes', '<p style=\"text-align: center;\"><img alt=\"\" src=\"/admin/images/berita/images/Kalender%20Kegiatan%20Direktur.pdf_page_1.jpg\" style=\"height:1344px; width:816px\" /><img alt=\"\" src=\"/admin/images/berita/images/Kalender%20Kegiatan%20Direktur.pdf_page_2.jpg\" style=\"height:1344px; width:816px\" /></p>\r\n', '2019-09-11'),
(285, 'MENYAMBUT HUT RI KE-74 RSJ MUTIARA SUKMA BERSIH DAN MERIAH', '13', '<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/68378623_495531317682702_1200531461896142848_n.jpg\" style=\"height:225px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">&ldquo;MENYAMBUT HUT RI KE-74 RSJ MUTIARA SUKMA BERSIH DAN MERIAH&rdquo;</span></p>\r\n\r\n<p><span style=\"color:#000000\">Jum&rsquo;at, 16/8/2019 menyambut perayaan HUT RI Ke- 74, Seluruh Civitas Hospitalia RSJ Mutiara Sukma (CHRSJMS) yang dikomandoi langsung oleh Direktur melaksanakan kerja bakti untuk membersihkan area di lingkungan RSJ Mutiara Sukma, baik didalam rumah sakit maupun luar sekitar Rumah sakit.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Tidak hanya bersih tetapi kemeriahan juga nampak di RSJ Mutiara Sukma dengan adanya pernak pernik dan hiasan dengan nuansa kemerdeka<span style=\"font-family:inherit\">an baik di luar gedung ataupun di ruangan tempat kerja masing-masing, hal ini sebagai salah satu bentuk rasa bangga kami sebagai Masyarakat Indonesia serta rasa bahagia kami dalam menyambut Hari Kemerdekaan Negeri kita tercinta ini.<br />\r\n&ldquo;DIRGAHAYU REPUBLIK INDONESIA KE 74&rdquo;<br />\r\n&ldquo;SUMBER DAYA MANUSIA UNGGUL MENUJU INDONESIA MAJU&rdquo;</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSParipurna</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></span></a>.</p>\r\n</div>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/68410521_495531277682706_4825989446090358784_o.jpg\" style=\"height:189px; width:400px\" /></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/68601466_495531451016022_211520653927383040_n.jpg\" style=\"height:267px; width:400px\" />&nbsp;</p>\r\n', '2019-10-01'),
(286, 'UPACARA PERINGATAN HARI ULANG TAHUN KE-74 KEMERDEKAAN REPUBLIK INDONESIA TAHUN 2019 DI RSJ MUTIARA SUKMA', '13', '<p style=\"text-align: center;\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/69042685_495743170994850_410222655837306880_n.jpg\" style=\"height:267px; width:400px\" /></span></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">&ldquo;DIREKTUR MEMIMPIN UPACARA PERINGATAN HARI ULANG TAHUN KE-74 KEMERDEKAAN REPUBLIK INDONESIA TAHUN 2019 DI RSJ MUTIARA SUKMA&rdquo;</span></p>\r\n\r\n<p><span style=\"color:#000000\">Mataram, Sabtu, 17 Agustus 2019 RSJ Mutiara Sukma menggelar upacara peringatan HUT ke-74 Kemerdekaan Republik Indonesia di area belakang rumah sakit di depan gedung Instalasi Gizi RSJ Mutiara Sukma</span></p>\r\n\r\n<p><span style=\"color:#000000\">Upacara dimulai pukul 07.00 WITA dan diikuti oleh ratusan Civitas Hospitalia RSJ Mutiara Sukma (CHRSJMS) dengan memakai seragam KORPRI bagi tenaga PNS dan se<span style=\"font-family:inherit\">ragam hitam putih bagi tenaga Non PNS serta seluruh jajaran Pejabat Struktural.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Direktur RSJ Mutiara Sukma, Dr. Evi Kustini Somawijaya, MM bertindak sebagai inspektur upacara, Kepala Urusan Umum Mujiasih, SKM selaku penanggung jawab pelaksanaan upacara meyampaikan persiapan yang singkat selama dua hari bisa dimaksimalkan oleh petugas-petugas yang telah ditunjuk sebagai petugas upacara dan berkat kerjasama yang baik persiapan dapat dilaksanakan dengan maksimal.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Dalam amanat inspektur upacara, Direktur membacakan Sambutan Gubernur NTB pada Peringatan Hari Ulang Tahun Ke-74 Kemerdekaan Republik Indonesia Tahun 2019, dimana dalam sambutan tersebut kita diingatkan untuk mempersiapkan masa depan yang semakin kompleks dan kian menantang, dimana lembar-lembar sejarah baru pasca gempa satu tahun lalu telah menunggu untuk bersama diperjuangkan dengan lebih gigih untuk mewujudkan mimpi besar Pemerintah Provinsi NTB yang dikemas bersama dalam visi NTB Gemilang yang diwujudkan dalam enam misi pembangunan.</span></p>\r\n\r\n<p><span style=\"color:#000000\">RSJ Mutiara Sukma sebagai salah satu OPD dibawah Pemerintah Provinsi NTB wajib berperan serta dalam melaksanakan misi tersebut sesuai tugas pokok dan fungsinya yang antara lain Mewujudkan NTB Bersih dan Melayani, Mewujudkan NTB Sehat dan Cerdas serta Mewujudkan NTB asri dan Lestari.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Dalam terakhir sambutan Gubernur disampaikan bahwa Kemerdekaan Indonesia yang telah diproklamirkan oleh Presiden Soekarno 74 Tahun silam adalah kristalisasi dari perjuangan panjang bangsa Indonesia untuk meraih kemerdekaan. Sejarah ini akan terus dikenang dan sebagai pengingat bahwa sepanjang dan sesulit apapun rintangan tetaplah bisa menghasilkan kemenangan yang gemilang.</span></p>\r\n\r\n<p><span style=\"color:#000000\">&ldquo;DIRGAHAYU REPUBLIK INDONESIA KE 74&rdquo;<br />\r\n&ldquo;SUMBER DAYA MANUSIA UNGGUL MENUJU INDONESIA MAJU&rdquo;</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSParipurna</span></span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"color:#000000\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></span></span></a><span style=\"color:#000000\">.</span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/68662322_495743220994845_5051170887747764224_n.jpg\" style=\"height:300px; width:400px\" /></span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"color:#000000\"><img alt=\"\" src=\"/admin/images/berita/images/68725725_495817930987374_7273330380504039424_n.jpg\" style=\"height:267px; width:400px\" /></span></p>\r\n</div>\r\n', '2019-08-17'),
(288, '8 ASN RSJ Mutiara Sukma Dapat Penghargaan Satyalencana Karya Satya Dari Presiden RI', '13', '<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/69111077_500650370504130_3528031375548481536_n.jpg\" style=\"height:300px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">Bakti 10 Tahun, 8 ASN RSJ Mutiara Sukma Dapat Penghargaan Dari Presiden.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Apel pagi hari ini, 27 Agustus 2019, tampak berbeda, beberapa PNS di lingkungan RSJ Mutiara Sukma mendapatkan penghargaan tanda kehormatan &quot; Satyalencana Karya Satya&quot; dari Presiden Ir. Joko Widodo atas kerja yang penuh kesetiaan, kejujuran, kecakapan, disiplin dan pengabdian yang terus menerus selama 10 tahun kepada Negara Kesatuan Republik Indonesia.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Penghargaan ini di sematkan oleh Direktur RSJ Mutia<span style=\"font-family:inherit\">ra Sukma yang disaksikan oleh pejabat struktural dan Civitas Hospitalia RSJ Mutiara Sukma.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Selamat untuk 8 PNS, Lanjutkan baktimu di negeri ini, 74 Tahun Indonesia Merdeka, SDM Unggul Menuju Indonesia Maju.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSparipurna</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsberitegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberitegritas</span></span></a>.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/69944910_500650407170793_6269342467523346432_n.jpg\" style=\"height:600px; width:800px\" /></p>\r\n</div>\r\n', '2019-10-02'),
(289, 'Tuntaskan Masalah Kejiwaan di NTB, RSJ Mutiara Sukma Turun Ke 5 Kab/Kota di Pulau Sumbawa.', '13', '<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/69158751_502484066987427_2113566067925188608_o.jpg\" style=\"height:185px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">Tuntaskan Masalah Kejiwaan di NTB, RSJ Mutiara Sukma Turun Ke 5 Kab/Kota di Pulau Sumbawa.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Terjadwal minggu ini dari tanggal 26 sd 30 agustus 2019, tim kesehatan jiwa RSJ Mutiara Sukma melakukan mobile klinik di semua kabupaten di pulau sumbawa. Bekerjasama dengan Dinas kesehatan setempat RSJ Mutiara Sukma melakukan pelayanan di Kab. Sumbawa Barat (26/8) , Kab Sumbawa (27/8), Kab. Bima (28/8) Kota Bima (29/8) dan Kabupaten Dompu hari ini tanggal 30 Agustus 2019.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Pada kesemp<span style=\"font-family:inherit\">atan ini, RSJ Mutiara Sukma menurunkan Tim Formasi lengkap yang di Komandoi Ns.H. Yahya Ulumuddin, MM (Perwakilan Manajemen), dr. H Putu Diatmika, Sp.KJ., M.Bio.Med, dr. Arimawati, Ns. I Nengah Darthayasa, M.Kep, Ns. Mursaka, dan Mudrikah Darajati, S.Farm. Apt. Tim melakukan pelayanan dengan penuh semangat dan totalitas tinggi.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Kegiatan ini bertujuan untuk menuntaskan permasalahan kejiwaan di NTB dengan melakukan peningkatan pelaksanaan kerjasma lintas sektor, transfer informasi kejiwaan, Pembinaan dan Pelayanan Kesehatan jiwa di Wilayah Kerja Puskesmas yang sudah ditunjuk Dinas Kesehatan dikabupaten tersebut.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Selain itu, Tim Juga melakukan kunjungan ke rumah pasien/home visit pada Orang Dengan Gangguan Jiwa (ODGJ) yg masih dalam kondisi di pasung, kemudian membukanya. Pada kesempatan itu juga tim memberikan pemahaman kepada keluarga dan Masyarkat bahwa pasung bukan merupakan solusi bagi ODGJ.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Semoga kegiatan ini bisa lebih mendekatkan pelayanan RSJMS kepada masyarakat NTB, dan dapat menekan angka kejadian pasung menuju NTB bebas Pasung.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/ntbbebaspasung?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">NTBBebasPasung</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/odgjjugamanusia?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">ODGJjugamanusia</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSParipurna</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></span></a></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\"><img alt=\"\" src=\"/admin/images/berita/images/69955881_502483936987440_3499782684152954880_n.jpg\" style=\"height:377px; width:720px\" /></span></span></p>\r\n</div>\r\n', '2019-08-30');
INSERT INTO `sekilas_mataram` (`id`, `judul`, `kategori`, `konten`, `tanggal`) VALUES
(290, 'ZERO RUN AWARD RUMAH SAKIT JIWA MUTIARA SUKMA', '13', '<p style=\"text-align: center;\"><img alt=\"\" src=\"/admin/images/berita/images/69111077_500650370504130_3528031375548481536_n%281%29.jpg\" style=\"height:300px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">&ldquo;ZERO RUN AWARD RUMAH SAKIT JIWA MUTIARA SUKMA&rdquo;</span></p>\r\n\r\n<p><span style=\"color:#000000\">Untuk peningkatan kinerja pegawai serta unit kerja implementasi Reward dan Punishment di Rumah Sakit Jiwa Mutiara Sukma terus dikembangkan, tidak hanya diberikan kepada pegawai dengan kinerja terbaiknya, tetapi juga untuk unit kerja yang memiliki kinerja terbaik.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Untuk kali ini &ldquo;Zero Run Award&rdquo; diberikan kepada ruang rawat inap yang memiliki tingkat pasien lari 0 atau dengan kata lain tidak ada pasien lari pada ruang rawat inap&nbsp;<span style=\"font-family:inherit\">tersebut Suatu reward yang mungkin tergolong unik bagi RSU, tetapi tidak dengan RSJ karena di RSJ termasuk di RSJ Mutiara Sukma dikenal istilah Pasien Lari, artinya Pasien yang melarikan diri meninggalkan Rumah Sakit tanpa sepengetahuan petugas. Kejadian ini biasanya disebabkan oleh berbagai pihak, baik Petugas, sarana yang kurang memadai, maupun kelihaian pasien merusak, memanjat dan menerobos petugas dan rumah sakit.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Senin, 2 September 2019 pada saat apel pagi Kepala Seksi Keperawatan, H. Yahya Ulumuddin, S. Kep., Ns mengumumkan ruang rawat inap yang tidak ada kejadian pasien lari. Penyerahan hadiah &ldquo;Zero Run Award&rdquo; diserahkan langsung oleh Direktur RSJ Mutiara Sukma, Ibu Dr. Evi Kustini Somawijaya, MM sebagai apresiasi Manajemen terhadap prestasi yang sudah diraih unit tersebut.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Selamat Kepada Ruangan yang sudah mampu menerapkan &quot;Zero Run&quot;, Semoga hal ini menjadi motivasi setiap unit untuk bekerja lebih baik dan selalu menciptakan inovasi-inovasi di unit kerja masing-masing.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsmenujuparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSmenujuparipurna</span></span></a></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\"><img alt=\"\" src=\"/admin/images/berita/images/70005897_509512606284573_3172198278582239232_o.jpg\" style=\"height:600px; width:800px\" /></span></span></p>\r\n</div>\r\n', '2019-10-02'),
(291, 'PENDAMPINGAN TIM PENILAI INTERNAL INSPEKTORAT PROVINSI NTB DALAM RANGKA RUMAH SAKIT JIWA MUTIARA SUKMA MENUJU WILAYAH BIROKRASI BERSIH DAN MELAYANI (WBBM)', '13', '<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/69813002_509984849570682_6873298333440409600_n.jpg\" style=\"height:300px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">Selasa, 10 September 2019 dilaksanakan pendampingan kembali oleh Tim Penilai Internal Inspektorat Provinsi NTB dalam rangka persiapan penilaian Pembangunan Zona Integritas menuju WBK dan WBBM oleh Tim Penilai Nasional Kementerian Pendayagunaan Aparatur Negara dan Reformasi Birokrasi.<br />\r\nKegiatan ini untuk memaksimalkan has<span style=\"font-family:inherit\">il penilaian komponen pengungkit oleh Tim Penilai Internal pada bulan Juli 2019 lalu dimana masing-masing pokja telah melakukan beberapa perbaikan atas hasil penilaian sebelumnya.</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p><span style=\"color:#000000\">Kegiatan ini juga merupakan salah satu bentuk komitmen CHRSJMS untuk tetap melaksanakan Pembangunan Zona Integritas secara konsisten dan berkesinambungan.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsmenujuparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSmenujuparipurna</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsmenujuwbbm?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSmenujuWBBM</span></span></a></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-family:inherit\"><span style=\"font-family:inherit\"><img alt=\"\" src=\"/admin/images/berita/images/69794097_509984979570669_6060230242276999168_o.jpg\" style=\"height:379px; width:800px\" /></span></span></p>\r\n</div>\r\n', '2019-10-02'),
(293, 'SOSIALISASI TATA NASKAH DAN SPO PELAPORAN SATUAN KERJA/URUSAN/INSTALASI/KOMITE/SEKSI/SUBBAG', '13', '<p style=\"text-align:center\"><img alt=\"\" src=\"/admin/images/berita/images/71762804_522015068367660_5446066815350341632_n.jpg\" style=\"height:300px; width:400px\" /></p>\r\n\r\n<div style=\"page-break-after: always;\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"color:#000000\">SOSIALISASI TATA NASKAH DAN SPO PELAPORAN SATUAN KERJA/URUSAN/INSTALASI/KOMITE/SEKSI/SUBBAG</span></p>\r\n\r\n<p><span style=\"color:#000000\">Jumat 27 September 2019, Dipimpin oleh Ka.Sub. Bagian TU (Ibu Juastri Rondonuwu, SKM.,MPH) lakukan sosialisasi Tatanaskah pelaporan dan SPO pelaporan, membahas perihal draft laporan kinerja satuan kerja/urusan/instalasi/komite dan laporan kinerja seksi/subbag dan bertujuan untuk keseragaman sistematika laporan sesuai standar dan tatanaskah di RSJ Mutiara Sukma Prov. NTB.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Diharapkan s<span style=\"font-family:inherit\">istem pelaporan kedepannya dapat memberikan informasi tentang kinerja RSJ Mutiara Sukma baik untuk kebutuhan internal manajemen maupun untuk memenuhi bahan pelaporan ke pemerintah Provinsi NTB</span></span></p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;\">\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsberintegritas?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSberintegritas</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsmenujuparipurna?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSmenujuparipurna</span></span></a><br />\r\n<a href=\"https://www.facebook.com/hashtag/rsjmsmenujuwbbm?source=feed_text&amp;epa=HASHTAG\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><span style=\"font-family:inherit\">RSJMSmenujuWBBM</span></span></a></p>\r\n\r\n<p><span style=\"font-family:inherit\"><span style=\"font-family:inherit\"><img alt=\"\" src=\"/admin/images/berita/images/72163476_522015128367654_3128129517533528064_n.jpg\" style=\"height:600px; width:800px\" /></span></span></p>\r\n</div>\r\n', '2019-10-02'),
(294, 'SPANDUK HARI KESEHATAN JIWA SEDUNIA KE-27 TAHUN 2019', '21', '<p style=\"text-align:center\"><span style=\"font-size:18px\"><span style=\"color:#000000\">SPANDUK HARI KESEHATAN JIWA SEDUNIA KE-27 TAHUN 2019</span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:26px\"><a href=\"http://bit.ly/hkjs2019\">DAPAT DIDOWNLOAD DISINI</a></span></p>\r\n', '2019-10-03'),
(295, 'Pertemuan Kelompok Swabantu (SHG) dalam rangka memeriahkan Hari Kesehatan Jiwa Sedunia 2019', '13', '<p style=\"text-align: center;\"><img alt=\"\" src=\"/admin/images/berita/images/WhatsApp%20Image%202019-10-10%20at%2017.32.04%20%288%29.jpeg\" style=\"height:267px; width:400px\" /></p>\r\n\r\n<p><span style=\"color:#000000\">SELAMAT HARI KESEHATAN JIWA SEDUNIA, 10 Oktober 2019!<br />\r\nSehat Jiwa, Kami Berdaya.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Salah satu rangkaian kegiatan dalam rangka memperingati dan memeriahkan Hari Kesehatan Jiwa Sedunia ke 27. Hari ini RSJ Mutiara Sukma bekerja sama dengan dinas kesehatan kota Mataram menyelenggarakan SHG bagi kelompok swabantu yaitu kelompok orang dengan gangguan jiwa yang sudah mampu berdaya dan produktif. Pada kegiatan ini juga dilakukan penilaian dan diberikan penghargaan bagi hasil karya dari kelompok swabantu yang terbaik.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Dihadiri oleh Kepala Bidang pengendalian dan pemberantasan penyakit (P2P) Dinas Kesehatan Kota Mataram, kegiatan ini dibuka oleh Plh Ditektur RSJ Mutiara Sukma Pak H. Yahya Ulumuddin, S. Kep,Ns. Dilanjutkan dengan talkshow yang berkaitan dengan Support System ODGJ dimasyarakat.</span></p>\r\n\r\n<p><span style=\"color:#000000\">Diharapkan di Hari Kesehatan Jiwa Sedunia tahun 2019, Hak ODGJ semakin di hargai sehingga diakui di masyarakat.</span></p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/rsjmsparipurna?source=feed_text&amp;epa=HASHTAG&amp;__xts__%5B0%5D=68.ARBRU0qw9gbkVnrQ4ycje3as_9oHrnzeonwMXH6LUzbZb2HfztbPua0mKb0CtIpE_Lm0vWCdCbUQ_kVyU3H9UlgsPLm_b6hfnRMVl7-nMOEDO7DSg3B_o3VmJQFIbI3ugjg-a85dy0fcS1bVMLRXfwfa3TO0rB6hexjZcpSxoCMGtxno3UJqehPUORI7RVlnrI9SqxAFRNLERHgvTU5ty0U1r101WQeCJkc6sRyBiEJuz85Mn-AaZoSrdX_v2-2ql0VGVetzJXeUhC36YspMNtFVQHrRFzyPAH1q7zES2-IpKWxTLKMk8znkxKqp3t29jhisICUthXyQIzRRrw&amp;__tn__=%2ANK-R\"><span style=\"font-family:inherit\"><span style=\"color:rgb(54, 88, 153); font-family:inherit\">#</span><s